INSERT INTO `career_subcategory` VALUES (129,'Biochemical Engineering','3_Biomedical.png','/subCategoryImages/129','2019-12-04 10:23:35',0,1,0,'Do you feel concerned about the pollution of water?	\r\nDo you love finding alternative fuels?\r\nDo you want to find how organisms survive?\r\n	There is one answer for that, is to become a Biochemical Engineer. You will get the opportunity to develop alternative to crude oil and understand on how to convert other sources as a form of fuel. Also, you can use your education to stop pollution on earth, by devising a sewage treatment system, eliminating the ozone layer depletion, and other things that damage the ecosystem. Become a part of the climate change and be a scientific environmentalist. Start your career now and strive towards a better change that you always wanted.',NULL,NULL,NULL,'123','546',NULL,'am-i-the-one-bg.png','/amITheOneImages/129','Detailing the process of every single unit of a biological organisms is a Biochemical Engineering. The role of a Biochemical Engineer is to understand the biological and biochemical phenomena of various microbial and enzymes. Then deal with kinetics of growth, fermentation, agitation, and any other kind of metabolism. Biochemical Engineers, must coordinate with chemist and biologist to understand on how to put their research to use. In general, a Biochemical Engineer examines the biological system and operates it by modifying and controlling the chemical and mechanical process. Their main focus is to create or produce proteins through fermentation and other process for the use of humans and animals. That helps in increasing food production, biofuels, and treatment of Industrial wastewater','5-Biochemicall-Engineers.png','/landingImages/129','A Biochemical Engineer must finish his graduation in BE/B.Tech in Biochemical Engineering. In the under-graduation, the student will understand chemical engineering, biochemistry and microbiology. Then, Biochemical Engineers, will start experimenting at contracted laboratories. Before starting his/hers Under Graduation course the student must be equipped with basics of Chemistry, Physics, Biology, Mathematics, and Statistics. Later, the student can specialize in the area they’re most focused on. During their journey as an undergraduate, the student should try to stay updated with the current news on various problems focus on the environment and the kind of solution needed.','Attain 10+2 or equivalent qualification from a recognized educational Board in Biology/Mathematics/Physics/Chemistry','B.Tech. Biochemical Engineering,\r\nB.Tech. (Bioengineering) + M.Tech. (Biomedical Technology),\r\nB.Tech. (Biomedical Instrumentation),\r\nB.Tech. (Biotechnology and Biochemical Engineering)','M.Tech. Biochemical Engineering,\r\nM.E. (Biomedical Engineering),\r\nM.E. Biochemical Engineering and Biotechnology,\r\nM.S. (Engg.) (Biochemical Engineering and Biotechnology),\r\nM.Tech. (Biomedical Signal Processing & Instrumentation),','Ph.D. (Biomedical Engineering)','Diploma in Aerospace Engineering,\r\nDiploma in Aeronautical Engineering','All India Engineering Entrance Exams (AIEEE).,\r\nBharath University Engineering Entrance Exam.,','All India Post Graduate Medical Entrance Examination.,\r\nJawaharlal Nehru Technology University Engineering Common Entrance Test for Diploma Holders (ECET FDH).,','UGC/ CSIR (JRF) examinations,\r\nNET.,\r\nSET.,','Indian Institute Of Technology (IIT), Kharagpur , Jadavpur University','MERIT-CUM-MEANS SCHOLORSHIP FOR PROFESSIONAL AND TECHNICAL COURSES CS,  NSIT - Netaji Subhas University of Technology','University of Reading, La Trobe University','abroad scholar subcat',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'job roles','','','\" There are no such things as applied sciences, only applications of science.\"','image/png','image/png','image/png','USA is the fastest growing market with the expansion of Biochemical field in most of the States. Projected numbers might be moderate, but this occupation is expected to grow faster than most of the other occupations. Singapore has the lowest number of people employed and India and the US topping the charts of employement. Canada and the European countries do take this occupation as a critical one and welcome skilled people.','This is the age of overlapping and integration of different fields where the Biochemical engineering has emrged as a very fancy proposition.The salaries in this occupation are moderate now as it is quite new, with the growth of demand , the salaries are likely to shoot up in the years to come. As usual, the USA has the highest number of people employed with good pay and India to growing very fast.'),(130,'Aerospace Engineering','1_Aerospace.png','/subCategoryImages/130','2019-12-04 10:22:29',0,1,0,'Do you like Rocket Ships?	\r\nDo you dream of travelling around the space?\r\nDo you love creating flying objects?\r\n	\r\n	This unique dream of yours can be achieved by becoming an Aerospace Engineer. This field is comprised of the very bright level of intellectuals who design some unrealistic things like building rocket ships and missiles. To fulfill this, guide your way to the proper way of education and make a good base foundation to turn into a professional. Work for various reputed companies and government in developing something extraordinary that helps the growth of humans and gain a feeling of accomplishment.\r\n       Start your career now, and become the Kailasavadivoo Sivan of your destiny.\r\n',NULL,NULL,NULL,'44444','444444',NULL,'am-i-the-one-bg.png','/amITheOneImages/130','The design and development of aircraft and spacecraft is called as Aerospace Engineering. Aerospace is a particular branch of engineering that primarily focuses on developing the design for aircraft, spacecraft, missiles, satellites, and other airborne objects. Their job is to develop new technologies for the ones mentioned above and develop new products. Also, an Aerospace Engineer must determine the financial possibility and safety issues with the considering environmental challenges before making an object. Their central role is to make sure that the purposes are meeting the right engineering principles by continually creating prototypes and testing. Aerospace Engineering is divided into two branches, Aeronautical Engineering that deals with object flown in the earth’s atmosphere, and Astronautical Engineering that deals with objects flown out open in the space.','1 Aerospace-Engineers.png','/landingImages/130','An Aerospace Engineer focuses on aviation technology, defense systems, and space exploration. Their primary focus is manufacturing aircraft for commercial and military purposes. Hence, the base to become an Aerospace Engineer is already a set path, so one must complete his Bachelors in Aerospace Engineering. After graduation, the student will have the opportunity to study the field of his interest and pursue his specialization through the graduate course. As a beginner, an Aerospace Engineers monitor and support the current projects, eventually moving forward with the required experience. The engineers will get the opportunity to construct and design their projects. There are numerous universities and programs that offer students education for this course. During their education journey, it’s essential for students to spend more time in the workshops.\r\n','Attain 10+2 or equivalent qualification from a recognized educational Board in Mathematics/Physics/Chemistry.','B.Tech. (Aerospace Engineering),\r\nB.E. (Aerospace Engineering),\r\nB.Tech. Aeronautical Engineering,\r\nB.E. Aeronautical Engineering','M.Tech Aerospace Engineering,\r\nM.Tech. Aeronautical Engineering','PhD (Aeronautical Engineering)','Diploma in Aerospace Engineering, Diploma in Aeronautical Engineering\r\n','All India Engineering/ Architecture Entrance Examination (AIEEE), \r\nDelhi University Combined Entrance Examination (CEE),\r\nHindustan University Entrance Test (HITSEE).','Graduate Aptitude Test in Engineering (GATE),\r\nPunjab Engineering college PhD Entrance exam','Punjab Engineering college PhD Entrance exam','Indian Institute Of Technology, Bombay, Lovely Professional University, Phagwara','CENTRAL SECTOR SCHOLARSHIP OF TOP CLASS EDUCATION FOR (SC) STUDENTS','University of Reading, La Trobe University','CENTRAL SECTOR SCHOLARSHIP OF TOP CLASS EDUCATION FOR (SC) STUDENTS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'job roles','','','“Aeronautics was neither an industry nor a science. It was a miracle.” \r- Igor Sikorsky','image/png','image/png','image/png','The demand for Aerospace Engineers is growing at 2 % worldwide. India needs more aerospace engineers now than ever. Even though India has the lowest number in this profession, the countries entry into commercial satellites and the demand in defence related organizations is becoming more, the country needs around 6000 engineers in this category. The worldwide demand is quite strong, especially in the United Kingdom and the USA as the manufacturing sector in Aerospace is doing really well. The days have come where people are thinking of colonizing Mars and companies like SpaceX are going strong, this category has a stronger appeal than most of the other engineering branches.','The demand for Aerospace Engineers is growing at 2 % worldwide. India needs more aerospace engineers now than ever. Even though India has the lowest number in this profession, the countries entry into commercial satellites and the demand in defence related organizations is becoming more, the country needs around 6000 engineers in this category. The worldwide demand is quite strong, especially in the United Kingdom and the USA as the manufacturing sector in Aerospace is doing really well. The days have come where people are thinking of colonizing Mars and companies like SpaceX are going strong, this category has a stronger appeal than most of the other engineering branches.'),(131,'Marine Engineering','4_Marine.png','/subCategoryImages/131','2019-12-04 05:04:52',0,1,0,'Do you like travelling around the world?	\r\nDo you love to sail on water?\r\nDo you love designing objects that float on water?\r\n	Then you’re sailing to become a Marine Engineer. Gain the opportunity to work on the sea and travel around on the vessel you have designed. Manage the crew and help deliver the requests of your clients. Marine Engineers are one of the highest-paid engineers at the beginning of their careers. In the modern-day, the majority of the ships are fueled by oil that is huge and complex. Many companies are looking forward to cutting this short and make it simple. The largest ship ever constructed never stay constant, and they keep on changing every year. Marine Engineers have a tendency to break records and create new technology.\r\n',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/131','An Engineer who constructs vehicles that travel on the water is called Marine Engineer. In detail, Marine Engineers are those who design and regulate the functions of various transports that move on water. Their expertise in creating cruise ships, oil platforms, submarines, and constructing harbors. Marine engineers work closely with Naval Architects to make their research come to life. Apart from designing the structure, they’re also responsible for the interior on the onboard system, like steering and controls and electrical units. Most of the goods in today’s world are transported through water, and demand for Marine Engineers is never like before. After designing the ships, they also give clear regulations and the kind of maintenance needed to keep the ship intact. When onboard the vessel, Marine Engineers act as a mediator between the ship captain and port authority and supervise other engineers and mechanics. The main role of Marine Engineer is to serve as the brain for the ship and decide what’s best for it. Not only that, Marine Engineers are responsible for researching oceans and seas based on the requirement posted.','4 Marine-Engineers-and-Naval-Architects.png','/landingImages/131','To become a Marine Engineer one needs a basic qualification of a three year diploma in Marine Engineering, and must clear the entrance exams for the position postings from the company. Marine Engineering is a sub-branch of Engineering that deals with Nautical, Architecture and Science. Hence, it’s important for a student to take a step further from the education he/she receives at the university, by researching and thinking outside of the box. As a Marine Engineering you will become a professional and be responsible for operating, maintenance and repair of all major equipment on the board. That includes electricity, fuel system, water distillation, and waste management. Currently, Marine Engineers are hired in public and private shipping companies. There designation is given based on the expertise, for instance a Marine Engineer who research on offshore drilling will spend his work to oversee the oil rig maintenance. ','Attain 10+2 or equivalent qualification from a recognized educational Board in Mathematics/Physics/Chemistry.','B.Tech. (Marine Engineering)., B.Tech. (Naval Architecture and Ocean Engineering)., B.Tech. (Naval Architecture and Ship Building)., Graduate Marine Engineering (GME)., B.Sc. (Marine Engineering).','M.Tech. Marine Engineering., M.E. (Marine Engineering and Mechanical Handling)., M.Tech. (Air Armament)., M.Tech. (Chemistry - (High Energy Materials))., M.Tech. (Gas Turbine Technology)., M.Tech. (Marine Engineering Management)., M.Tech. (Ocean Engineering and Naval Architecture)., Marine Electro Technical Officer.','Ph.D. Marine Science','Diploma in Marine Engineering., \r\nDiploma in Shipbuilding Engineering., \r\nHigher National Diploma Marine Engineering., \r\nPost Diploma in Ship Building., \r\nPost Graduate Diploma in Marine Engineering.','MERI: Marine Engineering and Research Institute entrance exams., IIT JEE: IIT Joint Entrance Examination., AIEEE: All India Engineering Entrance Examination., AICET: All India Common Entrance Test., IMU CET: Indian Maritime University Common Entrance Test.','Graduate Aptitude Test in Engineering (GATE)., Andhra University., Chidambaram Institution of Maritime Technology.','Punjab Engineering college PhD Entrance exam',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','',' “A ship in port is safe, but that’s not what ships are built for.”','image/png','image/png','image/png','The career opportunities in Marine Engineering field in private, instructive, commercial and governmental parts are numerous. The salaries in India ranges from 6lakh per annum to 60 lakh per annum based on the experience, whereas in the USA it ranges from 30 lakh per annum to 2 Cr. Canada employed the maximum number of maritime engineers and most of the countries need experienced maritime engineers which are in short supply.														','The career opportunities in Marine Engineering field in private, instructive, commercial and governmental parts are numerous. The salaries in India ranges from 6lakh per annum to 60 lakh per annum based on the experience, whereas in the USA it ranges from 30 lakh per annum to 2 Cr. Canada employed the maximum number of maritime engineers and most of the countries need experienced maritime engineers which are in short supply.														'),(132,'Agricultural Engineering','2_Agricultural.png','/subCategoryImages/132','2020-01-03 22:28:46',0,2,0,'Do you love farming?	\r\nDo you like managing livestock?\r\nDo you like designing waste management?\r\n	\r\nThen the absolute choice is to become an Agricultural Engineering. Recently, the field is turning out to be one of the most demanded areas of interest, and clearly, a job increment is seen within the near future. As an Agricultural Engineer, you will get the opportunity to devise new ways of farming or improve the existing ones. The students will get a chance to understand the livelihood of various livestock and prepare plans on how to expand them. This engineering will help the students create a significant impact on society by fixing the food demand, and turning every situation environmental friendly.\r\n',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/132','The study that deals with agricultural production are called Agricultural Engineering. Agricultural engineering mainly focuses on developing and improving current technologies on farming. They have the responsibility of building dams, water reservoirs, warehouses, and other structures that help agriculture. Including creating biofuels, which act as a replacement for the current gasoline fuels. Also, they help other engineers solve pollution-related problems caused by farms. Agricultural Engineers at the beginning of their careers work towards putting relevant practices into functional like building dairy effluent schemes, irrigation, drainage, and floodwater control system. Later they would be in charge of testing agricultural machinery and equipment, design food storage structures. The crucial primary responsibility of an Agriculture Engineer is to provide a better change in Agriculture without disturbing the environmental circle.','2 Agricultural-Engineers.png','/landingImages/132','Agricultural engineering is the combination of many major engineering fields shaped into one. A student can proceed further in this field by completing his bachelor from Agricultural Engineering. During their study, the student will gain knowledge about cultivation — design machinery. Learn resource management— land profiling, climatology, atmosphere, and soil management. Agricultural Engineering requires a study set of research and must be careful before putting the research into practice. Hence, it’s important to spend equal time in the classroom and laboratory. Then the student can acquire the essence of field experience. Unlike any other courses offered, Agricultural students are encouraged to participate in projects. Initially, an Agricultural Engineer might inspect sites and monitor equipment. But as the experience progresses, the student can be impactful change. Here are some specialized fields of interest for which the students can pursue after graduation.	','Attain 10+2 or equivalent qualification from a recognized educational Board in Mathematics/Physics/Chemistry.','B.E. (Agricultural Engineering), B.Tech Agricultural Engineering, B.Tech. (Hons.) Agricultural Engineering, B.E. (Agricultural and Irrigation Engineering), B.Tech. (Water Resources Engineering), B.Sc. (Rural Technology)','M.E. Agricultural Engineering, M.Tech. (Agricultural Engineering), M.Tech. (Agricultural Systems and Management), M.Tech. (Aquacultural Engineering), M.Tech. (Farm Machinery and Power Engineering), M.Tech. (Irrigation and Drainage Engineering), M.Tech. (Renewable Energy Engineering and Management), M.Tech. (Renewable Energy), M.Tech. (Rock Engineering and Underground Structures), M.Sc. (Rural Technology), M.Phil. Agricultural Engineering','Ph.D. (Agriculture Engineering), Ph.D. (Agri-Informatics), Ph.D. (Rural Technology),','Diploma in Agricultural Engineering, Post Graduate Diploma in Renewable Energy','Baba Ghulam Shah Badshah University CET@@@Bharath University Engineering Entrance Examination@@@Bihar Combined Entrance Competitive Exam (BCECE)@@@Common Engineering Entrance Test (Haryana CET)@@@Delhi University Combined Entrance Test@@@Engineering@@@Agriculture and Medicine Common Entrance Test (EAMCET)@@@GGSIP University Combined Entrance Test (CET)@@@Gujarat Common Entrance Test (GCET)@@@Indian Institute Of Technology Joint Entrance Exam@@@Institute Of Technology (BHU) Entrance Exam@@@Jammu & Kashmir State Level Entrance Test (SLET)@@@Jawaharlal Nehru Technological University Engineering@@@Agriculture and Medicine Common Entrance Test (CET)@@@Jharkhand Combined Entrance Competitive Exam (JCECE)@@@Joint Admission Test (JAT)@@@Kerala Engineering Agricultural Medical (KEAM)@@@Maharashtra Common Entrance Test (MHCET)@@@National Institute of Technology Combined Pre-Entrance Test@@@Punjab University Common Entrance Test (CET)@@@Tamil Nadu Professional Courses Entrance Exam (TNPCEE)@@@Uttar Pradesh State Engineering Admission Test (UPSEAT)','Graduate Aptitude Test in Engineering (GATE), Indian Council of Agricultural Research (ICAR) All India Entrance Examination, Indian Institute of Technology – Joint Admission Test (IIT – JAM), North Eastern Regional Institute of Science and Technology (NERIST) entrance examination, ','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','“The discovery of agriculture was the first big step toward a civilized life.”','image/png','image/png','image/png','India has 1.8lakh Agricultural Engineers which is more than most of the countries across the world.','India has 1.8lakh Agricultural Engineers which is more than most of the countries across the world.'),(133,'Horticulture','3_Horticulturist.png','/subCategoryImages/133','2019-12-04 04:43:59',0,2,0,'Do you like to garden your house with flowers and vegetables? \r\nDo you love to plant new trees?\r\nDo you like cultivation?\r\n\r\n\r\nThen you have the things needed to be a Horticulturist. Plant flowers and vegetables, experiment with them, and create new ways for time efficiency. Start your lab and make the team, educate others on your research findings. Help create homeowners a perfect landscape of environmental beauty. Suggest people on how to be self-sufficient by sharing the knowledge of growing crops in their backyard. As a horticulturist, you’re not just limited by its profession, and one can grow further and design greenhouses homes and offices. Be a step ahead of others by educating yourself with the necessary skills & responsibilities along with the base of education.',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/133','A horticulturist conducts investigations and experiments to find new ways for plants to help increase crop acceptability. Horticulture is called a garden of culture, and a horticulturist is those who use science and technology to cultivate and propagate various plants in this garden. Plant propagation means to enhance the plants’ quality by developing resistance to insects and diseases, and magnifying the nutrition value. In general, a horticulturist is known as the cultivators, as they grow crops centered on meeting human demands like fruits, nuts, vegetables, ornamental plants, and flowers. Apart from these, horticulturists are also responsible for plant conservation, landscape restoration, and soil management. After research on a plant is done and the solution has arrived. Horticulturists share this knowledge with the farmers and educate them on how to put it in practice. In modern-day, the need of horticulturist is rising because of the expanding urbanization and demand for suitability. As plants are solely responsible for re-vegetation, and the key to clean air and water. Horticulturist doesn’t deal with large scale crop production that is animal husbandry, and their main role is to focus mainly on the growth of food crops that are consumed by humans.','3-Horticulturist.png','/landingImages/133','A horticulturist requires graduation in Horticulture to understand the basics of cultivation and the kind of resources at disposal for growing crops in different environments. One can extend the study of research and narrow down a certain crop by completing his post-graduation. As a horticulturist student, you must keep in mind to obtain useful knowledge of soil-based plant cultivations. After reaching a specific experience, a Horticulturist will supervise a set of team and be a part of commercial sales, crop protection, stock development, and retail operations. Becoming a part of the management and business development of industrial enterprises and are called crop managers. During your journey as Horticulturist, one must maintain a portfolio on the kind of impact they have done. Doing so, a Horticulturist will get the opportunity to work for the amenity sector on a larger scale.','Completion of 10TH., Completion of 10+2.','B.Sc. Horticulture, B.Sc. (Hons) (Horticulture), B.Sc. (Horticulture Science), B.Tech. Horticulture','M.Sc. (Horticulture), M.Sc. (Agriculture Horticulture), M.Sc. (Horticulture- Fruit Production and Post-Harvest Technology), M.Sc. (Horticulture-Floriculture and Landscaping), M.Sc. (Horticulture-Vegetable Science), M.Sc. (Genetics and Plant Breeding), M.Sc. in Soil Science & Agricultural Chemistry , M.Sc. (Plant Protection)','M.Phil. (Horticulture), Ph.D. (Horticulture), Ph.D. (Horticulture - Vegetable Science), Ph.D. (Soil Science and Agriculture Chemistry)','Diploma in Horticulture, Diploma in Commercial Horticulture, Diploma in Fruit Production','Horticulture University Common Entrance Exam(HORTICET)., Sri Konda Laxman Telangana State Horticultural University (HORTICET)., Dr Yashwant Singh Parmar University of Horticulture and Forestry entrance exam., Maharashtra Council of Agricultural Education & Research entrance exam., Common Entrance Test in Horticulture., Vellanikkara College of Horticulture Entrance Exam.','','Common Entrance Test in Horticulture., Dr. Yashwant Singh Parmar University of Horticulture and Forestry entrance exam., Maharashtra Council of Agricultural Education & Research entrance exam., Vellanikkara College of Horticulture Entrance Exam.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Certificate in Water Harvesting and Management (CWHM)','','\"dealing with production and management of plants for food, comfort, feed, recreation, and beauty.\"','image/png','image/png','image/png','Horticulture is taken as a much respected profession of late. No being looked upon as profession of reduced reputation. Bigger Countries like India, The USA and Canada need special and vast measures to keep the greenery intact. Every district in India has parks, lots of emphasis is on protecting parks and increasing green carpet. The salaries are slated to increase at 10% in the next 5 years and the workforce is is to increase at 9%.','Horticulture is taken as a much respected profession of late. No being looked upon as profession of reduced reputation. Bigger Countries like India, The USA and Canada need special and vast measures to keep the greenery intact. Every district in India has parks, lots of emphasis is on protecting parks and increasing green carpet. The salaries are slated to increase at 10% in the next 5 years and the workforce is is to increase at 9%.'),(136,'Commercial Pilot','3_pilot.png','/subCategoryImages/136','2019-12-04 04:24:45',0,4,0,'Have you ever stared at flying flights and want to know the mechanism behind it?\r\nAre you really passionate about aircraft?\r\nIs your dream job lies in aviation? \r\nThen you are the one! Choose your career as a commercial pilot. Fill yourself with knowledge of different aircraft flying techniques and technologies. Adopt advanced and complicated aircraft features to get into this field. A professional commercial pilot will have an exciting and rewarding lifestyle. Also, they can have a chance to travel around the world and experience new cultures.\r\n',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/136','Commercial Pilots are trained and experienced professionals who can be eligible to fly and navigate the various aircraft.\r\nA Commercial Pilot is a type of aircrew officer who operates the flying and navigation acts of an aircraft for rescue operations, firefighting, aerial photography, crop dusting and many more. They should follow the particular rules and regulations to avoid potential accidents and ensure smooth operation. They should capable of handling advanced and complicated aircraft features and professional flight operations such as communicating with air traffic controllers about weather conditions to confirm the flight route, monitoring instruments, and steering the plane. Before starting, commercial pilots prepare their flights accurately, examining different systems on the aircraft and ensure that baggage and load have been loaded perfectly. They must take a look while flying in bridges, power lines, transmission towers, and other dangerous obstacles because even slight changes can have serious consequences. Almost every aircraft will have two pilots and some crew members except for small aircraft. One is the captain or pilot and other is copilot. The pilot supervises the copilot and other crew members. Very high coordination is required between the pilot and copilot while aircraft takeoffs and landings.\r\n','3-Commercial-Pilot.png','/landingImages/136','This is an occupation where skills play a major role than the qualifications. Even though formal education is needed. \r\nTo become a commercial pilot, one should hold a Commercial Pilot Licence. A 10+2 qualification on science stream from a recognised institute, at least 17+ age, physical fitness, perfect health and eyesight is required to take a commercial pilot licence. Complete training is provided on this diploma course. After qualifying, one can get employment in government, private and international airlines. Or can go for further graduation courses for career progression.','Completion of 10th or 10+2 from a recognised board.','B.Sc. (Aviation Technology with Pilot Studies), Commercial Pilot Licence','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Certificate Course in Airline Transport Pilot License@@@ Private Pilot License@@@ Student Pilot License','Indira Gandhi Rashtriya Uran Akademi Entrance Exam@@@CAE - National Flying Training Institute@@@ The Madhya Pradesh Flying Institute','“The engine is the heart of an aeroplane, but the pilot is its soul.”','image/png','image/png','image/png','According to Boeing, there is a requirement of 617,000 pilots in the next 20 years across the Globe. The shortage of pilots is making many airlines cancel their flights. The pilot\'s salary, based on experience, ranges from 6Llakh to 72 Lakh per annum in India. Canada has the highest salaries   The c across the board ranges from 53 Lakhs to 2Cr. India requires 14000 pilots in the next decade, where as the US needs 2.5Lakh. ','According to Boeing, there is a requirement of 617,000 pilots in the next 20 years across the Globe. The shortage of pilots is making many airlines cancel their flights. The pilot\'s salary, based on experience, ranges from 6Llakh to 72 Lakh per annum in India. Canada has the highest salaries   The c across the board ranges from 53 Lakhs to 2Cr. India requires 14000 pilots in the next decade, where as the US needs 2.5Lakh. '),(137,'Air Traffic Controller','1_Air-Traffic-Controller.png','/subCategoryImages/137','2019-12-01 16:47:58',0,4,0,'Do you have a dream of getting into aviation?\r\nAre you good at doing multiple tasks simultaneously in tight schedules and keep track of them?\r\nAre you interested in related technology like radars? \r\nAre you able to concentrate on a task for a long period of time?\r\nIf yes then you can make a goal of becoming an air traffic controller and achieve that by developing your knowledge of technology related to aviation, communication skills since it plays a major role in this job, different weather conditions, and a sense of identifying a problem and find a solution before the loss of lives. This job allows you to make your independent decisions and a good salary package. They will also get other incentives in terms of qualification allowances and posting in cities only.',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/137','Air Traffic Controllers are responsible to avert accidents by assisting and organising the flow of air traffic along with supporting pilots.\r\nAir Traffic Controllers are simply called as ATC’s. Air Traffic Controllers are placed in air traffic control centres and control towers on the ground to work for all private, military, and commercial aircraft operating within its airspace. They need to monitor the position, speed, and altitude of the aircraft by using radars to give directions to the pilots by communicating in radios about plane take-off and landing, and issues with the climate. An ATC maintains a safe distance between multiple aircraft to move all aircraft efficiently and safely both in the sky and on the ground. The primary responsibilities of ATC are maintaining aircraft equipment, weather, traffic volume, traffic type, special activities, governmental actions, and other human factors.\r\n','2-Air-Traffic-Controller.png','/landingImages/137','First of all complete 10+2 in the science stream, then graduation in B.Sc/M.Sc or B.Tech/M.Tech or it’s equivalent with Wireless Communication, Electronics, Radio Physics or Radio Engg.\r\nTo enter into this field candidate needs to clear the written test(ATC), voice test and medical test. Air Traffic Controller’s Guild (India), a recognized training centre in New Delhi trains the candidates who want to pursue this career. It is one year program which covers topics like Air Traffic Services, Aerodromes and Ground Aids, Air Legislation• Meteorology, Communication Procedures, Technical Search and Rescue, and Air navigation. After this training, the selected candidates are sent to Civil Aviation Training Colleges at Allahabad, Uttar Pradesh, or Hyderabad for their further training. If a candidate completes the training successfully, the job is guaranteed for them. Primarily they are recruited as Junior Executive (ATC).','Completion of 10+2 in science stream., Graduation in B.Sc/M.Sc or B.Tech/M.Tech or it’s equivalent with Wireless Communication, Electronics, Radio Physics, Radio Engg or related field.','B.Tech (Any), B.Sc. (Any)','M.Tech (Any) (Optional), M.Sc. (Any) (Optional)','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','ATC Entrance Exam details in India','“When the art of radio communication between pilots and ATC is improved, the result will be vastly increased areas of significant misunderstandings.”','image/png','image/png','image/png','The average salary for the Air Traffic Controller is ?1,082K per year. Based on skills and experience their earnings will vary between ?938K to ?1,227K per annum.','The average salary for the Air Traffic Controller is ?1,082K per year. Based on skills and experience their earnings will vary between ?938K to ?1,227K per annum.'),(138,'Law','1_Civil-Law.png','/subCategoryImages/138','2019-12-04 09:17:01',0,11,0,'Are you good at arguments and judgements?\r\nDo you give your opinion without any bias by analysing and evaluating the available information?\r\nAre you able to communicate your thoughts clearly through communication with someone or a group of people?\r\n\r\nIf yes then move your step towards a path of becoming a lawyer. Make you fit into this field by adopting different logics, techniques and rules which are related to this position. Be smart in negotiating and arguments. Get suggestions from the professors and superior lawyers to get practical knowledge. The law profession is the large source of motivation, opportunity and individual success. ',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/138','A Lawyer is a person who practises or studies law to give advice about the law or represent someone in legal matters.\r\nA lawyer is also called an attorney, a solicitor, a counsellor, or a barrister. A lawyer is an expert who offers guidance about the law or speaks to somebody in lawful issues. A lawyer gives lawful guidance to individuals, government organizations, and private organizations when required. They have to make authoritative records and interpret laws, guidelines, and decisions. A legal advisor has numerous responsibilities which go past the fundamental court preliminary. Examining data, drafting records, interceding debate and giving guidance to customers about their rights are only a few tasks. They also authorized to provide legal counsel, and whose commitment it is to maintain the law while also securing their customer\'s rights. The primary tasks are giving legitimate exhortation and counsel, looking into and gathering data or proof, drawing up authoritative archives identified with separations, wills, contracts and land exchanges.','2-Criminal-Law.png','/landingImages/138','This is an occupation where skills and knowledge plays a major role. In order to become a lawyer, the basic entry requirement is the completion of LLB at the undergraduate level. After completion of a bachelor\'s degree, one can pursue a masters and doctoral level courses to become a professional. To become successful in this profession, it\'s essential to have practical knowledge of applying the law in real life. They should be ready to handle any kind of situations and issues that can happen at any stage. Proper experience and training will make you successful in this profession.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','L.L.B.@@@B.Com. + L.L.B.@@@B.Sc. + L.L.B.@@@B.Sc. + L.L.B. (Hons.)@@@L.L.B. (Hons.)','L.L.M. (Bharatiya Nyaya Darshan and Raj Dharma)@@@L.L.M. (Business Law)@@@L.L.M. (Energy Laws)@@@L.L.M. (Family law)@@@L.L.M. (International Law)@@@L.L.M. (International Trade Law)@@@L.L.M. (Labour Laws)@@@M.A. (Business Law) (Corporate Governance & Statutory Compliances)@@@L.L.M. Corporate Law@@@L.L.M. (Corporate and Financial Law)@@@L.L.M. (Corporate and Securities Law)@@@L.L.M. (Criminal Law)@@@L.L.M. (Crimes and Torts)@@@L.L.M. (Criminal Law and Commercial Law)@@@L.L.M. (Criminal Law and Criminology)@@@Master of Cyber Law and Information Technology (M.C.L.I.T.)','Ph.D. (Interdisciplinary)@@@Ph.D. (International Legal Studies)Ph.D. (Interdisciplinary)@@@Ph.D. (International Legal Studies)','Diploma in Alternative Dispute Resolution System@@@Diploma in Arbitration@@@Conciliation & Alternative Dispute Resolution System@@@Diploma in Intellectual Property Right (IPR)@@@Post Graduate Diploma Course in Securities Law@@@Post Graduate Diploma in Business Law (PGDBL)@@@Post Graduate Diploma in Industrial Law (PGDIL)@@@Post Graduate Diploma in International Law (PGDIL)@@@Post Graduate Diploma in IPR and Patent Law@@@Post Graduate Diploma in Labour Law and Labour Welfare@@@Post Graduate Diploma in Labour Laws (PGDLL)@@@Post Graduate Diploma in Labour Practice (PGDLP)@@@Post Graduate Diploma in Media Laws (PGDML)@@@Post Graduate Diploma in Patent Law and Practice (PGDPLP)@@@Post Graduate Diploma in Patents Law (PGDPL)@@@Post Graduate Diploma in Tax Management and Tax Administration@@@Post Graduate Diploma in Taxation Law (PGDTL)@@@Post Graduate Diploma in Taxation Practice (PGDTP)@@@Diploma in Co-operative Law@@@Diploma in Co-operative Laws and Practice (DCLP)@@@Diploma in International Business Laws and Corporate Laws in India@@@Post Graduate Diploma in Corporate Law (PGDCL)@@@Diploma in Criminal Law (D.Crin)@@@Diploma in Criminology and Penology@@@Diploma in Cyber Law@@@Diploma in Cyber Laws and Information Technology@@@Post Graduate Diploma in Cyber Law@@@Post Graduate Diploma in Cyber Law & Ethics (PGDCE)@@@Post Graduate Diploma in Cyber Law and Information Security (PGDCIS)@@@Post Graduate Diploma in Cyber Laws & Intellectual Property Rights@@@Post Graduate Diploma in Cybercrime & e-Commerce Law (PGDCEL)','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Certificate Course in Cyber Law@@@Post Graduate Certificate in Cyber Law (PGCCL)@@@Certificate Course in Corporate Law','AIBE - All India Bar Exam@@@AILET - All India Law Entrance Test@@@APLAWCET - Andhra Pradesh Common Law Entrance Test@@@AIL LET - Army Institute of Law-Law Entrance Test@@@BHU BLAT - Banaras Hindu University B.A.LL.B.(Hons) Admission Test@@@BHU UET for LLB - BHU LLB Entrance Exam@@@CU BA LLB Entrance Exam - Calcutta University BA LLB Entrance Exam@@@CU LLM Entrance Exam - Calcutta University Master of Legislative Law Entrance Exam@@@Kerala 3 Years LLB Entran - Commissionerate of Entrance Examinations Kerala 3 Years LLB Entrance Exam@@@CLAT - Common Law Admission Test@@@DU LLB Entrance Exam - Delhi University LLB Entrance Exam@@@GU LSAT - Galgotias University Law School Aptitude Test for LLB@@@KLEE - Government of Kerala Law Entrance Exam@@@HPNET - Himachal Pradesh National Entrance Test@@@ITLA - ICFAI Test for Law Admissions@@@IIT Kharagpur RAT - Indian Institute of Technology Kharagpur Research Aptitude Test@@@ILI CAT - Indian Law Institute Common Admission Test@@@','“Lawyers are operators of toll bridges which anyone in search of justice must pass.”','image/png','image/png','image/png','gfgdgfdhgfhjghjhj','jghjhjgjhgjhjhjgjgjguh'),(139,'Forensic Scientist','2_Forensic-Biologist.png','/subCategoryImages/139','2019-12-03 09:55:04',0,6,0,'Have you ever set your career in investigating side?\r\n\r\nDo you like to watch any crime-solving shows or movies on TV?\r\n\r\nAre you interested in creating criminal stories and solve them?\r\n\r\n               If yes, You might just be the neighbourhood legend of the criminology world. Now develop your skills by gaining knowledge in subjects like chemistry, biology, drugs and toxicology. Update yourself to in different angle to solve the crime. Besides the increase in crime rate and criminals in India, the role of forensic scientists is rapidly increasing exponentially and India is facing an essential shortage of forensic scientists who can help courts in deciding the criminal cases. Forensic scientists have lots of other career options including that of specializing in subjects like medicine, engineering, fingerprinting, geology, etc and they can also work as Freelancer.',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/139','Forensic Scientists are the professionals who examine evidence from different angles for solving crimes. A forensic scientist collects, preserve, and analyze evidence during the time of the investigation. They use their knowledge of science to connect the evidence to the scene of the crime. Forensic scientists are committed in forgery detection while others spend their days in examining substances such as fiber, hair and tissue to determine a connection to the crime and to a suspect. some of the forensic scientists specialize in selective areas such as fingerprinting DNA and handwriting analysis biochemistry they prepare reports to document their findings. They will provide scientific findings for use in courts of law to support the defence in criminal and civil investigations.','2-Forensic-Biologist.png','/landingImages/139','Generally to become expert in this field one needs to go for a bachelor\'s degree in some type of science such as chemistry, biology and physics as an entry-level after completing bachelor’s one can go for masters in Forensic science or related field. PhDs for this job is to make yourself more competitive. So, you can enrol for a PhD degree in anthropology with focuses on human osteology and anatomy, or a Forensic pathologist would need at least a Doctor of Dental Science (DDS) degree from a recognised institute. While pursuing your graduation one can improve your personal traits like integrating your communication skills, ability to take note of every important point and able to explain what you\'ve done correctly.','Attain 10+2 or equivalent qualification from a recognized educational Board. ','B.Sc. (Forensic Sciences)@@@B.Sc. (Hons.) Forensic Science','M.Sc. (Forensic Science & Criminology)@@@M.Sc. (Forensic Sciences)','Ph.D. (Disciplines of Forensic Sciences)','Advanced Diploma Course Certification in Forensic Sciences and Criminology@@@Diploma in Document Examination@@@Diploma in Finger Print Examination@@@Post Graduate Diploma in Cyber Crime Investigation & Computer Forensics@@@Post Graduate Diploma in Forensic Psychology@@@','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Certificate Course in Basics of Diet Therapy@@@Certificate Course in Forensic Science','Banaras Hindu University M Sc Entrance Exam@@@Bundelkhand University M.Sc Entrance Exam@@@Common Entrance Test for Post Graduate Diploma Courses@@@Delhi University M.Sc Entrance Exam@@@Dr Hari Singh Gour Vishwavidyalaya Post Graduate Entrance Test@@@Karnataka University MA in Criminology and Forensic Science Entrance Exam@@@National Law University National Entrance Test@@@Osmania University M Sc Entrance Exam@@@Punjabi University M.Sc Criminology and Forensic Science Entrance Exam@@@University of Madras M.A Criminology Entrance Exam@@@University of Madras PhD Entrance Exam','“Forensics is eloquence and reduction..”','image/png','image/png','image/png','',''),(140,'Geologist','4_Geophysicist.png','/subCategoryImages/140','2019-12-04 07:29:56',0,6,1,'Have you ever thought all the minerals and metals are coming from?\r\n\r\nDo you like to conduct research on metals?\r\n\r\nAre you interested to study about history and composition structure of the earth?\r\n\r\n               If yes, then you are near to be called as a geologist. To become an expert in this field you can go for learning about metals and minerals found in the earth and there is a huge scope for the geologist because India produces a very little number of Geologists. The compensation is pretty high with good career options like Mining, Paleontology, Geophysics etc..',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/140','A geologist is a person who investigates the structure, composition and history of the earth through accurate classification, collection and examination of soils, rocks and fossil remains. Geologist also plans and conducts geological surveys for research and application. Moreover, these are the individuals who prepare geological maps, reports in connection with minerals, resource management, land use or drilling. And, they analyze and interpret geological information from survey data, boreholes or aerial photos.  They are involved in exploration for mining industries in searching for metals, oils, coal and other earth resources.','3-Geologist.png','/landingImages/140','To become geologist, one can go for a bachelor\'s degree in geology or related field from a recognised institute or university after completion of 12 class from science either in medical or non-medical. After completion of the bachelor\'s one can go for masters in geology or related field. To become an expert in this field one can go higher studies like doctoral courses (PhD in geology). Apart from graduation, one should be good at problem-solving skills, good communication skills, outdoor skills and physical stamina.','To become geologist, one can go for a bachelor\'s degree in geology or related field from a recognised institute or university after completion of 12 class from science either in medical or non-medical. After completion of the bachelor\'s one can go for masters in geology or related field. To become an expert in this field one can go higher studies like doctoral courses (PhD in geology). Apart from graduation, one should be good at problem-solving skills, good communication skills, outdoor skills and physical stamina.','B.Sc. (Geology)@@@B.Sc. (Hons.) Geology@@@B.Tech. + M.Tech. Applied Geology Engineering@@@B.Tech. Applied Geology@@@B.Tech. Applied Geology Engineering + MBA@@@Bachelor of Arts (B.A) in Geology, Earth science, Environmental science','M.Phil. (Applied Geology)@@@M.Sc. (Applied Geology and Geoinformatics)@@@M.Phil. (Geology)@@@M.Sc. (Applied Geology)@@@M.Sc. (Earth Science & Resource Management)@@@M.Sc. (Geology)@@@M.Sc. (Petroleum Geology)@@@M.Sc. (Tech.) (Geology)@@@M.A. Geology M.Sc. Geology@@@M.Tech. Geology','Ph.D. (Geological Sciences)@@@Ph.D. (Geology)','Diploma of Associateship in Applied Geology','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','Cochin University of Science and Technology - Common Admission Test@@@Osmania University Postgraduate Common Entrance Test@@@Banaras Hindu University Postgraduate course entrance exam (MMUS)@@@Andhra University Region Post Graduate Common Entrance Test State level PG Entrance Examination@@@All India PG Entrance Examination.@@@Andhra University Common Entrance Test (AUCET)@@@Andhra University Region Post Graduate Common Entrance Test State level PG   Entrance Examination@@@Banaras Hindu University Postgraduate course entrance exam (MMUS)@@@Bharathiyar University M.Phil. Meteorology Entrance Exam@@@Cochin University of Science and Technology, CUSAT Common Admission Test@@@Cochin University of Science and Technology: Department of Atmospheric Sciences Entrance Exam@@@Common Entrance Test for Central Universities@@@CSIR National Eligibility Test (NET)@@@Delhi University Entrance Exam@@@IIT-Graduate Admission Test in Engineering (GATE)@@@Indian Army Surveyor Auto Cartographer Examination (Civil Service)@@@Indian Institute of Science (IISc): Department of Physics, Bangalore (Karnataka) Entrance Exam@@@Indian Institute of Science Entrance Test@@@Indian Institute of Technology Joint Admission Test@@@Jamia Milia Islamia Geography Entrance Exam@@@Banaras Hindu University Postgraduate Entrance Test (BHU PET)@@@Jawaharlal Nehru technical university digital cartography entrance exam@@@JIPMER@@@Jawaharlal Nehru University Entrance Exam@@@Joint Entrance Screening Test@@@Kurukshetra University (KUK) Entrance Test@@@Maharaja Sayajirao University of Baroda PhD entrance Exam@@@Mahatma Jyoti Rao Phoole University Jaipur Postgraduate Diploma in Geographical Cartography@@@Osmania University Postgraduate Common Entrance Test@@@Osmania University postgraduate diploma in cartography entrance exam@@@Pune University MSc Entrance Exam@@@Shivaji University M.Sc. Entrance Exam@@@Sri Venkateshwara University Common Entrance test@@@University of Kolkata Entrance Exam','“The geologist takes up the history of the earth at the point where the archaeologist leaves it and carries it further back into remote antiquity.”','image/png','image/png','image/png','India has the highest number of people employed in this field and the demand is not as the supply is quite less. Even the UPSC holds a separate exam for geologists and amany government organisations like ONGC, Dept of Atomic Energy, Oil India Limited, Gelogogical Survey of India and NGRI employ people from this occupation. India is expected to employ 40% more geologists before 2030. This indicates that geologists are in a strong demand.','Geology is a vast field with multiple apllications from minerals to oil and gas.  The number of new geology graduates is not projected to meet expected needs across the world. The geologist occupation is welcomed in Canada and European countries as biological Geologist. biostratigrapher. chemical Geologist. coal geologist. consulting geologist. consulting geophysicist. development geologist. environmental geologist. USA pays the highest in this field with a starting pay of 36 lakh for a fresher and UK scores second with around 31 lakh but the upward trend for experience goes upto 1crore. '),(141,'Aquaculturist','2_Aqua-culturist.png','/subCategoryImages/141','2019-12-05 04:13:11',0,2,0,'Do you forget yourself while playing with fishes in your aquarium?\r\nDid you have a keen interest in aquatic creatures?\r\nDo you love to cultivate freshwater and marine organisms?\r\nIf yes then there you can go as an aquaculturist. Make your self ready and suitable for this field by acquiring different cultivation methods and techniques of cultivation of different aquatic animals. In the year 2007, aquaculture produced 43 percent of seafood for human consumption and it is expected to grow for future demand. At present, there is a lack of skilled workers, as a result, this industry is recruiting personnel from around the globe, including Poland, Northern Africa, South America, and Asia. The developing fishery industry is providing employment for highly skilled personnel engaged in the scientific breeding and management of fisheries.',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/141','An aquaculturist is a scientist who studies and cares for marine organisms.\r\nAquaculturists are responsible for the growth, development, and production of aquatic animals like healthy fish, lobsters, crabs, etc. Their task is to cultivate freshwater and saltwater organisms under-maintained conditions. They need to take care of the farming and rearing process to improve the production like a regular stocking, feeding, protection from predators, etc. they will monitor systems and operations such as aquatic animals behavior, feed consumption, and water quality parameters like temperature, salinity, and oxygen levels. They are also responsible for storing, transporting and marketing the aquatic animals which depend on the size of the organization they are working in.','4-Aqua-culturist.png','/landingImages/141','This field requires a bachelor\'s degree in aquaculture, fisheries, Marine biology, Ecology, Fish and Wildlife or any related field. For career advancement, one can opt for courses like masters and doctoral courses. The courses in aquaculture are also providing diploma and certificate levels. The majors in this field can be placed in government and regulatory agencies, large scale aquaculture operations, and aquaculture industry sales. To reach the advanced positions of this field gain a proper education with practical approach and experience.','Attain 10+2 or equivalent qualification from a recognized educational Board in the Science stream.','BSc.(Aquaculture)@@@B.F.Sc. in Aquaculture','M.F.Sc. (Applied Aquaculture)@@@M.F.Sc. (Freshwater Aquaculture)@@@M.F.Sc. (Inland Aquaculture)@@@M.Sc. Mariculture@@@M.Sc. Coastal Aquaculture and Marine Biotechnology@@@M.Sc. Aqua Culture@@@M.Sc. Applied Fisheries and Aquaculture','Ph.D. Aqua Culture','Diploma in Aquaculture@@@Post Graduate Diploma in Aquaculture','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Certificate Course in Aquaculture','ICAR All-India Entrance Examination@@@Orissa University of Agriculture and Technology Common Entrance Examination@@@Dr. Balasaheb Sawant Konkan Krishi Vidyapeeth Common Admission Test@@@Tamil Nadu Veterinary and Animal Sciences University Entrance Exam@@@Karnataka Common Entrance Test@@@Junagadh Agricultural University Entrance Test@@@Kerala Agricultural University Common Entrance Test@@@Maharana Pratap University Graduate Test@@@Central Institute of Fisheries, Nautical & Engineering Training Entrance Test.',' “We must plant the sea and herd its animals … using the sea as farmers instead of hunters. That is what civilization is all about—farming replacing hunting.”','image/png','image/png','image/png','Fisheries and the allied industries have experienced a huge shortage of skilled manpower. The demand for skilled manpower in Canada and UK are the highest in number terms.  India needs 16000 fisheries graduates in the next ten years , whereas UK needs more than a lakh skilled graduates in this occupation. There is a strong demand for fisheries graduates in Africa too. Latin American countries like brazil and also Japan and North America have considerable demand for fisheries professionals.','Fisheries forms one fourth of agricuture GDP in India. Career opportunities in fisheries areaplenty and ranging from State Governments, Central Government, NABARD, Banks and numerous private organizations which manufacture and design various aqua products. There is a huge shortage of skilled manpower in this area. Even though the salaries for the freshers are quite moderate, experienced people get very good packages in this industry. Fisheries is one of the major source of many other subsidiary industries and Canada is leading the salary race in this occupation with 30 lakh per annum and above.  '),(142,'Plant Geneticist','4_Plant-Geneticist.png','/subCategoryImages/142','2019-12-05 09:53:38',0,2,0,'Are you really passionate about genetics and growing plants?\r\nDo you like researching and experimenting with plants? \r\nHave you ever used any techniques to produce new plants? \r\n\r\nThen you can be! You are clearly passionate about it.  In addition, you should know the examination of different plant cells, genetics. Also, gain knowledge on botanical research, ecology and evolutionary studies, comparative genetics and industrial research. The field of plant genetics played a key role in the modern-day theories of heredity and has grown to a greater understanding of plant breeding and hybridization. The professionals in this field can have a number of careers related to plants at the cellular level, including breeding and diagnosis of diseases.',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/142','A plant geneticist is a scientist who is specialized in the field of genetics that majors in botanical subjects like trees, flowers, ferns, mosses, and fungi.\r\nParticular research is conducted to produce new varieties of plants or crops that are done by plant geneticists. Their study involves genetics in botany. They need to research different plant’s DNA and have to work on that to find new ways of improving the appearance, nutritional value, plant height, fruit sweetness, shape, size, production level,  pesticide and disease tolerance. Plant geneticists are also responsible for conducting research on existing plants and crops to create new varieties of plants and crops. The professionals in this field are placed to develop methods for finding more nutritious or altering plant pigments to make the food more enticing to consumers.','3-Plant-Geneticist.png','/landingImages/142','Generally, for entry-level of this field requires a Bachelor of Science degree in genetics, Biology or a closely related field like Botany or Biochemistry. To become a plant geneticist or plant breeder one should major at the masters or doctoral level in plant genetics or botany. To reach the professional level of this field you should have knowledge in plant biology, research and laboratory experience.','Attain 10+2 or equivalent qualification from a recognized educational Board in the Science stream.','B.Sc. (Agri.) Genetics and Plant Breeding','M.Sc. (Genetics and Plant Breeding)','M.Phil. (Genetics & Plant Breeding)@@@Ph.D. in Genetics and Plant Breeding','','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','IIT JAM (Joint Admission Test)@@@NIPER JEE (Joint Entrance Exam)@@@PGIMER Chandigarh@@@DAVV Admission Non-CET@@@Calcutta University M. Sc. Admission@@@MJP Rohilkhand University Entrance Test@@@Central University of Gujarat Admission Test@@@DU (Delhi University) PG Admission Test@@@BIT MESRA Integrated Admission Test@@@BVP M. Sc. Entrance Exam@@@NIT Karnataka Admission Test','“A garden requires patient labour and attention. Plants do not grow merely to satisfy ambitions or to fulfil good intentions. They thrive because someone expended effort on them.”- Liberty Hyde Bailey','image/png','image/png','image/png','',''),(143,'Fashion Designer','3_Fashion-Designer.png','/subCategoryImages/143','2019-12-05 09:53:38',0,3,0,'Do you love to put your fashion thoughts to design new dresses and it\'s accessories?\r\nHave you ever designed your own dresses and got compliments for those designs?\r\nDo you have the ability to think beyond fashion trends and creativity to create your own trends?\r\nThen there you go! You can pursue fashion designing as your career. Make yourself fit into this field by gaining and adapting a strong command on color, textile detail, style, fabrics, and materials that are used for designing purposes. Stay up to date with regular as well as emerging fashion trends. The rapid growth of the fashion industry is creating a number of employment opportunities and the professionals of this field can grab a chance to work with big personalities like models and celebrities.',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/143','A fashion designer is a professional who designs high-fashion clothing for different individuals.\r\nA fashion designer is a person who is an expert in sketching and drawing designs and selecting appropriate materials and fabrics for those designs according to trends. They are also responsible for selecting the shape, color, fabric, trimmings, and other aspects of the designed clothes and accessories. These professionals will design women, men, and children accessories like sportswear, maternity wear, outerwear, underwear, formalwear, eyewear, belts, scarves, hats, handbags, footwear, summer wear, winter wear and many more. This will begin with an idea of how a garment should look, sketch design for visualization and then made it into an actual piece of clothing by other workers. Some designers create their own designs while some create based on trend reports published by fashion industry trade groups. They will have control over the fashion shows, selecting models to present their designed clothes in-ramp, and arranging how the garments will be presented. They have to use social media, television channels and other means of communication to gain reputation and exposure for their brand.','3-Fashion-designer.png','/landingImages/143','The entry-level of this field generally required to hold an undergraduate degree in fashion design or some diploma and certificate courses. For the advancement in career, one should go for masters and doctoral courses. The candidates who wish to start their own design firm can opt combined degree in fashion design and marketing or another business-related subject. Along with your academic study, you should also focus on computer drafting, sketching, sewing, and tailoring which will add value to your resume.','Attain 10+2 or equivalent qualification from a recognized educational Board in any stream.','B.A.(Fashion Business Management)@@@\r\nB.A.(Fashion Design and  technology)@@@\r\nB.A.(Fashion Design)@@@\r\nB.A.(Fashion merchandising and production)@@@\r\nB.A.(Fashion Technology)@@@\r\nB.A.(Hons.)Fashion Brand Management@@@\r\nB.A.(Hons.)Fashion Design@@@\r\nB.Des(Accessory Design)@@@\r\nB.Des(Fashion Design)@@@\r\nB.Des.(Knitwear Design)@@@\r\nB.Des.(Leather Design)@@@\r\nB.Des.(Textile Design)@@@\r\nB.Des.Fashion Communication@@@\r\nB.F.Tech(Apparel Production)@@@\r\nB.sc.(Apparel and Fashion Technology)@@@\r\nB.sc.(Costume & Fashion Technology)@@@\r\nB.sc.(Costume Design & Fashion )@@@\r\nB.sc.(Dress Designing)@@@\r\nB.sc.(Fashion and Apparel Design)@@@\r\nB.sc.(Fashion Design and Interior design)@@@\r\nB.sc.(Fashion Communication)@@@\r\nB.sc.(Fashion Design and Technology)@@@\r\nB.sc.(Fashion Design)@@@\r\nB.sc.(Garment Manufacturing)@@@\r\nB.sc.(Hons.) Fashion Designing@@@\r\nB.sc.(Jewellery Design and Manufacture)@@@\r\nB.Tech.(Apparel Production management)@@@\r\nB.Tech.(Fashion Technology)@@@\r\nB.Tech.(Fashion and Lifestyle Design)@@@\r\nBachelor of Fashion Studies(BFS)','M.Sc.(Fashion Designing)@@@M.B.A.(Fashion Management)@@@M.F.Tech@@@M.sc.(Costume Design and Fashion )@@@M.sc.(Fabric and Apparel Designing)@@@M.sc.(Fashion Design and Technology)@@@M.Sc(Fashion technology)@@@Master of Design(M.Des)@@@Master of Fashion Management@@@Post Graduate Diploma Programme in Design','Ph.D. (Fashion Design)@@@Ph.D. in Design\r\n','Advance Diploma in Fashion Design & Technology@@@Advance Diploma in Fashion Designing & Merchandising@@@Advance Diploma in Fashion Designing and Clothing Technology@@@Advance Diploma in Fashion Management(ADFM)@@@Advance Diploma in Fashion, Accessories & craft Designing@@@Advance Diploma in Dress Design@@@Advance Diploma in Fashion Design@@@Diploma in Apparel Manufacturing Technology and System (AAMTS)@@@Diploma in Apparel Fashion Design & Technology@@@Diploma in Apparel Manufacturing@@@Diploma in Apparel Merchandising@@@Diploma Costume Design and Dress Making Technology@@@Diploma in Dress Design@@@Diploma in Fashion Design@@@Diploma in Fashion Design & Merchandising (Graduates)@@@Diploma in Fashion Design & merchandising (professional)@@@Diploma in Fashion Design & Technology@@@Diploma in Fashion Designing and Garment Technology@@@Diploma in Fashion Designing in CAD@@@Diploma in Fashion Merchandising & Retail Management@@@Diploma in Fashion styling@@@Diploma in Fashion, Accessories & Craft Designing@@@Diploma in Garment Manufacturing Technology (Dress Designing)(Graduates)@@@Diploma in Garment Manufacturing Technology (Dress Designing)(professionals)@@@Diploma in Interior Designing and Decoration@@@Diploma in Knitwear Manufacturing Technology@@@Diploma in Pattern Making and CAD@@@Diploma in Quality Assurance and Compliance@@@Diploma in Retail Operation @@@Graduate Diploma Programme in Design(GDPD)@@@Post Graduate Diploma in Apparel Merchandising@@@Post Graduate Diploma in Cutting Tailoring and Embroidery @@@Post Graduate Diploma in Design Management@@@Post Graduate Diploma in Dress Designing@@@Post Graduate Diploma in Dress Designing and Tailoring@@@Post Graduate Diploma in Fashion Design and Clothing Technology@@@Post Graduate Diploma in Fashion Designing@@@Post Graduate Diploma in Fashion Designing and Apparel Merchandising@@@Post Graduate Diploma in Fashion Designing Technology(PGDFT)  @@@Post Graduate Program in Fashion Marketing and Management','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Certificate Course Fashion Coordination@@@Certificate Course in Fashion Design@@@Certificate Course in Fashion Design and Information Technology@@@Certificate Course in Fashion Drawing@@@Certificate Course in Fashion, Accessories & Craft Design@@@Certificate Course in Garment Construction Techniques (GCT)@@@Certificate Course in Garment Production@@@Certificate Course in Industrial Sewing Machine Technician(ISMT)@@@Certificate Course in Pattern Construction@@@Certificate Course in Textile Science@@@Certificate in Apparel pattern Making@@@Certificate in Fabrication@@@Certificate in Fashion Art@@@Certificate in Industrial Pattern Making & Garment Construction @@@Certificate in Fashion Technology@@@Certificate in Production Supervision and Quality Control','Aditya Institute of Technology Fashion Designing Entrance Exam@@@Apeejay Institute of Design Fashion Designing@@@Entrance Exam@@@Army Institute of Fashion Design Admission Test@@@Central Footwear@@@Training Institute Entrance Exam@@@Centre for International Management Entrance Exam@@@Centre for Product Design and Manufacturing Entrance Exam@@@Common Entrance Examination for Design, CEED@@@Creative-i College of Creative Arts Entrance Exam@@@Department of Industrial Design Entrance Exam@@@Design Institute of India Entrance Exam@@@DSK International Institute of Design Entrance Exam@@@Film and Television Institute of India Entrance Examination@@@Footwear Design & Development Institute Noida Entrance Exam@@@Government Institute of Garment Technology Entrance Exam@@@I E C School of Art & fashion Entrance Exam@@@IDC, IIT Bombay Entrance Exam@@@IMS Academy of Fashion and Jewelry Design Entrance Exam@@@Indian Institute Of Art and Fashion Technology Entrance Exam@@@Indian Institute of Technology, Delhi Entrance Exam@@@Indian Institute of Technology, Kanpur Entrance Exam@@@Infopark School of fashion Entrance Exam@@@International Centre of Art & design Entrance Exam@@@International Institute of Fashion Technology Entrance Exam@@@J D Institute of Fashion Technology Entrance Exam@@@Janaki Devi Vocational center Entrance Exam@@@Jewellery Design & Technology Institute Entrance Exam@@@Laxmi Devi Institute of Engineering & Technology Entrance Exam@@@Lisa Institute of fashion Private Limited Entrance Exam@@@MAEER’s MIT Institute of Design Entrance Exam@@@Mayura School of Fashion Technology Entrance Exam@@@National Academy of Fashion Technology Entrance Exam@@@National Entrance Examination for Design (NEED)@@@National Institute of Design Entrance Exam@@@National Institute of Fashion Technology Entrance Exam@@@National School of Drama Screening Test Entrance Exam@@@NIFT-TEA Knitwear Fashion Institute Entrance Exam@@@North East Institute of Fashion Technology Entrance Exam@@@Northern India Institute Of Fashion Technology Entrance Exam@@@Pearl Academy of Fashion Entrance Exam@@@Rai University Entrance Exam@@@Srishti School of Art, Design & Technology Entrance Exam@@@The Apparel Training & Design Centre Entrance Exam@@@The School Of Fashion Technology (SOFT) Entrance Exam@@@Vidya Institute Entrance Exam@@@Wigan and Leigh Fashion School Entrance Exam@@@SOFT CET@@@AIEED@@@WLCI AICET@@@SEED@@@CEED Exam@@@SRFTI JET Exam@@@NIFT Entrance Exam@@@NID DAT Exam@@@NIFT Entrance Exam@@@IICD Entrance Exam@@@UID Aptitude test @@@GD Goenka University DAT@@@IDAT Exam@@@Design Aptitude Test','“Fashion is part of our culture, and it\'s about more than just a pretty dress.”- Joan Smalls\r\n','image/png','image/png','image/png','',''),(144,'Actuary','1_Actuary.png','/subCategoryImages/144','2019-12-05 09:54:21',0,13,1,'Are you able to work with numbers efficiently?\r\nDo you have a stronghold on calculus, statistics and probability concepts?\r\nCan you able to deal with huge amounts of data?\r\n\r\nIf yes, then Actuarial Science is one of the most popular courses among those who have a knack for numbers, statistics and data. Not only academic study makes you a successful actuary, along with academic qualification take math, statistics, and calculus classes every year, develop your computer skills, and engage in extracurricular activities which will give you an opportunity to work as part of a team on a project or stand out as a leader. According to the IAI, India has 9182 students, 160 associates, and 344 fellows. The demand for qualified Actuaries is higher than their supply and hence, the average wage in this field is considerably high.',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/144','An Actuary is a professional who interprets statistics and use them to calculate insurance risks, premiums, and finance for industries and other professions.\r\nActuaries study the math, statistics, business and finance probability to determine the premiums of insurance plans, give an accurate depiction of the other risks that insurance companies will take by insuring an individual or business,  calculate the risk factors for occurrences such as floods, fires, unemployment, accidents, and mortality, and also predict the profitability of various clients by using mathematical and statistical formulas. Most of them work with insurance companies that concentrate on many things like life insurance, health insurance, automobile insurance, homeowners insurance and many more. They need to work along with accountants and underwriters to resolve what insurance rates should be based on these risks and their financial outcomes.','2-Actuary.png','/landingImages/144','In order to become an actuary the first step is to complete 10th and then 10+2 in science stream from a recognised institute. Obtain graduation Maths, Statistics, Actuarial Science or a related subject. Then go for further such as graduation with Actuarial Science as Major to get into this profession. Become a member of the Institute of Actuaries of India (IAI) by taking ACET test after 10+2,  graduation or post-graduation. Actuarial science is a professional subject so that different levels of the exams are to be cleared conducted by the IAI. If you complete the first two levels of this exam you can become Associate with IAI, by completing four stages of the exam and getting the proper experience you can become fellow, and completion of five papers will make you an Actuary. ','Attain 10+2 or equivalent qualification from a recognized educational Board.','B.Sc. (Actuarial and Financial Mathematics)\r\n@@@B.Sc. (Actuarial Science)\r\n','M.Sc. (Actuarial Science)\r\n@@@M.Sc. Statistics (Actuarial)','','P.G. Diploma in Actuarial Science','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Training in Actuarial Science','ACET: Actuarial Common Entrance Test','“An accountant is someone who attempts to value the present. An actuary is someone who attempts to value the future.” - SOA Fundamentals of Actuarial Practice','image/png','image/png','image/png','The actuarial profession is continually growing and expanding. Actuaries are still in short supply around the world and the demand for actuaries will continue to grow as the world expands into new territories, such as artificial intelligence. The professionals have plenty of opportunities for growth and advancement in their career. 70000 actuaries are employed across the world. Highest number is in UK as the country is a financial services hub and has many insurance companies. ','One of the most-in-demand professions is Actuary across the world. The average starting salary increase across different countries is around 30%. Starting salary for this occupation in India is 4 lakh and 47 lakh in Canada. The top salary for the experience Actuaries can go to 40 lakh in India and 1.9 Cr in Canada and the US. '),(145,'Interior Designer','8_Interior-Designer.png','/subCategoryImages/145','2019-12-05 09:53:38',0,3,1,'Have you ever designed your own room or house and got compliments for those ideas?\r\nCan you able to provide different needs within the available space?\r\nDo you have the ability to think beyond designing trends to design a home?\r\n\r\nThen you can be! You can choose interior designing as your career. Develop yourself to fit into this field by gaining a proper command on the old and latest home decorating accessories, furniture and design trends which will increase your employment opportunities.  This firm provides good employability since people want to modify their homes with the help of an expert who can understand their taste and preference. Because of the scarcity of interior designers, there is a good demand for experienced interior designers.',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/145','The interior designer is an expert in designing every indoor space of rooms, houses, buildings, offices, restaurants, and many more.\r\n\r\nThese professionals are responsible for researching, designing, planning, conceptual development, space planning, site inspections, programming, communicating with the clients of a project, construction management, and final execution of the design. They will design a particular area or whole area of different places like rooms, houses, green spaces, and corporate offices based on customer requirements. They need to have an extreme level of creativity to reach the expectation level of project owners. Along with designing the indoor spaces, they are also responsible for proper utilization of space, furniture placement, color combinations, decorations, artwork, lighting, window treatments, and flooring in a beautiful way to satisfy the client\'s needs. An interior designer can be specialized in commercial or residential design or be involved in both.','8-Interior-Designer.png','/landingImages/145','Most interior designers have at least a bachelor’s degree. Both traditional colleges and universities and specialized art and design schools offer degree programs in interior design. To get into the professional level of this field, one can opt for masters and doctoral level courses. This course is also offered in diploma and certificate levels. Along with degree programs, students should gain basic knowledge of building materials, construction fundamentals, how to draw architectural sketches, 3D models and CAD software. Also, furniture theory to give suggestions for the customers in the selection of materials and furniture to achieve the desired effect in their space.','Attain 10+2 or equivalent qualification from a recognized educational Board.','B.F.A. (Interior Design)\r\n@@@B.A.(Hons) (Interior Architecture Design)\r\n@@@B.A.(Interior  Architecture and Design)\r\n@@@B.A.(Interior Design)\r\n@@@B.Des.(Interior Design)\r\n@@@B.Sc.(Fashion Apparel Management)\r\n@@@B.Sc.(Hons)Interior Design\r\n@@@B.Sc.(Interior Design and Decoration)\r\n@@@B.Sc.(Interior Design)\r\n@@@Bachelor of Interior Design (B.I.D)','M.Sc.( Interior Designing and Resource Management)\r\n@@@M.Sc.(Interior Design)\r\n@@@M.A. Interior Design','Ph.D. (Interior Design)','Advance Diploma in interior Design & Display\r\n@@@Advance Diploma in Interior Design \r\n@@@Advance Diploma in interior/Architectural Designing Pro\r\n@@@Diploma in Creative Graphic Design\r\n@@@Diploma in Interior Design\r\n@@@Diploma in interior design and Display (Graduates)\r\n@@@Diploma in  interior design and Display (Professional)\r\n@@@Diploma in  interior design and Decoration\r\n@@@Diploma in  interior styling\r\n@@@Graduate Diploma in interiors and furniture Design\r\n@@@Post Graduate Diploma in Interior Designing\r\n@@@Post Graduate Diploma in Interior Designing & Decoration\r\n@@@Post Graduate Diploma Programme in Design Toy and Game Design','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Certificate course in Interior Design\r\n@@@Certificate course in Interior Designing and decoration','Common Entrance Examination for Design (CEED) is a countrywide examination conducted by the Indian Institute of Technology.\r\n@@@GATE qualified candidates for IITs.\r\n@@@National Council for Interior Design Qualification exam.\r\n@@@National Level Entrance Aptitude Test (NLAT) conducted by the Institute.\r\n@@@National Entrance Examination for Design (NEED).\r\n@@@NID Entrance Test.\r\n@@@NIFT Entrance Exam.\r\n@@@School of Fashion Technology (SOFT) Entrance Exam.','“For a house to be successful, the objects in it must communicate with one another, respond and balance one another.” - Andre Putman','image/png','image/png','image/png','',''),(146,'Investment Banker','7_Investment-Banker.png','/subCategoryImages/146','2019-12-06 13:36:51',0,5,0,'Are you passionate about investments?\r\nAre you interested in banking and finance?\r\n Do you feel like you’re really good at negotiations with your peers?\r\nThen you’re almost ready to be called as an Investment Banker. Educate yourself with computer software programs such as Database & Spreadsheets, gain techniques for marketing, management, and develop strategic planning. Being an Investment Banker you will make a real impact on the society by saving various enterprises to never make a misstep on finances. A skilled Investment Banker can work on multi-billion dollar IPOs, mergers of some of the largest companies in the world, or merge companies in different countries.',NULL,NULL,NULL,NULL,NULL,NULL,'am-i-the-one-bg.png','/amITheOneImages/146','The Investment Banker plays an important role in capital markets consulting and provide financial consultancy to Organizations and Governments, mostly than dealing directly with individual investors. Investment banker as the name suggests is about investing the resources of any organization to a different organization that would help both the organizations to achieve a growth. Their expertise include on how to merge accounts, buy assets, reconstruction of business structure, and lend money to expand the business to work more efficiently.  In order to maximize the profit they issue new IPOs to help the organizations to go public. Their main role is to act as an intermediate between two different organizations to decide the value and potential risk of each investment, before examining the goals and needs of the organization. Their financial consultancy involves proprietary trading or trading securities.','8-INVESTMENT-BANKER.png','/landingImages/146','An Investment Banker requires graduation in banking, finance, accounting, mathematics for the entry-level into an Investment Bank. One can opt for postgraduate to understand the subject in detail. To properly fit for the investment banker position a keen knowledge about mathematics, on how computers work, networking and research about various companies will help the individual move forward. During on the path of an Investment Banker it’s essential to make connections all along the way and also maintain a proper relationship. Mastering money management is a key task for an Investment Banker, without that one cannot excel.\r\n','Attain 10+2 or equivalent qualification from a recognized educational Board in Mathematics/Commerce.','B.B.A. (Banking and Finance)\r\n@@@B.B.A. (Banking)\r\n@@@B.B.A. Finance\r\n@@@B.Com. (Banking & Finance)\r\n@@@B.Com. (Banking & Insurance)\r\n@@@B.Com. (Banking Management)\r\n@@@B.Com. (Hons.) (Banking and Insurance)\r\n@@@B.Sc. (Banking and Finance)\r\n@@@B.Sc. Finance\r\n@@@Bachelor of Banking and Insurance (BBI)\r\n@@@B.Com. Commerce','M.B.A. (Banking and Finance)\r\n@@@M.B.A. (Banking & Taxation)\r\n@@@M.Com. (Bank Management)\r\n@@@M.Com. (Banking & Finance)\r\n@@@M.Com. (Banking & Insurance Management)\r\n@@@M.Com. (Finance, Banking & Risk Management)\r\n@@@M.Sc. (Banking & Finance)\r\n@@@Master in Banking, Finance, and Insurance\r\n@@@M.B.A. Banking and Finance','PhD (Banking & Finance)\r\n@@@PhD Commerce','Advance Diploma in Banking and Insurance Management\r\n@@@Advanced Diploma Course in Banking Services\r\n@@@Diploma in Banking & Finance\r\n@@@Diploma in Banking and Insurance\r\n@@@Diploma in Banking Laws\r\n@@@Diploma in Banking Management\r\n@@@Diploma in Banking Services\r\n@@@PGDBFM - Post Graduate Diploma in Banking and Financial Management\r\n@@@PGDBM - Post Graduate Diploma in Bank Management\r\n@@@Post Graduate Diploma in Banking - PGDB\r\n@@@Post Graduate Diploma in Development and Investment Banking','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','CAT\r\n@@@MAT\r\n@@@GMAT\r\n@@@JMET\r\n@@@XAT','“Investors should purchase stocks like they purchase groceries, not like they purchase perfume.” - Ben Graham','image/png',NULL,'image/png','With the economy on the rise, the estimated demand for the Investment Bankers is growing at 10% in the US over the next 10 years. Even though the population of Investment Bankers is very less , the growing world economy and more and more companies going for public issue, the demand for this profession will be stronger in India. India has more than 12000 investment bankers  and it intends to have an addition of a minumum 500 every year as per the past trend and current demand.','Invest Banker is a very lucrative and challenging profession any where in the world. Indian Investment Banking professionals start their caareer with 3 lakh per annum but the smartest investment banker, going higher up in India would earn upto 4 million as employee and sky is the limit, if he owns few hundreds of clients and his own firm as an entrepreneur.Opportunities for this profession are aplenty in the US with the starting package of around 50 lakh and the top salary can go upto 15 Crore with experience and customer acquisition. Canada scores lower in salaries than USA in this regard with a starting pay of 22 lakhs per annum.'),(149,'Food Critic','4_Food-Critic.png','/subCategoryImages/149','2020-01-01 22:00:38',0,17,0,'Are you good at creative writing?\nDo you love to travel and taste different food at various places, and able to write a review on it?\nDo you have the ability to determine food quality and service standards?\n \nIf yes, then you can build your career as a food critic, step forward by gaining knowledge on taste, appearance, smell, and texture of a variety of dishes, restaurant\'s services, and pricing. This position requires a high level of writing and communication skills. Food critic job offers individuals in discovering new cuisines, restaurants and also a great opportunity to travel to different places. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A food critic is responsible for tasting and examine a wide variety of food and share their experience with the public by writing about it.\nFood critics provide reviews, comparisons, opinions and discussions of similar dishes at restaurants and other establishments for newspapers, magazines, travel guides, and food-related websites. After their dining experience, they will give the rating which can then be used to help the public decide whether to eat there or not. They have to review the areas like the taste of the food, the serving size, the restaurant ambience, the price, and how well the service staff do their job. Food critics hide their identity while they visit the restaurant to avoid the possibility that owners will recognize them and give them special treatment. The final goal of a food critic is to make the general public aware of what they are getting for their money.\n','4-Food-Critic.png','/landingImages/149','The basic eligibility to start a career as a food critic is a bachelor\'s degree in journalism, hotel management, or a closely related subject from a recognised university. To become a food critic, one must have excellent writing skills and professional knowledge of the food industry. ','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,'Diploma in Food Preservation\n@@@Post Graduate Diploma in Cookery and Catering','B.A. (Hons) (Mass Communication and Journalism)\n@@@B.A. (Journalism and Mass Communication)\n@@@B.Sc. (Mass Communication and Journalism)\n@@@Bachelor of Journalism',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'National Council for Hotel Management and Catering Technology Joint Entrance Exam','“Especially in the food business, critics take very seriously how much power they have. They can shut a restaurant down.”-Jon Favreau','image/png',NULL,'image/png',NULL,NULL),(150,'Chef','1_Chef.png','/subCategoryImages/150','2020-01-01 22:06:27',0,17,0,'Do you have excellent cooking, plating and presenting skills?\nDo you love to prepare various dishes from different cuisines?\nCan you able to spend most of your time in the kitchen?\n \nIf yes, then you can build your career as a chef, step forward by gaining knowledge on taste, appearance, smell, and texture of a variety of dishes, restaurant\'s services, and pricing. This position requires a high level of cooking and presenting skills. Chef job offers individuals in discovering new cuisines, restaurants and also a great opportunity to create different dishes and will let you express your creativity. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A chef is a professional cook who is expert in all aspects of food preparation, often focusing on a particular cuisine.\nA Chef is responsible for preparing meals or different varieties of recipes at restaurants and hotels. They should take care of seasoning, decorating, and presenting dishes while preparing in order to meet customer requirements. Chefs also take care by monitoring and managing the food prepared in the kitchen by staff members. They may specialize in areas like pastries, desserts, salads, among other dishes or Indian, Chinese, Italian, among other cuisines. They should create unique dishes and serve in the way that excites guests to come back, again and again.  Usually, they control everything inside the kitchen including menu creation, personal management and business aspects and make sure that the food is plated in time for the waiters to serve orders. \n','1-Chef.png','/landingImages/150','The basic eligibility to start a career as a food critic is a bachelor\'s degree in culinary arts, hotel management, hospitality management, Food and Beverage Science or a closely related subject from a recognised university. To become a chef, one must have excellent cooking talent and dish presenting skills. One must possess knowledge of various ingredients and method of using them in cooking. Able to adjust the dish according to client choice. \n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Craft certification course in food production \n@@@Craftsmanship course in food & beverage service \n@@@Craftsmanship course in food production & patisserie','Post Graduate Diploma in culinary arts \nDiploma in food & beverage service \nDiploma in Bakery & confectionery \nDiploma in kitchen management \nDiploma in Bakery & patisserie \nDiploma in culinary arts \n','BA in Culinary Arts\n@@@BA (honours) culinary arts ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“A chef must think like a scientist, organise like an accountant, plate like an artist, and cook like a grandma.”-Anonymous','image/png',NULL,'image/png',NULL,NULL),(153,'Sports Coach/Trainer','1_Sports-CoachTrainer.png','/subCategoryImages/153','2020-01-02 16:53:29',0,20,0,'Do you have the ability of training, teaching and managing different people?\nDo you really good at sports like cricket, football, hockey, etc...?\nAre you good at physical fitness and sports?\n\nIf yes, then you’re already in the first step towards becoming the Sports coach.  Now, improve your skills by regularly practising the sport you are crazy about and exercise to keep fit and healthy. One will get good pay if you are working for a government organization under sports quota and even in public sector sports organizations, schools, and colleges. And you will get name and fame if you are the coach for a successful player. By gaining proper experience one can become a professional\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A sports coach or trainer is a person who directs, instructs, and trains the sports team or an individual sportsperson. \nA coach is a person who equips a team or an individual to be in touch with their best selves. A sports coach is primarily responsible for motivating, instructing and training an individual or a team for a sporting hobby, career or competition. The importance of coaching is to improve the performance to strive every day to be fitter, faster, stronger and sharper than we were the day before. They have to train each individual or group of people to improve the skills that they need to succeed in their selected sport and instruct them on the specific techniques and strategies. They need to oversee competitions or games and analyze their team or individual client\'s performance. They will work with managers to select team members for particular matches or competitions\n','1sports.png','/landingImages/153','Any Sports coach must require a graduate or postgraduate courses in sports coaching. For postgraduate courses, one should have a degree in sports science, sports management or physiology. To become an independent coach requires a minimum standard of training and experience.  While graduating they should be concentrate on maintaining themselves as fit and healthy, a practice of particular sport which they are interested in, up to date about that sport, and mainly improve teaching skills which are very important to be a coach to train and maintain the team.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'B.Sc. \n@@@B.A.\n','M.Sc. \n@@@M.A.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. ',NULL,'“A coach is someone who can give correction without causing resentment.”-John Wooden','image/png',NULL,'image/png',NULL,NULL),(154,'Professor','1_Professor.png','/subCategoryImages/154','2020-01-02 16:57:46',0,18,NULL,'Do you have a mentor inside you?\nAre you able to present your findings and research at academic conferences?\nCan you bring your strengths to students in new and innovative ways?\n\nIf yes, then here is the best career which suits you more. You can become a professor by adopting qualities like genuine passion for teaching,  dedication to ongoing research and learning, a strong foundation of teaching skills, and deeply-rooted personal practice. It is the career which will give you freedom in terms of research and allowing you to shape and inspire the next generation of academics.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A professor is someone who directs students in a broad variety of educational and vocational subjects.\nProfessors are professionals in practice of any of a wide variety of subjects and fields. Professors are responsible for preparing course materials like a lecture, seminar, field study, or laboratory formats and teaching classes to college or university level learners. Some of them also conduct related research in their area of expertise and publish scholarly papers and books. They commonly teach for undergraduate, professional and postgraduate courses in their fields of expertise. A professor also takes care of academic and organisational boards that review and recommend policies, make budget decisions or advise on hiring and promotions within their department.\n','1-Professor.png','/landingImages/154','In order to become a professor, you should select a particular area of the subject and obtain a bachelor\'s and masters degree in that field. The basic eligibility of a professor is a minimum Masters degree in their fields of expertise. To get into reputed institutions, a doctoral-level study, a high-level of teaching experience, research, critical thinking, communication, writing, and knowledge of classroom management are required. After attaining all qualifications they can be hired by state universities, private universities, community colleges, and private colleges.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'B.A. (Any)\n@@@B.Sc. (Any)\n@@@B.Com. (Any)\n@@@B.Tech. (Any)\n@@@B.E. (Any)\n@@@B.F.A. (Any)','M.A. (Any)\nM.Sc. (Any)\nM.Com. (Any)\nM.Tech. (Any)\nM.F.A. (Any)\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Any)',NULL,'“TO TEACH IS TO LEARN TWICE OVER.”-JOSEPH JOUBERT','image/png',NULL,'image/png',NULL,NULL),(155,'Astronomer','astronomer-.png','/subCategoryImages/155','2020-01-02 17:14:02',0,22,0,'Do you have a strong desire for maths and science?\nDo you like to know about celestial objects of our universe?\nCan you able to collect, reduce and figure out the data?\nIf yes, then you are visibly passionate about astronomy. So, set your goal as an astronomer and grasp a huge knowledge by getting a telescope or even a good pair of binoculars, some good, clear, dark skies, and to get out there and explore it! How clearly you know about it you will get that many questions. Try to find a solution to it. So that you get to study and know the wonders of the universe. Once your examination on a special topic gets issued in the technical journals, it will be followed by many people even after 100, 200, or 300 years in the future!\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'An Astronomer is the one who focuses on the logical study of celestial objects and aspects that originate outside the Earth\'s atmosphere.\nPeople have been liking the beauty of the night sky, curious to learn what the stars and other celestial objects are, and how the Universe works. Astronomers examine planets and sun in our own system, different stars, star systems, galaxies, and therefore the whole universe and utilise the principles of physics and mathematics to discover more about the universe and gather data on the characteristics of planets, satellites, stars and other objects using telescopes and computer programs. They use this information to form theories, write academic papers and present to the developing body of knowledge about the universe. \n','1-Astronomy.png','/landingImages/155','The entry-level jobs of this kind usually offer at a minimum requirement of a bachelor\'s degree in physics, astronomy or a related field. If you really want to become a professional astronomer and take part in researching and developing concepts then you should go for a masters and doctoral courses in astronomy with an area of specialization. Take a teaching position at a university or a college and become a professor of astronomy at the graduate level. Look for research positions at your local universities. Along with your academic courses take classes on chemistry, physics, or mathematical software programs to become skilful at using them and also download science-related software programs and teach yourself how to use them. Try to communicate your ideas with peers and the general public.','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,'Diploma in Astronomy and AstroPhysics','Bachelor of Science [B.Sc](Astrophysics)','M.Sc. (Astronomy and Space Physics)\n@@@M.Sc. (Astronomy)\n@@@M.Tech( Atmospheric Science)\n@@@M.Sc. Meteorology\n@@@M.Sc. Satellite Meteorology And Weather Informatics',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Astronomy)','Aligarh Muslim University Entrance Exam\n@@@Andhra University Entrance Exam\n@@@Aryabhatta Research Institute of Observational Sciences (A.R.I.E.S.), Joint Entrance Screening Test\n@@@Bangalore University Entrance Exam\n@@@Birla Institute of Technology - BITSAT Entrance Exam\n@@@Cochin University of Science and Technology Entrance Exam\n@@@Cochin University of Science and Technology: Department of Atmospheric Sciences Entrance Exam\n@@@Dr Babasaheb Ambedkar Marathwada University Entrance Exam\n@@@Harish Chandra Research Institute, Allahabad (Uttar Pradesh) Combined Research Entrance Exam\n@@@Indian Institute of Astrophysics Entrance Exam\n@@@Indian Institute of Geomagnetism Entrance Exam\n@@@Indian Institute of Science (IISc.): Department of Physics, Bangalore (Karnataka) Entrance Exam\n@@@Indian Institute of Technology - Joint Entrance exam\n@@@Inter-University Centre for Astronomy and Astrophysics (I.U.C.A.A.), Pune (Maharashtra)\n@@@IUCAA NCRA admission test (INAT) (set by the National Centre for Radio Astrophysics, Tata Institute of Fundamental Research (NCRA-TIFR), Pune)\n@@@JNTU College of Engineering Entrance Exam\n@@@Madurai Kamaraj University Entrance Exam\n@@@Mahatma Gandhi University Entrance Exam\n@@@Osmania University Entrance Exam\n@@@Patiala University Entrance Exam\n@@@Physical Research Laboratory (PRL) All India Common Medical Entrance Test\n@@@Punjab University Entrance Exam\n@@@Punjabi University Entrance Exam\n@@@Raman Research Institute Entrance Exam\n@@@Raman Research Institute Joint Entrance Screening Test\n@@@S N Bose National Centre for Basic Sciences Joint Entrance Screening Test\n@@@Shivaji University Entrance Exam\n@@@Swami Ramanand Teerth Marathwada University Entrance Exam\n@@@Tata Institute of Fundamental Research Common Admission Test\n@@@Tezpur University Entrance Exam\n@@@The Indira Gandhi National Open University Entrance Exam\n@@@University of Chennai Entrance Exam\n@@@University of Kolkata Entrance Exam\n@@@University of Lucknow Entrance Exam','\"Man must rise above the Earth—to the top of the atmosphere and beyond—for only thus will he fully understand the world in which he lives.\"-Socrates, Philosopher','image/png',NULL,'image/png',NULL,NULL),(156,'Politician','2_Politician.png','/subCategoryImages/156','2020-01-02 17:24:43',0,19,0,'Do you stay up to date with the problems of the nation and want to find a solution for it?\nDo you have knowledge of the working theory of sate, central and federal government?\nDo you have a belief in the impact of politics on the change of nation?\n \nThen here is the career which suites to your knowledge and passion. Make yourself fit for this role by enhancing your leadership qualities and ideas. Understand the various political scenarios which are required. Politics has a lot to offer, based on your success you will have a chance to improve the country by making decisions that will help the people and have the faith of voters is what will ultimately decide your success in the field. This field offers lots of allowances like accommodation, travel, medical coverage, constituency allowance, office expenses, air travel allowance, electricity, water and more. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Professionally committed in politics, especially as a holder of an elected office is a Politician.\nA politician is an elected government leader who represents the voice of the people at all levels of local, state, and the federal governments. They are not only a representative of the people but also involved in the law-making process by supporting the bills and ordinances. These persons should take the responsibilities of the political, financial, administrative, economic, educational and other interests of their communities. A politician is elected by the voters to represent them in the government. As a politician, one should work along with civil servants, political scientists, economists, and many others to form basic guidelines for running the nation. They need to know the current set of problems and find a long-term solution by creating various policies and bring it to effect. \n','1-Politician.png','/landingImages/156','This field has not always been considered as a mainstream career, as there is no formal educational requirement can be studied for it. But there are courses available in political science to have adequate knowledge and understanding of the political structure, you can choose to pursue a degree in Political Science or Politics and even earn a Master’s degree and doctoral in this subject. One can also pursue law, journalism, economics, social work, or civil services, depending on the role you wish to play in the government. At your graduation, you can join student bodies of political groups to gain practical knowledge of politics and can also join debate societies to improve your public speaking or participate in social work at the local level.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Course in Panchayat Raj\n@@@Certificate in Indian Constitution and Panchayati Raj','Diploma in Ministry\n@@@Diploma in Panchayat Raj\n@@@Post Graduate Diploma Programme in Indian Political System and Good Governance','B.A. (Hons.) Political Science\n@@@B.A. (Political Science)\n@@@B.A. (Politics)','M.A. (Intellectual Property Rights)\n@@@M.A. (International Relations and Political Science)\n@@@M.A. (Local Governance)\n@@@M.A. (Political Science and Public Administration)\n@@@M.A. (Political Science)\n@@@M.A. (Politics)\n@@@M.A. (Public Policy)\n@@@M.Phil. (International Politics)\n@@@M.Phil. (International Relations and Political Science)\n@@@M.Phil. (Political Science)\n@@@M.Phil. (Politics)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (International Politics)\n@@@Ph.D. (Political Science)\n@@@Ph.D. (Politics)',NULL,'“The most successful politician is he who says what everybody is thinking most often and in the loudest voice.”-Theodore Roosevelt','image/png',NULL,'image/png',NULL,NULL),(157,'BPO','1_BPO.png','/subCategoryImages/157','2020-01-02 17:26:16',0,16,0,'Are you really good at massive interaction with different people?\nDo you feel you are excellent in oral and written communication and love to speak different languages?\nDo you have a good computer operating skills?\nIf yes, then step into this field of BPO job. Develop yourself with communication and interactive skills. Train yourself to speak different languages fluently.  BPO job pays a higher salary than the other sectors that employ people with an undergraduate degree. Other than salary, this field provides you with other allowances like incentives, night shift allowance, etc. If you want to start your career with minimum education this is the job exactly what you are looking for.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'BPO is a job which involves subcontracting several business-related operations to third-party vendors.\n\nBusiness Process Outsourcing Services is also called as information technology-enabled services (ITES). BPO services categorised into two main areas namely back office and front office operations. Back office services cover core business operations such as accounting, payment processing, IT services, human resources, regulatory compliance, and quality assurance to outside professionals who ensure the business runs smoothly. Front office services cover customer-related services like tech support, sales, and marketing. They have to provide effective and useful consumer service by solving all the complaints, problems and doubts of the customers and maintain important records related to tasks performed during the outsourced project. \n','1-bpo.png','/landingImages/157','To enter into this position one must obtain any bachelor\'s degree from a recognised board. Most of the BPO organizations particularly ask for a bachelor\'s degree in the field of science, maths or statistics depending upon the customer they are working for. Some of these organisations hire the candidates with the 10+2 qualification and train them according to their need. This field requires strong oral and written communication skills. Try to equip yourself with different languages which will add value to your resume\n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Obtain any bachelor\'s degree in an equivalent field of study.',NULL,NULL,'B.Sc. (Any)\n@@@B.Com. (Any)\n@@@B.A. (Any)\n@@@B.Tech. (Any)','M.Sc. (Any)\n@@@M.Com. (Any)\n@@@M.A. (Any)\n@@@M.Tech. (Any)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“The important thing about outsourcing or global sourcing is that it becomes a very powerful tool to leverage talent, improve productivity and reduce work cycles.”-Azim Premji','image/png',NULL,'image/png',NULL,NULL),(158,'Pharmacist','10_Pharmacist.png','/subCategoryImages/158','2020-01-02 17:27:57',0,15,0,'Is getting into the medical profession is your dream career?\nDo you have a keen interest in safe medications, drug information,  health and chemical sciences?\nDo you own good knowledge related to health care and clinical services? \n\nIf yes, You can be a pharmacist, this position requires a high amount of hard work, training, high study period, experience, and lots of effort. It involves the lifelong learning process. It was an interesting and challenging job. Enhance yourself by getting knowledge of various drugs and medications which are available in the market. Gain the necessary computer knowledge and know about the related equipment of this field. As a pharmacist, you can be work with healthcare professionals and can help patients suffering from different problems by advising medication. With a proper educational qualification, experience, and certification, you can open your own medical business and be your own boss. But certification is mandatory for medical business and requirements for certification varies from place to place or state to state.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A pharmacist study and practice in order to become a specialist in the preparation and distribution of medicinal drugs.\n\nPharmacists are the specialists on drug medical care and are the first health professionals who optimize the use of medication for the convenience of the patients. They are responsible for supplying medicines to patients by ensuring that the medicines prescribed to patients are suitable, informing patients about medicines about how to take them and what reactions may occur. Pharmacists additionally referred to as dispensing chemists, area unit care professionals specialising in the safe and effective use of medicines. They\'re qualified to dispense prescription medications still as giving recommendation on remedies for minor ailments. This includes explaining the aspect effects and interactions with different medication. Most pharmacists work within the Health Service follow either in hospitals or community pharmacies. Pharmacists might also be small-business owners, owning the pharmacy since pharmacists understand the mode of action of a selected drug, its metabolism and physiological effects in detail, so, they play a crucial role in the optimization of drug treatment for a person.\n','8-Pharmacist.png','/landingImages/158','The basic educational requirements to start your career in this field is completion of a bachelor\'s degree in pharmacy or diploma in pharmacy. After completion of degree and practical training, one can be hired in basic positions. But for career progression and entering into reputed firms or hospitals, one should opt higher degrees such as masters and doctoral level degrees in pharmacy with a specialized area of study. There are also certificate and diploma courses available in the field of pharmacy which will add value to your resume and make you recruit. A doctoral-level education will allow you to reach the research-based positions. Along with the academic study, you need to stay updated with information regarding medicines.','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Course in Pharmacovigilance\n@@@Certificate course in Pharmacy\n@@@Certificate in Drug Regulatory Affairs','Advanced Diploma in Pharmaceutical Management\n@@@Advanced Diploma in Technical & Analytical Chemistry\n@@@D.Pharm.\n@@@Diploma in Veterinary Pharmacy\n@@@Diploma in Pharmaceutical Management\n@@@PG Diploma in Pharmaceutical Quality Assurance\n@@@Post Graduate Diploma in Pharmaceutical Chemistry\n@@@Post Graduate Diploma in Pharmaceutical Regulatory Affairs\n@@@Post Graduate Diploma in Pharmacovigilance\n@@@Post Graduate Diploma in Principles of Clinical Pharmacology','B.Pharm.\n@@@B.Pharm + M.B.A.\n@@@B.Pharm. (Hons.)\n@@@B.Pharm. (Pharmaceutical Chemistry)\n@@@B.Pharm. (Pharmaceutics)\n@@@B.Pharm. (Pharmacognosy)\n@@@B.Pharm. (Unani)\n@@@B.Pharma. (Pharmacology)\n@@@Bachelor of Ayurvedic Pharmacy','M.Pharm.\n@@@D.M. (Clinical Pharmacology)\n@@@M. Pharm. in Herbal Drug Technology\n@@@M.B.A. (Pharma. Technology)\n@@@M.Pharm (Pharmaceutical Management & Regulatory Affairs)\n@@@M.Pharm. (Biopharmaceutics & Pharmacokinetics)\n@@@M.Pharm. (Biopharmaceutics)\n@@@M.Pharm. (Biotechnology)\n@@@M.Pharm. (Bulk Drugs)\n@@@M.Pharm. (Clinical Pharmacy)\n@@@M.Pharm. (Clinical Practice & Research)\n@@@M.Pharm. (DDRS)\n@@@M.Pharm. (Drug Discovery and Drug Development)\n@@@M.Pharm. (Drug Regulatory Affairs)\n@@@M.Pharm. (Industrial Pharmacy)\n@@@M.Pharm. (Medicinal Chemistry)\n@@@M.Pharm. (Medicinal Natural Products)\n@@@M.Pharm. (Nanotechnology)\n@@@M.Pharm. (Pharmaceutical Administration)\n@@@M.Pharm. (Pharmaceutical Analysis and Quality Assurance)\n@@@M.Pharm. (Pharmaceutical Analysis)\n@@@M.Pharm. (Pharmaceutical Biotechnology)\n@@@M.Pharm. (Pharmaceutical Chemistry)\n@@@M.Pharm. (Pharmaceutical Market and Management)\n@@@M.Pharm. (Pharmaceutical Quality Assurance)\n@@@M.Pharm. (Pharmaceutical Regulatory Affairs)\n@@@M.Pharm. (Pharmaceutical Technology and Biopharmaceutics)\n@@@M.Pharm. (Pharmaceutical Technology)\n@@@M.Pharm. (Pharmaceutics)\n@@@M.Pharm. (Pharmacognosy & Phytomedicine)\n@@@M.Pharm. (Pharmacognosy and Phytochemistry)\n@@@M.Pharm. (Pharmacology & Toxicology)\n@@@M.Pharm. (Pharmacology)\n@@@M.Pharm. (Pharmacy Practice)\n@@@M.Sc. (Pharmacy)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Pharmacy)\nPharm.D\nPh.D. (Pharmaceutical Biotechnology)\nPh.D. (Pharmaceutical Chemistry)\nPh.D. (Pharmaceutical Medicine)\nPh.D. (Pharmaceutical Sciences)\nPh.D. (Pharmaceutics)\nPh.D. (Pharmacy Practice)\n','Banaras Hindu university PMT\n@@@Chennai Entrance Test\n@@@Dehradun State Entrance Exam\n@@@Haryana AIEEE, Entrance Exam, CET\n@@@Karnataka CAT, CET\n@@@Lucknow State Entrance Test\n@@@Madhya Pradesh Pre Pharmacy Admission Test\n@@@Maharashtra MHT-CET\n@@@Meerut UPSEE/AIEEE/CAT/MAT\n@@@New Delhi Entrance Exam\n@@@Punjab-PET\n@@@Rajasthan-RPETEAP\n@@@Roorkee Written Test\n@@@Uttarpradesh Entrance Test','“My choice of learning pharmacy was driven by my interests, curiosity, and a desire to seek new medicines for patients.”-Tu Youyou','image/png',NULL,'image/png',NULL,NULL),(159,'News Reporter','8_News-reporter.png','/subCategoryImages/159','2020-01-02 17:29:58',0,14,0,'Are you passionate about writing and creating interesting stories?\nIs travelling something you love to do with ease?\nAre you an enthusiastic person who is interested in what happens around the world? \n\nIf yes, then News Reporter is one of the careers for the people with great creating and writing abilities. Make your career as a news reporter by developing yourself with excellent communication and research skills, get good command on regional and multiple languages. Being a news reporter you can be recognized by people, meet very interesting people on a daily basis, and can travel to different places in order to get the news. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A news reporter employed to report news or conduct interviews for the press or broadcasting media.\nNews reporters are also known as journalists. They gather news and information held in various places to keep people informed about important issues happening around the world.  News reporters get the information from different sources such as personal interviews, contacts, wire services, news briefings, research, and many more. Newspapers, magazines, television and radio stations depend on journalists to keep their readers, viewers and listeners informed. News reporters play a major role in gathering information regarding current affairs and should perform the proper research before sending it in as a story and then compiles all the information to edit the story to fit a specific news page or bulletin. They may cover anything from local to global news and events.','7-News-Reporter.png','/landingImages/159','First of all complete 10+2 from a recognised board of institution. Then obtain a degree or diploma in journalism or mass communication for entry-level jobs. Go for masters and doctoral level courses in journalism or mass communication and gain good experience for getting into reputed industry or work place as a news reporter and even higher position than news reporter.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Course in Journalism\n@@@Certificate Course in Journalism & Creative Writing\n@@@Certificate Course in Journalism & Mass Communication\n@@@Certificate Course in Journalism & Mass Media\n@@@Certificate in Science & Sports Journalis\n','Advanced Diploma in Mass Communication\n@@@DBJCC- Diploma in Business Journalism And Corporate Communication\n@@@Diploma in Broadcast Journalism\n@@@Diploma in Journalism\n@@@Diploma in Journalism and Mass Media (Graduates)\n@@@Diploma in Journalism and Mass Media (Professional)\n@@@Diploma in Journalism and Mass Communication\n@@@Diploma in print and Broadcast journalism-DPBJ\n@@@Diploma in Radio Journalism-DRJ\n@@@Diploma In T.V. Journalism\n@@@Postgraduate Diploma in Broadcast Journalism-PGDBJ\n@@@Postgraduate Diploma in Broadcast Journalism And New Media\n@@@Postgraduate Diploma in Broadcast Journalism & Production-PGDBJP\n@@@Postgraduate Diploma in Corporate Communication\n@@@Postgraduate Diploma in Defence Journalism\n@@@Postgraduate Diploma in Journalism \n@@@Postgraduate Diploma Journalism and Mass Communication-PGDJMC\n@@@Postgraduate Diploma in Journalism and Media Management\n@@@Postgraduate Diploma in Oriya Journalism\n@@@Postgraduate Diploma in Print and Broadcast Journalism\n@@@Postgraduate Diploma in Print Journalism (English/Hindi)\n@@@Postgraduate Diploma in Radio and TV Journalism\n@@@Postgraduate Diploma in Science And Technology Journalism\n@@@Postgraduate Diploma in TV Journalism (Hindi)\n@@@Postgraduate Diploma Programme in Communication','B.A. Convergent Journalism\n@@@B.A. Commutative English With Journalism\n@@@B.A. Convergent Journalism\n@@@B.A. + M.A. Mass Communication\n@@@B.A. (Hons) Mass Communication And Journalism\n@@@B.A. (Hons) Hindi Journalism\n@@@B.A. (Hons) Journalism\n@@@B.A. Journalism\n@@@B.A. Mass Communication\n@@@B.M.C (Bachelor of Mass Communication)\n@@@B.Sc. Mass Communication and Journalism\n@@@B.Sc.  Mass Communication, Advertising and Journalism\n@@@B.Sc. Mass Communication\n@@@B.Sc. Journalism\n@@@Bachelor of Media Science\n@@@Bachelor of Communication, Journalism and Public Relations\n@@@Bachelor Of Journalism And Mass Communication-BJMC\n@@@B.A. Malayalam With Journalism\n','M.A. Broadcast Journalism\n@@@M.A. Convergent Journalism\n@@@M.A. Hindi And Journalism\n@@@M.A. Journalism and Mass Communication\n@@@M.A. (Hons) Journalism and Mass Communication\n@@@M.A. Journalism\n@@@M.A. Mass Communication\n@@@M.A. Media and Communication\n@@@M.A. Photojournalism\n@@@M.A. Public relation\n@@@M.Phil. Mass Communication And Journalism\n@@@M.Sc. Communication\n@@@M.Sc. Mass Communication\n@@@M.Sc. Mass Communication, Advertising And Journalism\n@@@Master In Development Journalism & Electronic Communication\n@@@Master in Journalism and Mass Communication-MJMC\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'PhD. Journalism and Mass Communication','AISFM Entrance Exam\n@@@Amrita University Mass Communication & Journalism\n@@@Asian Academy of Film and TV (AAFT) Noida\n@@@Asian College of Journalism Entrance Exam\n@@@Delhi University Integrated Course in Journalism\n@@@FTII Admission\n@@@Indian Institute of Mass Communication (IIMC)\n@@@MASCOM Entrance Exam\n@@@National Institute of Mass Communication & Journalism\n@@@Symbiosis Institute of Media & Communication(SIMC MA(MC)) \n@@@Satyajit Ray Film and Television Institute (SRFTI) \n@@@Xavier Institute of Communications Entrance Exam \n@@@WLCI All India Common Entrance Test \n@@@Makhanlal Chaturvedi National University of Journalism Entrance Exam','“Journalism is an immense power, that threatens soon to supersede sermons, lectures, and books.”-Theodore Tilton','image/png',NULL,'image/png',NULL,NULL),(160,'Human Resources Manager','4_HR.png','/subCategoryImages/160','2020-01-02 18:35:18',0,12,0,'Are you capable of listening and solving the problems of others?\nDo you have managing skills? \nAre you capable of taking decisions on your own?\n \nIf yes, here Human Resources Manager is the best career which suits you more. Now upgrade yourself by gaining your skills in Analyzing the different human mentalities, knowledge about hiring qualified and suitable people. Updating the knowledge according to the trends. With the expansion in the business market in India, there has been tremendous growth for this role. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Human Resource Manager looks after recruiting, screening, and hiring process for all new employees. \nThe human resource manager is someone who takes care of and manages an organization\'s human resource department. HR managers are the professionals whose main role is to inspiring and motivating the employees to do work. Human resource managers are also called upon to handle employee-related services, and employee relations, among many other tasks. They are responsible for hiring, training and managing the employees. They must be available to answer the questions and needs of the employee in an organization. Employees may approach them with any manner of issues and claims, and the manager must handle these issues with professionalism and should be able to solve it.\n','3-hr.png','/landingImages/160','To become a Human Resources Manager(HRM or HR), one should need at least a bachelor\'s degree in Human Resource Management or in a related field. Some employers require a master\'s degree in human resources management, business administration or a related field. You may also need years of experience to get into reputed organisations and for promotion level job.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,'Advance Diploma in Human Resource Management (ADMM)@@@Advance Post Graduate Diploma in Human Resource (APGDHR)@@@Diploma in Human Resource Development@@@Diploma in Human Resource Management (D.H.R.M.)@@@Executive Diploma in Human Resource Management@@@Post Graduate Diploma in Entrepreneurships and Human Relation@@@Post Graduate Diploma in Human Resource Management and Information Technology@@@Post Graduate Diploma in Human Resource Development@@@Post Graduate Diploma in Human Resource Development & Industrial Harmony@@@Post Graduate Diploma in Human Resource Management (PGDHRM)','B.A. (Human Resource Management)@@@B.B.A. (Human Resource Management)@@@B.B.A. + D.B.A. (Human Resource)@@@B.B.M. (HR)','M.A. (Human Resource Management)@@@M.B.A. (Behavioural Science Management )@@@M.B.A. (Customer Relationship Management)@@@M.B.A. (Human Resource Management)@@@M.B.A. (Marine Human Resource Management)@@@M.B.A. (Organizational Behaviour and Human Resource Development)@@@M.B.A. (Personnel Administration)@@@M.H.R.D.@@@Master in Management Studies (Human Resource)@@@Master of Human Resource and Organizational Development (MHROD)@@@Master of Human Resource Management (MHRM)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Human Resource)','Common Admission Test@@@Delhi University FMS General Ability Test@@@FORE School of Management Entrance Exam@@@ICFAI Business School Aptitude Test@@@Jamnalal Bajaj Institute of Management Studies Entrance Exam@@@Joint Entrance Management Aptitude Test@@@Joint Management Entrance Test@@@KIITEE Management Entrance Exam for MBA@@@Madhya Pradesh Management Entrance Test@@@S P Jain Institute of Management & Research Exam@@@Symbiosis National Aptitude Test@@@Xavier Aptitude Test','“You’re not just recruiting employees, but are sowing the seeds of your reputation.”-M3S Total Talent Solutions','image/png',NULL,'image/png',NULL,NULL),(161,'Indian Administrative Services','Indian-Administrative-Services.png','/subCategoryImages/161','2020-01-02 18:48:06',0,10,0,'Are you really interested to make your career in Indian services?\nDo you want to be a part of the government?\nDo you have a broad knowledge of general studies and current affairs?\n \nIf yes, this is the career which suits you more. It is one of the most prestigious careers, so set your goal to become an IAS officer as early as possible and start your preparation for cracking the exam. You should spend lots of time on preparation Since the number of candidates appears for the exam and competition is very high. Indian Administrative Services officer is one of the occupations where you will get a lot of respect as well as good remuneration. As an IAS officer, you have a chance to bring a change in the nation.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'An Indian Administrative Service(IAS) officer is a person who performs a number of varied tasks like maintaining and managing the law and order, revenue and general administration, etc., of the area under him depending on their posting and department.\n\nIAS stands on Indian Administrative Services and it is one of the three arms of the All India Services. An IAS officer is responsible for managing various administrative services of the government which involves maintaining law and order, managing the policies implementation of State and Central Government, collecting and securing revenues and other revenue matters, overseeing expenses of public funds, controlling the daily affairs of the government, implementation of policy in consultation with the minister responsible for the department involved, composing policies, suggesting the ministers on various issues, and many more. They should ensure running the administration of the district smoothly and properly and serve as a link between the political system and the civil services of the country.\nAn IAS officer can be placed in various positions in different departments. Based on the placed position their responsibilities may vary. The positions involve Sub Divisional Officer, Divisional Commissioner, District Magistrate/District Collector, Chief Secretary, and Cabinet Secretary.\n','1-IAS.png','/landingImages/161','Civil Services exam conducted by the body UPSC which is tasked by the government for the selection of deserving candidates. The candidate should get a good rank in this exam to be an IAS officer.  In order to appear for this exam, one must complete graduation or post-graduation of any disciple from any recognised university and they must be a citizen of India. This paper consists of three levels namely preliminary exam, mains exam and interview. Candidates who clear the preliminary exams will be selected for mains exams. The candidates who have secured a very good rank in mains exam will be selected for interview. After the selection of candidates in the interview, they are sent to Lal Bahadur Shastri National Academy of Administration (LBSNAA) for the training. After successful completion of training, according to the candidate performance in the training, they can be placed in different level positions of Indian administration services as per requirements of the state and central governments. \nBecoming an IAS officer is a dream of many youngsters as well as adults. Many of them will attempt the UPSC Exam number of times. But becoming an IAS officer is not an easy task. It takes lots of effort, advanced preparation, and a proper degree with good pass percentage. Enhance your general knowledge, concentrate on general studies, make a habit of newspaper reading, and be up to date with current affairs.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'B.Tech. (Any)@@@B.Sc. (Any)@@@B.Com. (Any)@@@B.A. (Any)@@@B.F.A. (Any)','M.Tech. (Any)@@@M.Sc. (Any)@@@M.Com. (Any)@@@M.A. (Any)@@@M.F.A. (Any)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“It always seems impossible until it\'s done.”-Nelson Mandela','image/png',NULL,'image/png',NULL,NULL),(162,'Boilermakers','1_Boiler-Maker.png','/subCategoryImages/162','2020-01-02 19:05:00',0,9,0,'Are you really interested in manufacturing things?\nCan you able to work in height and hot places?\nDo you have a broad knowledge of different manufacturing tools and equipment?\n \nYes, you can be! If you believe that you have these qualities in you then you can go for boilermaker as your career. Enrich yourself with safe work practices, creativity, know about different welding methods and also gain excellent command on technology, tools and equipment used for manufacturing the things related to this occupation. It is the career one can easily get into this with some previous work-related skill, knowledge, and experience and it suits people who love to work indoors. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A boilermaker is responsible for making boilers using metals like steel, iron, or copper to generate steam and also maintain them.\nA boilermaker is a trained person who makes boilers, tanks and containers by using different materials like steel, iron, copper, or stainless steel. Boilers are used in many areas like buildings, factories, ships for heat water or other fluids under extreme pressure in order to generate electric power. Large tanks and vats are used to prepare, process and store chemicals, oil, beer, and hundreds of different products. They are responsible for Installing pre-made boilers or boiler tanks within buildings and manufacturing facilities using robotic or automatic welders. Test, inspect, and inspect fixed boilers, tanks and vats for confirming leaks and defects, clean them by using wire brushes or cleaning solvents and also repair or replace the spoiled pipes, joints, valves, etc., using tools and welding equipment.  They have to maintain all these equipment properly by frequent inspection of fittings, feed pumps, water and pressure gauges, and boiler controls.\n','1-Boiler-Makers.png','/landingImages/162','There is no particular qualification is required for this field but practical training, apprenticeship, and experience are mandatory to start your career in this field. Anyway, if a candidate wants to pursue this subject, the basic eligibility is a bachelor’s degree in a related subject.  You should be equipped with qualities like alteration of pressure equipment, combustion principles, mechanical insulation designs, boiler fabrication, welding technology, installation techniques, mathematics, blueprint reading and sketching, general construction techniques, safety practices, and first aid.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'B.Tech.@@@B.Sc.@@@B.Com.@@@B.A.','M.Tech.@@@M.Sc.@@@M.Com.@@@M.A.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“Success doesn’t just find you. You have to go out and get it.”-Success.com','image/png',NULL,'image/png',NULL,NULL),(163,'Mobile App Developer','11_Mobile-App-Developer.png','/subCategoryImages/163','2020-01-02 19:13:37',0,8,NULL,'Are you crazy about knowing how apps are accessible in our mobiles? \nAre you interested in computer coding? \nDo you have a strong command of new technologies and programming languages?\n\nIf yes, then Mobile App Developer is one of the most popular careers among those who have a knack for creativity, coding languages, and excellent technical knowledge.  If you are considering becoming a Mobile App Developer, you have to encourage yourself to engage in the practical approach of coding, designing, and various computer languages along with your academics. This will make you hire by employers as quickly as possible.\nThe demand for mobile applications is expanding and technology is becoming more advanced which is creating abundant job opportunities in small, medium and large-sized firms and also providing jobs on a freelance basis.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Mobile App Developer is responsible for designing, programming, and testing applications used in mobile phones.\nMobile application developers design, create and develop applications which are used in different platforms such as smartphones and tablets. Before releasing the application they need to test the application after development process to make sure that there are no bugs, glitches, and crashes. Based on the company requirements they need to develop applications for android or ios. They will develop these applications by writing pages of code by using various programming languages such as Objective C, C++, Python, Kotlin,  HTML, JavaScript, XML, and many more based on the type smartphone application they are working.\n','8-Mobile-App-Developer.png','/landingImages/163','There is no particular qualification is required for this field. Anyway, if a candidate wants to pursue this subject, the basic eligibility is 10+2 or you need to have a bachelor\'s degree in computer programming, computer science, or a related field for postgraduate degrees that mainly focus on specific aspects of programming. Maximum organisations hire professionals with at least a bachelor’s degree in computer science, software engineering or related field of study. The candidates can also go for mobile app development courses provided by several private training institutes which will add value to your resume.\nThe aspirant can be specialised in ios app development or android app development based on their interest.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'B.E. (Computer Science and Engineering)@@@B.E. (Computer Science)@@@B.E. + M.B.A. (Computer Science & Engineering)@@@B.Tech. (Computer Science and Engineering)@@@B.Tech. (Computer Science and Engineering) + M.Tech. (Information Technology)@@@B.Tech. (Computer Science)@@@B.Tech. (Computer Science) + M.Tech. (SE / IC / VLSI)','M.Tech. (Computer Science & Technology)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Computer Science)','Admission Test for ICFAI Tech\nGraduate Aptitude Test in Engineering\nJoint Entrance Exam\nSant Longowal Institute of Engineering and Technology Entrance Test\n','“We are targeting innovation. We believe mobile applications are essential.”-Larry Page','image/png',NULL,'image/png',NULL,NULL),(166,'Career Counselor','1_Career-Counselors.png','/subCategoryImages/166','2020-01-02 19:38:34',0,7,0,'Do you have the knowledge about a wide range of careers available across the globe?\nCan you give suggestions about jobs and career options are available based on education, experience and skills?\nDo you have the ability to make an impact on others lives through your counselling? \n\nIf yes, then you can build your career in this field, step forward and be the person people can turn to in times of trouble. Train yourself regarding dealing with different personalities and involve in meetings with a  considerable number of people and engage in long one-on-one discussions with them. Know about the various career opportunities available across the globe, since if are knowledgeable then only you can guide others. Society, families, and individuals are frequently facing the need to get guidance and support at different phases in their lives which offers good employment in this field.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Career counsellors guide students and other individuals to find direction in their career progression and resolve career-related issues like educational and life decisions.\nA career counsellor helps, trains, and guides students and different individual with their career choice and progression. They start with interviewing the various background people to determine their skills, level of education, personality traits, and interests to properly serve them in their search for the right career. They need to have knowledge of the skills needed in various fields, the average salary of each field and the requirements of each field to guide their client\'s to find the right job, as well as assisting them to locate resources for strengthening the skills needed for the job desired. Most of the career counsellors join the fields of social work, coaching, and vocational counselling in schools and colleges. While some of them move on to outplacement positions and professional recruitment for corporate offices. \nCareer counsellors guide students and other individuals to find direction in their career progression and resolve career-related issues like educational and life decisions.\n \n A career counsellor helps, trains, and guides students and different individual with their career choice and progression. They start with interviewing the various background people to determine their skills, level of education, personality traits, and interests to properly serve them in their search for the right career. They need to have knowledge of the skills needed in various fields, the average salary of each field and the requirements of each field to guide their client\'s to find the right job, as well as assisting them to locate resources for strengthening the skills needed for the job desired. Most of the career counsellors join the fields of social work, coaching, and vocational counselling in schools and colleges. While some of them move on to outplacement positions and professional recruitment for corporate offices. \n','1-Career-Counsellors.png','/landingImages/166','There is no particular educational requirement required to become a career counsellor. However, minimum a masters degree and fair experience in areas like public relations, Human Resources Management, Human Psychology and career counselling will help you to start your career as a career counsellor. To start practising as a career counsellor, you will not just to empower one to settle on the choices they have to make presently but to give them the knowledge and expertise to settle on future career and life choices as well.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,'Diploma in Guidance and Counseling','B.A.Human Resource development','M.A. (Career Counseling)@@@M.Phil. (Career Counselling)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Career Counselling)',NULL,'“Climbing to the top demands strength, whether it is to the top of Mount Everest or to the top of your career.”-A. P. J. Abdul Kalam','image/png',NULL,'image/png',NULL,NULL),(168,'Software Developer','15_Software-Developer.png','/subCategoryImages/168','2020-01-02 20:09:18',0,8,0,'Have you ever forgot the world while working in front of the computer?\nDo you have problem-solving skills?\nAre you capable of using different computer languages, operating systems and databases?\n\nIf yes, a software developer is the best career which suits you more. Now improve yourself by learning different programming languages, write some program code, find the issues and try to solve it. They must be up to date with various latest technological advances, either in software or hardware. There are huge career options for software developers in every public and private sector. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A software developer develops software applications that allow users to perform specific tasks on computers or other devices. \nSoftware developers are the creative minds behind computer programs and programming. They look after the entire development process for a software program which involves product advancement process, exploration, designing structure, programming, modifying, testing, and bug fixing of PC programming. They need to recognise the core functionality that users require from software programs then design the program. They will work on developing applications that allow people to do a specific task on a computer or other gadgets. Software developers develop applications by using various computer languages like C++, Python, Java, PHP, XML, HTML, JavaScript, and CSS, operating systems like Linux, Solaris, HPUX, BSD, Mac OS X, Windows and also databases like Oracle (PL/SQL), MySQL based on their workplace specialization. They will work along with a group of people such as systems engineers and computer programmers.','11-Software-Devoloper.png','/landingImages/168','To start your career in this field one must have a bachelor degree in computer science, information technology, software engineering, or related field from a recognised institute or university. After completion of graduation, one can go for masters in computer science or related field. Many job levels in this field required a masters degree because one who completed masters will have more preference than the graduated. Learn Computer Languages which are the basic building block for developers. Learning whether or not you are skilled at this will help you decide if software development is a good fit. Once you have mastered one language, it becomes easy to transfer those skills and principles to learning another language.','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,'Diploma in Guidance and Counseling','B.Sc.\n@@@B.Com.\n@@@B.Tech.','M.Sc.\n@@@M.Com.\n@@@M.Tech.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. in Computer Science',NULL,'“Coding like poetry should be short and concise.”-Santosh Kalwar','image/png',NULL,'image/png',NULL,NULL),(169,'Tour Guide','2_Tour-Guide.png','/subCategoryImages/169','2020-01-02 20:14:20',0,21,NULL,'Do you love to explore the world? \nDo you know various historical and famous visiting places and able to explain the history behind it?\nDo you have knowledge about different geographical places?\n\nYes, you can be! If you believe that you have the extrovert outlook of the community. That involves a good set of communication skills with a slight pinch of politeness. And a touch of a keen sense of listening to others. Then you’re already on the first step towards becoming a tour guide. Now, gain your skills and responsibilities to be a professional. Explore the world with travelling based companies and be the mediator to understand various cultures and traditions. This occupation offers an individual with travelling around the world, knowing about the historical places and the diverse cultures of the world.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Tour Guides should provide tourists with information regarding the place are visiting and solve queries they may have.\nA tour guide is responsible for guide the tourists or visitors about the history of the location and popular places and also inform them about natural attractions, historic sites, museums, scenic localities and major visiting places among that area. They lead the tourists and carry out all the information about the location they are visiting and answer their queries. A tour guide can be work in the area of specialization such as historical tour, corporate tour, and nature tour or may specialize in all locations. Historical tour guides take the tourists to places like national monuments, historical sites, historic districts, religious or archaeological sites, and museums. Corporate tour guides are hired by companies that are usually lead visitors to factories and also describe the manufacturing process or history and mission. Nature tour guides take the tourists to natural attractions, national parks, and other outdoor locations. Most of them are self-employed and some of them are hired by tour operators, resorts, and other establishments like museums or historical landmarks.','2_tourguide.png','/landingImages/169','No specific educational qualifications are required to be a tour guide. Anyway, if a candidate wants to pursue this subject, the basic eligibility is 10+2. In this area of study includes a  diploma, bachelors and postgraduate-level courses. Qualification is just eligibility but you must be fluent in English and some foreign languages like French, German, Spanish, Japanese & Chinese. Since tourists come from various places from across the world and as a guide you should able to explain them each and every part of that place and place history.  You should know how to deal with the public and be polite in talking while communicating with visitors. \n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,'Post Graduate Diploma in Tourism Management\n','B.A. (Tourism and Hotel Management)\n@@@B.B.A. (Hons) (Travel and Tourism Management)\n@@@B.B.A. (Hospitality, Travel and Tourism)\n@@@B.B.A. (Tourism)\n@@@B.B.A. + D.B.A. (Travel & Tourism Management)\n@@@B.Sc. (Hospitality, Tourism and Catering)\n@@@B.Sc. (Tourism & Travel Management)\n@@@B.Sc. (Tourism Management)','M.A. (Tourism Management)\n@@@M.B.A. (Tourism and Hospitality Management)\n@@@M.B.A. (Travel & Tourism)\n@@@M.Phil. (Tourism and Hotel Management)\n@@@M.Sc. (Tourism)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“You just have to have the guidance to lead you in the direction until you can do it yourself.”-Tina Yothers','image/png',NULL,'image/png',NULL,NULL),(170,'Tour Operator','3_Travel-Agent.png','/subCategoryImages/170','2020-01-02 20:15:59',0,21,0,'Are you the one who can suggest the best place to travel? \nDo you have knowledge about different geographical places?\nCan you able to plan and manage a trip within a given budget?\n\nYes, you can be! If you believe that you have the extrovert outlook of the community. That involves a good set of communication skills with a slight pinch of politeness. And a touch of a keen sense of listening to others. Then you’re already on the first step towards becoming the tour operator. Now, gain your skills and responsibilities to be a professional. Explore the world with travelling based companies and be the mediator to understand various cultures and traditions. This occupation is very interesting and rewarding for those who have a keen interest in tourism and related fields and has an immense scope because people prefer to take the service of operators who can provide them with full holiday service.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A tour operator is a travel agent specializing in package holidays, organizing tours and manages the travel and stay of tourists.\nAn expert who combines tour and travel elements to create a holiday by organizing trips to various tourist destinations and manage the travel and stay of the tourists. They are responsible for arranging modes of transportation, accommodation, and food for their customers. They have to involve in tasks like planning, development, promotion, administration, and implementation of travel options. They should provide all tour services which include taking tourists to different places, provide a tour guide, accommodation, vehicle, booking transportation, lodging, activities, sightseeing trips and many more.  They spend more time on calls or in front of computer terminals, making travel arrangements and researching travel destinations for their clients. They suggest their client based on their expertise and offer complete travel packages from various resorts. They are often restricted to a budget and should be highly organized in order to offer their customers travel arrangements that fit both their financial barriers and leisure or business travel expectations. The main role of them is to plan for the customers and ensure they experience the best trip. \n','3_TravelAgent.png','/landingImages/170','There is no particular qualification is required for this field. Anyway, if a candidate wants to pursue this subject, the basic eligibility is a bachelor’s degree in travel and tourism or a related subject. You can be able to answer the queries of people about travelling sites and trips. With the practical experience, proper business and marketing strategies one can become a successful tour operator. \n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,'Advance Diploma in Tourism, Travel and Hotel Operations\n@@@Basic Diploma in Travel & Tourism\n@@@Diploma in Tourism & Hotel Management\n@@@Post Graduate Diploma in Tourism & Hotel Management\n@@@Post Graduate Diploma in Tourism\n@@@Post Graduate Diploma in Travel & Tourism Management','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','M.Phil. (Tourism)\n@@@M.B.A. (Tourism, Travel and Hotel Management)\n@@@M.Phil. (Tourism and Hotel Management)\n@@@M.A. (Tourism Management)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Tourism Management)\n',NULL,'“This tour will be one that you will not forget, from beginning to end it\'s the ultimate entertainment.”-Usher','image/png',NULL,'image/png',NULL,NULL),(171,'Language Translator','1_Language-Translater.png','/subCategoryImages/171','2020-01-02 20:20:29',0,21,NULL,'Do you have a good command of different languages?\nDo you have excellent communication and listening skills?\nAre you good at conveying what others are saying?\n\nYes, you can be! If you believe that you have the extrovert outlook of society. That involves a good set of communication skills with a slight pinch of politeness. And a touch of a keen sense of listening to others. Then you’re already on the first step towards becoming the language translator. Now, gain your skills and responsibilities to be a professional. Travel the world with business officials, or be a part of the government. Explore the world with travelling based companies and be the mediator to understand various cultures and traditions.  \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A person who acts as a medium to convey different languages into one’s own mother tongue is a language translator.\nA language translator is an important link between the different people who speak different languages. Language translators translate communication of a source-language text to an equivalent target-language text. They translate the communication between two or more persons who speak different languages and are not able to communicate directly. Translators are needed to work with business, technical, legal and scientific written materials. These materials also include letters, reports, articles, books and many more. They need to read, understand, analyze, edit and write copies of the text. Modern translation involves different tools and technologies. \n','1_Language-Translator.png','/landingImages/171','Any translator must require a bachelor\'s degree in translation or in any related field of interest, but the most important qualification is that they should be fluent in two or more languages excluding their native language. During your journey as an undergraduate one should develop a  strong command of verbal communication that includes writing the language with zero error of grammar. Also having good Interpersonal communication and software proficiency will improve the accuracy in translation.','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'B.Sc. \n@@@B.A. \n','M.Sc. \n@@@M.A.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'PhD. ',NULL,'“A translator ought to endeavour not only to say what his author has said but to say it as he has said it.”-John Conington','image/png',NULL,'image/png',NULL,NULL),(172,'Soft Skills Trainer','2_Soft-skills-Trainer.png','/subCategoryImages/172','2020-01-02 20:24:35',0,18,NULL,'Do you have the ability of training, teaching and managing different people?\nCan you bring your strengths to learners in new and innovative ways?\nDo you have an excellent command of different interpersonal and professional skills?\nThen here is the career which suites to your knowledge and passion. Make yourself fit for this role by enhancing your training skills,  dedication to ongoing research and learning, a strong foundation of teaching skills, and deeply-rooted personal practice. Soft skills trainer can find work even with people like political figures, models, the film stars and persons willing to develop in a certain area like business, leadership skill etc. coming under its preview.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A Soft Skills Trainer is responsible for training individuals to help them strengthen their interpersonal and professional skills.\nA Soft Skills Trainer provide training for individuals who struggle with or lack interpersonal communication skills. They teach helpful strategies as well as provide several role-playing activities that allow the participants to realize their shortcomings and take action to correct them. They have to expert in teaching the required skills in the employees to help in his/her career advancement since large corporations are recruiting those individuals who are smart, well-groomed and have excellent interpersonal skills. They are mainly responsible for helping individuals to improve career possibilities and improve personality as a whole that may prove vital in career assessment and career development.\n','2-Soft-skills-Trainer.png','/landingImages/172','Any soft skill trainer must require a bachelor\'s degree in any related field of interest or preferably with education, communication, social sciences, liberal arts and humanities. During your journey as an undergraduate one should develop a  strong command of writing and verbal communication skills. Also having good Interpersonal skills and software proficiency will improve your teaching methods.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'B.Sc.\n@@@B.Com.\n@@@B.A.\n@@@B.Tech.','M.Sc.\n@@@M.Com.\n@@@M.A.\n@@@M.Tech.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“When you don’t learn the best, you will teach the worst.”-Israelmore Ayivor','image/png',NULL,'image/png',NULL,NULL),(173,'Fitness Trainer/Instructor','3_Fitness-Trainer.png','/subCategoryImages/173','2020-01-02 20:31:57',0,17,NULL,'Are you crazy about diet, exercise and fitness?\nDo you have the knowledge and handling ability of different exercising equipment? \nDo you notice a mentor inside you and able to bring your strengths to learners in new and innovative ways?\n\nIf yes, then here is the best career which suits you more. You can become a fitness instructor by adopting qualities like genuine passion for diet and exercise, dedication to ongoing learning, a strong foundation of teaching skills, and deeply-rooted personal practice. As a fitness trainer, you play a key part in the transformation of an individual. Very few other professions allow you to work a direct role in a person\'s life. It is the career which will allow you doing something you love and get paid for it.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Fitness Trainer is a professional who guides, instructs, and motivates individuals or groups in exercise activities to keep oneself fit and healthy.\n\nFitness instructors design individualized exercise plans according to their disabilities, health conditions or ailments. They are also responsible for providing health coaching and nutrition counselling to help patients and clients to improve certain health problems like blood pressure, blood glucose and muscular range of motion. They will work with all types of people and can teach classes with children, adults and senior citizens. They should use safe and proven training methods help individuals reach their fitness goals. In addition, they should create enthusiasm to help the client reach their goals, the trainer should also have a large, relevant technical background, a strong foundation in fitness, a fitness instructor should have a strong background in nutrition. Most of the Fitness instructors work in health clubs, fitness or recreation centres, gyms, and yoga and Pilates studios. Some of them work at the client\'s homes depending on customer needs. \n','3-Fitness-Trainer.png','/landingImages/173','No formal educational qualification is needed for becoming a Fitness Instructor. Fitness instructors typically require a bachelor\'s degree from a recognized institute or university. The degree is related to exercise physiology, nutrition, kinesiology,  exercise science, dietetics physical education, or degree similar health or fitness field is more beneficial. A masters degree in anatomy or physiology with a slight bit of training experience will make to hire in reputed firms. Most of the colleges and universities provide professional certifications. To get started in this area Training and certification are the most important.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'B.Sc. (Hons)','M.Sc.\n@@@M.Sc. (Hons)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“The most important thing is to try and inspire people so they can be great in whatever they want to do.”-Kobe Bryant','image/png',NULL,'image/png',NULL,NULL),(174,'Dietician','2_Dietician.png','/subCategoryImages/174','2020-01-02 22:11:22',0,17,1,'Do you stay up to date with the latest nutritional science research?\nDo you have knowledge of the scientific aspects of food?\nDo you have a keen interest in the impact of diet on health?\n \nThen here is the career which suites to your knowledge and passion. Make yourself fit for this role by adopting great knowledge about the food items or products that contain carbohydrates, fats, vitamins and proteins and know the ways to solve the difficulty of people suffering from different health issues. At the present scenario, most of the people want to be fit and healthy and this will provide good career opportunities for the dietitian.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'An expert on diet and nutrition is called Dietician.\nA dietician is a professional who explains scientific information about nutrition into practical advice to help people make health-conscious decisions about food. And also, diagnose and treat diet-related problems to increase the awareness of the link between food and health to prevent future problems. They change their patient\'s nutrition based on their medical condition and individual needs. The primary tasks of the dieticians include educating people about nutrition, making evaluations of patients nutritional needs, describing the appropriate meal plans, observing the effects of the meal plans, and improving the meal plans as necessary. \n','2-Dietician.png','/landingImages/174','Same as every profession, the dietician also has its own educational qualifications. The minimum educational requirement is completing a bachelor\'s degree or a masters course in Dietetics, Nutrition, or closely related field. Along with your academic study, you should furnish yourself with various dietary methods, technologies and handling of various equipment of this field. You will need a high training and experience to be successful in this position.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Courses in Dietetics & Health Education\n@@@Certificate in Nutrition and Child Care (CNCC)\n@@@Certified Course in Food and Nutrition\n@@@PGCC (Clinical Nutrition)','Diploma in Dietetics and Applied Nutrition\n@@@Diploma in Dietetics and Nutrition\n@@@Diploma in Dietetics, Health and Nutrition','B.Sc. (Nutrition & Dietetics)','Fellowship in Applied Nutrition (FAN)\n@@@M.Sc Nutrition and Dietetics',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Nutritional Science)','Manipal University M.Sc in Dietetics and Applied Nutrition Entrance exam\n@@@Mangalore University Master of Science in Dietetics and Food Service Management Entrance Exam\n@@@Annamalai University M.Sc in Dietetics entrance exam\n@@@All India Institute of Hygiene & Public Health Entrance exam\n@@@IGNOU M.Sc in Dietetics and Food Service Management Nutritional Biochemistry Exam\n@@@S.N.D.T. WOMEN’S UNIVERSITY PGD in Dietetics entrance exams\n@@@The University of Mumbai M.Sc in Dietetics Entrance Exam\n@@@The University of Kerala M.Sc in Dietetics Entrance Exam\n@@@Osmania University Entrance Exam','“As a physician specializing in nutrition, my priority is to the health of the public.”-Michael Greger','image/png',NULL,'image/png',NULL,NULL),(175,'Food Technologist','5_Food-Technologist.png','/subCategoryImages/175','2020-01-02 22:13:44',0,17,NULL,'Do you have a broad knowledge of food, nutrition and health?\nAre you fascinated about food processing and associated procedures?\nDo you have an exceptional ability to handle food safety and quality management?\n\nIf yes, then you can build your career as a food technologist, step forward by gaining knowledge on food chemistry and biology, food manufacturing methods and technology, set of rules and regulations of processing and manufacturing of food products, existing and new food products, business management and marketing. Individuals who love food will definitely enjoy working in this industry by creating exciting new products, testing products for quality, or doing research. One of the largest industry on the planet is the food industry which will always allow you to work anywhere along the food supply chain.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Food technologist is responsible for ensuring food products are produced safely, legally and with quality by using the biological, chemical and physical composition of all foodstuffs which are used for processing. \nA person who manages the manufacturing processes and food recipes and drink products and also works on existing and newly-discovered ingredients to invent new recipes and concepts which includes preservation of fruits, meats, vegetables, and dairy products are called food technologists. They deal with both science and technology to manufacture processed food and packaging. Food technologists also conduct scientific research to upgrade agriculture, processing, production, storage, and shipment of food products. They also play a vital role in product development for food companies, and they might also work with food production suppliers, companies that manufacture food equipment. \n','5-Food-Technologist.png','/landingImages/175','The basic eligibility to start a career as a food technologist is a bachelor\'s degree in food technology, food science or a closely related subject from a recognised university. Bachelor\'s degree allows getting an entry-level job but for entering into a professional food technologist position and to have career progression one must complete masters and doctoral level education and should gain proper experience. Get knowledge of laboratory equipment, testing new products using laboratory environment, methods of food processing, methods to improve quality of food products, developing and implementing food standards which will make you ready to enter into this field.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Course in Food Technology','Diploma in Nutrition and Food Technology','B.Tech. Food Technology\n@@@B.E. Food Technology\n@@@B.Tech. Food Science and Technology\n@@@B.Sc. (Food Technology)\n@@@B.Sc. (Hons.) Food Technology\n@@@B.Sc. (Food Processing Technology)\n@@@B.Sc. Applied Sciences (Hons.) (Food Technology)','M.Tech. Food Technology\n@@@M.E. Food Technology\n@@@M.Sc. (Food Technology)\n@@@M.Sc. (Food Science and Technology)\n@@@M.Sc. (Microbial & Food Technology)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. in Food Technology\n@@@Ph.D. (Food and Dairy Technology)\n@@@Ph.D. (Food Science and Technology)','CFTRI:  Central Food Technological Research Institute Entrance Exam\n@@@GATE Food Technology Entrance Exam\n@@@IICPT: Indian Institute of Crop Processing Technology Entrance Exam\n@@@AIJEE: All India Joint Entrance Exam Exam\n@@@Babu Banarasi Das University Entrance Exam\n@@@Gitam University Entrance Exam\n@@@Punjab Agricultural University Entrance Exam\n@@@University of Calcutta Entrance Exam\n@@@University of Mysore Entrance Exam\n@@@TANCET-Tamil Nadu Common Entrance test\n@@@IIS- The Indian Institute of Science entrance exams\n@@@IIT- Indian Institute of Technology Entrance Exam\n@@@CFTRI- Central Food Technology Research Institute\n@@@Allahabad University Entrance Exam','“One machine can do the work of fifty ordinary men. No machine can do the work of one extraordinary man.”-Elbert Hubbard','image/png',NULL,'image/png',NULL,NULL),(176,'KPO','2_KPO.png','/subCategoryImages/176','2020-01-02 22:30:25',0,16,0,'Are you really good at massive interaction with different people?\nDo you have good computer operating skills?\nDo you feel you are excellent in oral and written communication?\n\nIf yes, then step into this field of KPO job. Develop yourself with communication and interactive skills. KPO job pays a higher salary than the other sectors that employ people with an undergraduate degree. Other than salary, this field provides you with other allowances like incentives, night shift allowance, etc. If you want to start your career with minimum education this is the job exactly what you are looking for.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'KPO job includes processes like research, valuation, investment researches, insurance and legal claim, patent filing and transfer of knowledge plus information related process of an organization.\n\nKPO produces extensive knowledge, expertise and analysis on complex areas like Legal Services, Business and Market Research, etc. KPO firms perform several tasks for which very skilled employees are needed by the firms. KPO is an extended version of BPO and most of the organisations provide both BPO and KPO services. A person can be placed in different positions in Knowledge Processing Outsourcing based companies such as Investment research services, Market research services, Data analytics, Business research services, Legal Process Outsourcing, Financial Process Outsourcing, and Media Process Outsourcing. KPO professionals work for the companies which will receive the knowledge-based projects or work from other organisations and perform tasks based on projects.\n','2-kpo.png','/landingImages/176','To enter into this position one must obtain any bachelor\'s degree from a recognised board. Most of the KPO organizations particularly ask for a bachelor\'s degree in the field of science, maths or statistics depending upon the organisation they are working for. Some of these organisations hire the candidates with the 10+2 qualification and train them according to their need. This field requires strong oral and written communication skills. Try to equip yourself with computer technologies which will add value to your resume.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Obtain any bachelor\'s degree in an equivalent field of study.',NULL,NULL,'B.Sc. (Any)@@@B.Com. (Any)@@@B.A. (Any)@@@B.Tech. (Any)','M.Sc. (Any)@@@M.Com. (Any)@@@M.A. (Any)@@@M.Tech. (Any)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“The important thing about outsourcing or global sourcing is that it becomes a very powerful tool to leverage talent, improve productivity and reduce work cycles.”-Azim Premji','image/png',NULL,'image/png',NULL,NULL),(177,'Yoga Instructor','6_Yoga.png','/subCategoryImages/177','2020-01-02 22:32:44',0,17,NULL,'Do you notice a mentor inside you?\nDo you have a meditation practice and physical flexibility?\nCan you bring your strengths to learners in new and innovative ways?\n\nIf yes, then here is the best career which suits you more. You can become a yoga instructor by adopting qualities like genuine passion for yoga,  dedication to ongoing learning, a strong foundation of teaching skills, and deeply-rooted personal practice. It is the career which will allow you doing something you love and get paid for it.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Yoga instructors are professionals who teach yoga to keep oneself fit and healthy.\nYoga instructors are the one who teaches yoga, a kind of exercise that involves controlled postures and breathing techniques to improve fitness, flexibility, strength, balance and peace of mind for the learner. The primary task is to show how the moves of a particular exercise are to be done for the participants and also correct them when they perform a movement incorrectly. Along with teaching postures and breathing, they also teach students meditation and visualization exercises. Some of them are responsible for design courses and lesson plans and make sure that these are adapted to the groups that they teach. Yoga instructors have to know the beginners and experienced students in their classes and make the instructions to their needs and also evaluate the improvement of their learners and determine if they are ready to advance to more complicated movements. They should always ready for upgrading their knowledge about the exercise and their teaching skills. \n','6-yoga.png','/landingImages/177','To start your career as a Yoga instructor a Professional practice and a bachelor\'s degree in yoga is the minimum requirement. Yoga is offered in different levels of study such as masters, doctoral, diploma, and certification. One can opt for masters or doctoral after completing a bachelor\'s degree to be professional and to get into a high position or can obtain certification and diploma to add value to your resume.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Course in Yoga\n@@@Certificate Course in Yoga and Naturopathy\n@@@Certificate in Physiotherapy and Yoga Therapy\n@@@Certificate in Yoga Education (C.Y.Ed.)','Diploma in Yoga Teacher Training\n@@@Diploma Course in Yoga Education\n@@@Diploma in Yoga\n@@@Diploma in Yoga & Ayurveda (Basic)\n@@@Diploma in Yoga and Physical Education\n@@@Diploma in Yoga Education and Human Sciences (DYEHS)\n@@@Diploma in Yoga Shishak (D.Y.S.)\n@@@P.G. Diploma in Yoga Education (D.Y.Ed.)\n@@@Post Graduate Diploma in Yoga\n@@@Post Graduate Diploma in Yoga and Alternative Therapy\n@@@Post Graduate Diploma in Yoga and Holistic Health\n@@@Post Graduate Diploma in Yoga and Naturopathy\n@@@Postgraduate Diploma in Yoga Therapy','B.Ed. Yoga\n@@@B.A. (Yoga and Naturopathy)\n@@@B.A. (Yoga)\n@@@B.A. (Yogashastra)\n@@@B.Ed. (Yoga)\n@@@B.Sc. (Yoga and Consciousness)\n@@@B.Sc. (Yoga and Education)\n@@@B.Sc. (Yoga and Management)\n@@@B.Sc. (Yoga)\n@@@Bachelor of Naturopathy & Yoga Science','M.A. (Applied Yoga and Health)\n@@@M.A. (Sankhya Yoga)\n@@@M.A. (Yoga and Naturopathy)\n@@@M.A. (Yoga)\n@@@M.A. (Yogashastra)\n@@@M.D. (Yoga and Rehabilitation)\n@@@M.Sc. (Health and Yoga Therapy)\n@@@M.Sc. (Yoga and Management)\n@@@M.Sc. (Yoga and Naturopathy)\n@@@M.Sc. (Yoga)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Yoga)\n','Gurukul Kangri Vishwavidyalaya Entrance Exam\n@@@Yoga University Entrance Exam\n@@@Rashtriya Sanskrit Vidyapeeth Entrance Exam\n@@@Gujarat Ayurved University Entrance Exam\n@@@Shri Venkateshwara University Entrance Exam\n@@@AIA PGET\n@@@UP CPAT\n@@@BNYS Entrance Exam\n@@@UAPMT','“Yoga is the natural rhythm of life which brings you closer to yourself and to others.”-Sri Sri Ravi Shankar','image/png',NULL,'image/png',NULL,NULL),(179,'General Surgeon','6_General-Surgeon.png','/subCategoryImages/179','2020-01-02 22:39:23',0,15,0,'Are you passionate about medicine?\nAre you the one who can understand the grief or problems of others easily? \nHave you ever thought about using this ability of yours to better the lives of struggling people?\n\nIf yes, This is exactly what these General Surgeon do. Not like other professions, becoming a general surgeon requires a high amount of hard work, training, time, experience, and lots of effort. This position involves the lifelong learning process. It was an interesting and challenging job. A general surgeon must be emotionally and physically strong. This role provides you with a lot of opportunities for learning new things, various medical equipment, and techniques. You have an opportunity to save not only a patient but also their family. But it is the profession where you will be paid for what you have sacrificed to reach the position. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A general surgeon is a physician who is responsible for diagnosing the patient who has a condition that requires surgery by performing various tests.\nA general surgeon is responsible for performing various tests such as ultrasound, CT scan, and many more in order to diagnose whether the patient condition requires surgery or not. Also, they have to determine the patient is healthy enough for surgery. The type of surgeries performed by general surgeons mostly abdominal organ surgeries including oesophagus, stomach, small bowel, colon, liver, pancreas, gallbladder, appendix, bile ducts and also appendectomy, hernia repair, breast tumours,  skin cancers, skin, breast, soft tissue, trauma, peripheral vascular surgery, and so on. General surgeons will not work alone in the operating room, there will be an assistant surgeons, nurses, and other surgical technicians. They are also making the rounds in all areas of the hospital. They should able to handle the theories such as anatomy, immunology, metabolism, nutrition, pathology, physiology, emergency and intensive care, shock and wound healing.\n','4-General-Surgeon.png','/landingImages/179','Complete 10+2 in science stream(BPC) from a recognised board. Then go for undergraduate course MBBS. And then one should study the master’s course with the general surgery as a specialization. You should furnish yourself with various surgical methods, technologies and handling of various equipment. You will need a high level of training and experience to be successful in this position.','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'MBBS','D.N.B. (General Surgery)\n@@@M.Ch. (General Surgery)\n@@@M.S. (General Surgery)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'AIIMS Post Graduate – Post Doctoral Courses Entrance examination\nAIPGMEE – All India Post Graduate Medical / Dental Entrance Examination\nAll In