1-02 22:45:13',0,15,0,'Do you love to spend time with kids?\nAre you the one who can handle children easily? \nHave you ever thought about using the ability of yours to better the lives of struggling people?\n\nIf yes, You can be a paediatrician, this position requires a high amount of hard work, training, time, experience, and lots of effort. It involves the lifelong learning process. It was an interesting and challenging job. A paediatrician must be strong both emotionally and physically because they treat the children suffering from different diseases. As a paediatrician, you can get work satisfaction by treating children to lead a healthy life and bring back them from illness or injury.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Paediatrician is a child medical practitioner concentrating on the medical care of infants, children, adolescents and their diseases.\nA Paediatrician is responsible for providing physical, mental and emotional care for infants, children and adolescents. They treat infants and children who are suffering from minor injuries, acute and chronic health problems, physiological and psychological growth and developmental concerns, perform diagnostic tests to get patient\'s medical condition and determine treatments, therapies, medications and vaccinations to treat illness, disorders or injuries and also give counselling and guide kids and their parents or guardians concerning about diet, hygiene and disease prevention. Paediatrician monitors their patients’ growth and improvement from infancy to young adulthood and provides everyday healthcare treatments, like physical examinations, immunizations and prescriptions for antibiotics to treat bacterial infections.\n','7-Pediatrician.png','/landingImages/181','Complete 10+2 in science stream(BPC) from a recognised board. Then go for a bachelor\'s degree MBBS. And then one should study the master’s course in paediatrics with the area of specialization. One must complete the study and practice of masters degree to enter into this position. You should furnish yourself with various treating methods since you are dealing with kids, technologies and handling of various equipment related to this role. You will need a high level of training and experience to be successful in this position.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,'P.G. Diploma in Child Health - D.C.H.\n@@@P.G. Diploma in Child Health','Bachelor of Medicine and Bachelor of Surgery (MBBS)','M.D. in Paediatrics\n@@@M.S. in Paediatrics',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Aligarh Muslim University Entrance Exam\n@@@All India Institute of Medical Sciences Entrance Exam\n@@@All India Post Graduate Medical Entrance Examination (AIPGMEE)\n@@@Allahabad University Entrance Exam\n@@@Anna University Entrance Exam\n@@@Annamalai University Entrance Exam\n@@@Armed Forces Medical College Entrance Exam\n@@@Arunachal University Entrance Exam\n@@@Assam University Entrance Exam\n@@@AWH Special College Entrance Exam\n@@@Baba Farid University of Health Sciences\n@@@Banaras Hindu University Entrance Exam\n@@@Bangalore University Entrance Exam\n@@@Bankura Sammilani Medical College (Deemed University) Entrance Exam\n@@@Bharathiar University Entrance Exam\n@@@Bharati Vidyapeeth University Entrance Exam\n@@@Central Institute Of Psychiatry Entrance Exam\n@@@Chaudhary Charan Singh University Entrance Exam\n@@@Chhatrapati Shahuji Maharaj Medical University Entrance Exam\n@@@Dr. B. R. Ambedkar University (Agra University) Entrance Exam\n@@@Dr. D. Y. Patil University Entrance Exam\n@@@Dr. N.T.R University of Health Sciences Entrance Exam\n@@@Gandhigram Rural Institute Entrance Exam\n@@@Gujarat University Entrance Exam\n@@@Guru Gobind Singh Indraprastha University Entrance Exam\n@@@Guwahati University En