trance Exam\n@@@Sikkim-Manipal University of Health Entrance Exam\n@@@Sree Chitra Tirunal Institute for Medical Sciences and Technology Entrance Exam\n@@@Sri Jayadeva Institute of (Pediatric) Cardiology Entrance Exam\n@@@Sri Ramachandra Medical College and Research Institute Entrance Exam\n@@@Sri Ramachandra University Entrance Exam\n@@@Sri Venkateswara Institute of Medical Sciences Entrance Exam\n@@@Srinivas College of Physiotherapy (pediatric physiotherapy) Entrance Exam\n@@@Superspeciality Entrance Test (MH SSET)\n@@@Tamil Nadu Dr M G R Medical University Entrance Exam\n@@@Thai Moogambigai Dental College & Hospital Entrance Exam\n@@@The Jawaharlal Institute of Postgraduate Medical Education & Research (JIPMER) Entrance Exam\n@@@The Post Graduate Medical Entrance Test (PGMET)\n@@@TN Dr MGR Medical University Entrance Exam\n@@@University of Allahabad Entrance Exam\n@@@University of Calcutta Entrance Exam\n@@@University of Calicut Entrance Exam\n@@@University of Delhi Entrance Exam\n@@@University of Hyderabad Entrance Exam\n@@@University of Jammu Entrance Exam\n@@@University of Kalyani Entrance Exam\n@@@University of Kerala Entrance Exam\n@@@University of Lucknow Entrance Exam\n@@@University of Mumbai Entrance Exam\n@@@University of Mysore Entrance Exam\n@@@University of Pune Entrance Exam\n@@@Uttar Pradesh Technical University Entrance Exam\n@@@Vinayaka Mission University Entrance Exam\n@@@West Bengal University of Health Sciences Entrance Exam','“Happiness is mostly a by-product of doing what makes us feel fulfilled.”-Benjamin Spock quotes','image/png',NULL,'image/png',NULL,NULL),(182,'Cardiologist','4_Cardiologist.png','/subCategoryImages/182','2020-01-02 22:48:19',0,15,NULL,'Are you passionate about medicine?\nDo you have a keen interest in heart functioning, it\'s problems and treatment? \nDo you love to work to better the lives of struggling people as well with huge earnings?\n\n\nIf yes, You can be a cardiologist, this position requires a high amount of hard work, training, high study period, experience, and lots of effort. It involves the lifelong learning process. It was an interesting and challenging job. A cardiologist must be strong both emotionally and physically because they have to treat the various patients suffering from different heart disorders. A cardiologist position is a very important profession which offers a significant activity working environment to an individual. This is the profession where you will get lots of respect and satisfaction by saving the lives of struggling people as well you will be paid for what you have sacrificed to reach the position. Due to an increment in the heart patients, there are a lot of jobs available for cardiology specialists in private as well as in government hospitals.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A Cardiologist is a specialist who deals with the disorders, abnormalities and diseases of the heart by diagnosing, treating and anticipating restorative states of the cardiovascular system.  \nAn expert in cardiology is called a cardiologist. A cardiologist performs the treatment for cardiovascular diseases such as coronary artery bypass surgery, percutaneous coronary intervention, percutaneous transluminal angioplasty, stenting, etc., by diagnosing cardiovascular diseases using blood tests, cardiac stress tests, electrocardiography, computed tomography, magnetic resonance imaging and many more techniques. Unlike cardiac surgeons, maximum cardiologists will not perform any surgeries they were dealing with treating the cardiovascular system by diagnosing the abnormalities with various tests and apply the appropriate method to cure the disease without performing any heart surgeries. But some of the cardiologists depending on their position, experience and skills they may need to perform surgeries. \n','2-Cardiologist..png','/landingImages/182','Standard education, training and experience are mandatory to be a cardiologist. Becoming a cardiologist takes a long period of study and training. Start your path towards becoming cardiologist by completing the initial step 10+2 in science stream(BPC) from a recognised board. Then go for bachelor\'s degree MBBS along with training. After completion of MBBS, you must study the master’s course with the cardiology as a specialization as well complete doctorate program in cardiology. You should furnish yourself with various treating methods, technologies and handling of various equipment related to this position. ','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'Bachelor of Medicine and Bachelor of Surgery (MBBS)','MD CARDIOLOGY\n@@@DNB CARDIOLOGY',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'D.M Cardiology\n@@@MCH Cardiology\n@@@Ph.D. in Cardiology','All India Institute for Medical Science (AIIMS) Entrance Exam\nApollo Hospitals Entrance Exam\nBaba Farid University of Health Sciences Entrance Exam\nBanaras Hindu University Entrance Exam\nBangalore University Entrance Exam\nBankura Sammilani Medical College (Deemed University) Entrance Exam\nCalcutta University Entrance Exam\nChaudhary Charan Singh University Entrance Exam\nChhatrapati Shahuji Maharaj Medical University Entrance Exam\nDr M G R Medical University Entrance Exam\nDr. B. R. Ambedkar University (Agra University) Entrance Exam\nDr. D. Y. Patil University Entrance Exam\nDr. N.T.R University of Health Sciences Entrance Exam\nGujarat University Entrance Exam\nGuru Gobind Singh Indraprastha University Entrance Exam\nGuwahati University Entrance Exam\nIndian College of Cardiology Entrance Exam\nIndira Gandhi Medical College Entrance Exam\nInstitute Of Health and Management Studies Entrance Exam\nInstitute Of Medical Sciences Entrance Exam\nJamia Millia Islamia Entrance Exam\nJawaharlal Nehru University Entrance Exam\nK