am\nUniversity of Hyderabad Entrance Exam\nUniversity of Jammu Entrance Exam\nUniversity of Kalyani Entrance Exam\nUniversity of Kerala Entrance Exam\nUniversity of Lucknow Entrance Exam\nUniversity of Mumbai Entrance Exam\nUniversity of Mysore Entrance Exam\nUniversity of Pune Entrance Exam\nUtkal University\nVinayaka Mission University Entrance Exam\nWest Bengal University of Health Sciences Entrance Exam\n','“Accept the challenges so that you can feel the exhilaration of victory.”-George S. Patton','image/png',NULL,'image/png',NULL,NULL),(183,'Neuro-Surgeon','8_Neuro-Surgeon.png','/subCategoryImages/183','2020-01-02 22:50:21',0,15,NULL,'Are you passionate about medicine?\nAre you the one who can understand the grief or problems of others easily? \nHave you ever thought about using this ability of yours to better the lives of struggling people?\n\nIf yes, This is exactly what these Neurosurgeons do. Not like other professions, becoming a neurosurgeon requires a high amount of hard work, training, time, experience, and lots of effort. This position involves the lifelong learning process. It was an interesting and challenging job. A neurosurgeon must be emotionally and physically strong. This role provides you with a lot of opportunities for learning new things, various medical equipment, and techniques. You have an opportunity to save not only a patient but also their family. But it is a profession where you will be paid for what you have sacrificed to reach the position. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A Neurosurgeon is a surgeon who specializes in the diagnosis and surgical treatment of the nervous system, especially the brain and spinal cord.\n\nA physician who studies and practices diagnosis and surgical treatment of illnesses,  injuries and disorders of the central and peripheral nervous system which includes congenital anomalies, trauma, tumours, vascular disorders, diseases of the brain or spine, stroke, or degenerative diseases of the spine. They undertake some of the most daunting, risky, and critical operations imaginable on brains. Neurosurgeons coordinate with neurologists and other medical professionals to provide complete inpatient care for patients with complex neurological disorders. In additional they have to perform tasks like preparing documents and track all treatments, diagnoses, medications, and manage other health data.\n','6-Neuro-Surgeon.png','/landingImages/183','Complete 10+2 in science stream(BPC) from a recognised board. Then go for undergraduate course MBBS. And then one should study the master’s course with the neurosurgery as a specialization. Completion of a masters degree is compulsory to start your career as a neurosurgeon. You should furnish yourself with various surgical methods, technologies and handling of various equipment related to this position. You will need a high level of training and experience to be successful in this position.','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'M.B.B.S.','M.S. (Neurosurgery)\n@@@M.Ch (Neurosurgery)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Allahabad University Entrance Examination\n@@@Amrita Viswa Vidyapeetham Entrance Examination\n@@@Andhra Pradesh University of Health Sciences Entrance Exam\n@@@Anna University Entrance Exam\n@@@Baba Farid University of Health Sciences Entrance Exam\n@@@Banaras Hindu University Entrance Exam\n@@@Bangalore University Entrance Exam\n@@@Bharath University Entrance Exam\n@@@Bharati Vidyapeeth University Entrance Exam\n@@@Calicut University Entrance Exam\n@@@Chhatrapati Shahuji Maharaj Medical University Entrance Exam\n@@@Choudhary Charan Singh University Entrance Exam\n@@@Dibrugarh University Entrance Exam\n@@@Dr. D. Y. Patil University Entrance Exam\n@@@Dr. MGR Medical University Entrance Exam\n@@@Dr. NTR University of Health Sciences Entrance Exam\n@@@Dr. Ram Manohar Lohia Avadh University Entrance Exam\n@@@Gauhati University Entrance Exam\n@@@Gujarat University Entrance Exam\n@@@Himachal Pradesh University Entrance Exam\n@@@Institute Of Postgraduate Medical Education and Research Entrance Exam\n@@@Jamia Millia Islamia University Entrance Exam Entrance Exam\n@@@Jawaharlal Institute of Postgraduate Medical Education & Research Entrance Exam\n@@@Jiwaji University Entrance Exam\n@@@Lucknow University Entrance Exam\n@@@Maharaja Sayajirao University of Baroda Entrance Exam\n@@@Maharashtra University of Health Sciences Entrance Exam\n@@@Mahatma Gandhi University Entrance Exam\n@@@Mangalore University Entrance Exam\n@@@Manipal Academy of Higher Education Entrance Exam\n@@@Manipal University Entrance Exam\n@@@Meenakshi University Entrance Exam\n@@@Mumbai University Entrance Exam\n@@@Mysore University Entrance Exam\n@@@National Institute of Mental Health and Neuro Sciences Entrance Exam\n@@@Nizam`s Institute of Medical Sciences Entrance Exam\n@@@NTR University Entrance Exam\n@@@Rajasthan University Entrance Exam\n@@@Rajasthan Vidyapeeth University Entrance Exam\n@@@Rajiv Gandhi University of Health Sciences Entrance Exam\n@@@Ranchi University Entrance Exam\n@@@Rashtrasant Tukadoji Maharaj Nagpur University Entrance Exam\n@@@Sanjay Gandhi Postgraduate Institute of Medical Sciences Entrance Exam\n@@@Sardar Patel University Entrance Exam\n@@@Sree Chitra Tirunal Institute of Medical Sciences and Technology Entrance Exam\n@@@Sri Ramachandra Medical College & Research Institute Entrance Exam\n@@@Sri Ramachandra University Entrance Exam Entrance Exam\n@@@SRM University Entrance Exam Entrance Exam\n@@@Tamil Nadu Dr. M.G.R. Medical University Entrance Exam\n@@@University of Delhi Entrance Exam\n@@@University of Mumbai Entrance Exam\n@@@University of Pune Entrance Exam\n@@@Utkal University Entrance Exam\n@@@West Bengal University of Health Sciences Entrance Exam','“Successful people don\'t have fewer problems. They have determined that nothing will stop them from going forward.”-Benjamin Carson','image/png',NULL,'image/png',NULL,NULL),(184,'Photographer','9_Photographer.png','/subCategoryImages/184','2020-01-02 22:54:50',0,14,NULL,'Do you have knowledge about different cameras? \nDo you love to take beautiful moments of life with a camera? \nAre you crazy at capturing motion pictures?\n\nThen you can be! Here is the best career which suits to your knowledge and passion. Make your self ready by choosing your passion early as much as possible since a photographer requires a lot of training and practice. Find some employment and train yourself to become a professional. Various firms give the opportunity to fly to different places and also internationally if they are part of an organisation to take pictures of different communities and locations.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A photographer is a professional whose focuses on the art of taking photographs with a digital or film camera. \nPhotographers capture pictures of diverse people, places, communities, and things in a variety of backgrounds. Some of them work in studios, while others explore the natural, outside world. They are skilled at taking pictures or photographs with a camera. Some people hire a photographer for their marriage or other special events. Photographers work in various specialities. They are responsible for the digital, small or heavy editing development of the pictures. The photographs editing process include simple cropping, changing colour schemes, lighting, and adding or removing objects from pictures. Some customers prefer to edit the pictures themselves, while others will expect the photographer to do the necessary photo editing. The photographers may need to work in comfortable studios in a big city or working in the frozen forests of a remote country based on the type of photography they have chosen. \n','8-Photographer.png','/landingImages/184','Becoming a photographer doesn\'t certainly need formal education or an academic degree. Some colleges and universities offering undergraduate, diploma and certificate programs in photography which helps you for becoming a professional photographer. To get into these programs requires years of previous photography experience or training for the admission. Along with your graduation make yourself familiar with the photography techniques and types of photography with the help of experts of photography.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Course in Basic Techniques in Photography\n@@@Certificate Course in Photography\n@@@Certificate in Videography & Editing','Diploma in Fashion and Portrait Photography	\n@@@Diploma in Fashion Photography\n@@@Diploma in Photography\n@@@Diploma in Professional Photography\n@@@Diploma in Still Photography\n@@@Post Graduate Diploma in Photography - PGDP','Bachelor of Science [B.Sc] (Photography)\n@@@B.A. (fine arts)\n@@@B.A (Photography)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“Taking an image, freezing a moment, reveals how rich reality truly is.”-Anonymous','image/png',NULL,'image/png',NULL,NULL),(185,'Political Scientist','1_Political-Scientist.png','/subCategoryImages/185','2020-01-02 22:58:17',0,19,NULL,'Do you stay up to date with the problems and changes in the nation and want to find a solution for it?\nDo you have knowledge of national politics, political theory, international relations, or comparative politics?\nDo you have a belief in the impact of politics on the change of nation?\n \nThen here is the career which suites to your knowledge and passion. Make yourself fit for this role by enhancing your leadership qualities and ideas. Understand the various political scenarios which are required. Political science has a lot to offer, based on your success you will have a chance to improve the country by making decisions that will help the people and have the faith of voters is what will ultimately decide your success in the field. Openings for to a political science major available in federal, state, and regional government.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Political Scientist researches political ideas and analyzes governments, policies, political trends, and related issues.\nA political scientist is responsible for researching, studying, and analysis of political trends, governments, political ideas, and other related issues. Based on the work environment, they will do research in fields like international relations, national politics, political theory, or comparative politics. They have to gather and process data from election results, historical documents or public opinion surveys and also develop theories and test these theories by using statistical analysis or other quantitative methods. They need to estimate the consequences of laws and policies on government, people, and businesses and try to predict social, political, and economic trends and also make reports based on the investigation, publish articles and give presentations.  \n','2-Political-Scientists.png','/landingImages/185','The basic eligibility to start a career as a political scientist is a masters or doctoral degree in political science, public administration, or a closely related subject from a recognised university. To become a political scientist, one must have excellent knowledge of politics and political science. You should mainly focus on an area of interest after these programs are completed, like national politics, political theory, international relations, or comparative politics. \n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Course in Panchayat Raj\n@@@Certificate in Indian Constitution and Panchayati Raj','Diploma in Ministry\n@@@Diploma in Panchayat Raj\n@@@PGD in Indian Political System and Good Governance','B.A. (Political Science)\n@@@B.A. (Politics)\n@@@B.A. (Hons.) Political Science','M.A. (Political Science)\n@@@M.A. (Politics)\n@@@M.A. (Intellectual Property Rights)\n@@@M.A. (International Relations and Political Science)\n@@@M.A. (Local Governance)\n@@@M.A. (Political Science and Public Administration)\n@@@M.A. (Public Policy)\n@@@M.Phil. (International Politics)\n@@@M.Phil. (International Relations and Political Science)\n@@@M.Phil. (Political Science)\n@@@M.Phil. (Politics)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Political Science)\n@@@Ph.D. (Politics)\n@@@Ph.D. (International Politics)',NULL,'“Political science is the study of the authoritative allocation of values for a society.”-David Easton','image/png',NULL,'image/png',NULL,NULL),(186,'Oceanographer','5_Oceanographer.png','/subCategoryImages/186','2020-01-02 23:00:47',0,6,NULL,'Have you ever thought about the underwater species life?\n\nDo you love to study marine life living in the oceans?\n\nAre you interested in conducting the surveys and analyzing the data collected?\n\n               If yes,  then you are just like the pirates of the scientific world, sailing the body of water. Now upgrade ourself by adapting skills about identifying the species of marine and be up-to-date with scientific and analysis developments. The need for the study of several oceans is today in our world that is why the demand for oceanographers is increasing day after day. There is a huge demand for oceanographer in today\'s world.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Oceanographers are a special kind of scientist who studies in detail about the Ocean. They were expert in studying about every aspect of the ocean, like the chemistry of ocean water, the geology connected with the ocean, the physical changes of the ocean water. Oceanographers work involves collecting samples, conducting surveys, analyzing data using different technologies. They are some of the most important climate researchers in the action to decrease the effects of climate change, overpopulation, and overfishing. ','5-Oceanographer.png','/landingImages/186','Generally to enter into this field after completing 12 class from science stream, One can go for a bachelor degree in B.Sc either in Marine Science/Zoology/Botany/Chemistry/Fishery science or closely related field from a recognized institute or university. After completing bachelor\'s one should go for a Masters in Oceanography/Marine biology or closely related field. To become a professional in this field one must go for a PhD in Oceanography or Marine science.',NULL,NULL,NULL,NULL,'Master of Science (M.Sc) in Oceanography\n@@@M.Sc. Marine Science\n@@@M.Tech in Ocean Engineering\n@@@M.Tech in Ocean Technology\n@@@M Sc. Physical Oceanography\n@@@M Sc. Marine Geology\n@@@M Sc. Marine Geophysics\n@@@M.Sc. Meteorology\n@@@M Tech in Meteorology\n@@@M Tech in Ocean Technology\n@@@M.Sc. (Applied Mathematics with Oceanology and Computer Programming)\n@@@M.Sc. (Marine Science)\n@@@M.Sc. (Oceanography and Coastal Area Studies)\n@@@M.Sc. (Oceanography)\n@@@M Phil in Marine Sciences\n@@@M.Phil. (Chemical Oceanography)\n@@@M.Phil in Chemical Oceanography\n@@@M.Sc. (Physical Oceanography)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'PhD in Oceanography',NULL,'“The ocean is a central image. It is the symbolism of a great journey.\"-Enya','image/png',NULL,'image/png',NULL,NULL),(187,'Market Research Analyst','8_Market-Research-Analyst.png','/subCategoryImages/187','2020-01-02 23:02:49',0,5,0,'Have you ever choose your career in marketing?\n\nDo you have an interest in sales and trends? \n\nAre you interested in conducting surveys? \n\n\n               If yes,  consider your career as a market research analyst. To start your career as a market research analyst develop yourself by adopting skills like applying qualitative and quantitative techniques to interpret the data and able to conduct in-depth data analyses using traditional and advanced methods. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Market research analysts are the professionals who study the market conditions to examine potential sales of a service or a product. Market research analyst will collect and analyse the data and information which will help their client to take a social and economic decision. They also help the companies to understand what type of products people want, who will buy them, at what price and how to promote them. The process of collecting and analyzing the data is logical and measured; figuring out why the target audience might be attracted to a particular product. They also conduct and design surveys which will help to discover potential customer’s preferences. Additionally, a market research analyst is responsible for keeping track of client industry trends and general marketing trends.','9-Market-Research-Analyst.png','/landingImages/187','After passing 12 class to enter into this field one can go for a bachelor degree in Marketing or a related field like computer science, mathematics or statistics. One can also go for Masters in Market research, Marketing, Statistics or other related fields after graduation from a recognised institute or university. You can also go for an internship program to gain experience in collecting and analyzing data, writing reports and conducting surveys.','Attain 10+2 or equivalent qualification from a recognized educational Board. ',NULL,NULL,'B.B.A. (Marketing and Finance)\n@@@B.com(Business, Mathematics and Statistics)\n@@@B.Sc(mathematics)','M.B.A. (Marketing Management)\n@@@M.Com. (Marketing)\n@@@M.B.A( Business Analytics)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'AIMA Management Aptitude Test\n@@@Common Admission Test\n@@@Common Management Admission Test\n@@@ICFAI Business School Aptitude Test\n@@@Joint Entrance Management Aptitude Test\n@@@Joint Management Entrance Test','\"The aim of marketing is to know and understand the customer so well, the product or service sells itself.\"-Peter Drucker','image/png',NULL,'image/png',NULL,NULL),(188,'Industrial Designers','7_industrial-designer.png','/subCategoryImages/188','2020-01-02 23:05:53',0,3,0,'Are you really passionate about designing something new?\nDo you love to make designs of different products?\nCan you able to find a flaw in the product and give a solution with your designs?\nThen you are the one! You can choose a career as an industrial designer. Improve your self by learning and adapting different software tools and technology that are used for designing. Be up to date with market trends and interests so that you can design accordingly. The persons with great creativity and problem-solving qualities will go to professional level of this field and will have huge earnings. The rapid growth of product usage is creating a number of employment opportunities.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Industrial Designers will make concepts and designs for the products to be produced in mass production.\n\nIndustrial Designers use art, creativity, engineering, and business for developing and designing various concepts of products to be manufactured that are used by different people every day like electronic gadgets, home appliances, vehicles, toys, furniture, and many more. They will prepare designs in computer by using tools like CAD or in paper and then make test to consider that for the further production process. While designing or developing new products, they should consider the production cost, product durability, functionality, safety, and most importantly elegance of the product. These professionals will be specialized in particular product varieties like medical equipment, electronic products, computers, smartphones, cars, bikes, bicycles, furniture, snowboards, etc., They have to work along with different personalities such as engineers, production experts, and marketing specialists for developing, manufacturing, and marketing of designed products.\n','7 Industrial Design.png','/landingImages/188','The field of industrial design requires at least a bachelor\'s degree in industrial design, architecture, or any related engineering for entry-level jobs. One can opt for postgraduate courses to get into the professional level or to get hired into reputed industries. Gain great command on sketching, drawing, computer-aided design, drafting (CADD), 3D modeling, business, industrial materials, and manufacturing processes which will add value to your CV and you will get hired promptly.',NULL,'Certificate in Automotive Clay Sculpting\n@@@Certificate in Kitchen and Wardrobe Design\n@@@Certificate in Industry, Automotive, Product Design\n@@@Design Viz Pro\n@@@Program in Design Management and Creative Arts\n@@@Certificate in Product Design\n@@@Certified CAD Engineer\n@@@Advanced Certificate in Digital Art\n@@@Product Designing\n@@@Certificate in Creative Pattern Making\n@@@Master Diploma in Automotive Design\n@@@Certificate in Wooden Furniture Design\n@@@Certificate in 3D Architecture Designing\n@@@Certificate in Lathe Machine Operator\n@@@Certificate in Product Development\n@@@Interior Designing Short Term course\n@@@Certificate in Automobile\n@@@Custom Biking\n@@@Certificate in Plastics Product Design and Tooling\n@@@Certification in Staad Pro\n@@@Certification in Product Design and Development\n@@@Industrial Training in Electronic Product Design (EPD)\n@@@Product Designing\n@@@Certificate in Pattern Cutting Master\n@@@Certificate in Apparel Production Supervision and Qu…\n@@@Certificate in Apparel Finisher and Checker\n@@@Certification in Home Appliance Product Design\n@@@AutoCAD 3D in Mechanical\n@@@Certificate in AutoCAD CAM CAD\n@@@Furniture Design\n@@@Certificate in Mechanical Designing\n@@@Certificate in Photoshop\n@@@Certificate in RCC Detailing\n@@@Certificate in Luxury Brand Management\n@@@Furniture Design\n@@@Certificate in Luxury Brand Management\n@@@Certificate in Interior and Lifestyle Business Manager\n@@@CATIA\n@@@Certificate Course in Fundamentals of Industrial Engineering and Management','Advanced Diploma in Industrial Safety (ADIS)\n@@@Advanced Diploma in Mechatronics & Industrial Automation\n@@@Diploma in Industrial & Production Engineering\n@@@Diploma in Industrial Electronics\n@@@Diploma in Industrial Safety Engineering\n@@@Diploma in Railway Engineering\n@@@Post Graduate Diploma in Industrial Safety','Bachelor of Design (Industrial Design)\n@@@B.E. (Industrial & Production Engineering)\n@@@B.E. (Industrial Engineering & Management)\n@@@B.E. (Industrial Engineering)\n@@@B.E. (Industrial Engineering) + M.B.A.\n@@@B.E. (Production & Industrial Engineering)\n@@@B.Tech. (Industrial and Production Engineering)\n@@@B.Tech. (Industrial Engineering and Management)\n@@@B.Tech. (Industrial Engineering)\n@@@B.Tech. (Safety and Fire Engineering)',NULL,'Kalinga Institute of Industrial Technology Entrance Examination (KIITEE)\n@@@JNU EEE - Jawaharlal Nehru University Engineering Entrance Exam\n@@@IIT JEE - IIT Joint Entrance Examination\n@@@Delhi Institute of Technology (DIT) Entrance Exam\n@@@BITSAT-Birla Institute of Technology and Science Examination Entrance Exam\n@@@B.S. Abdur Rahman University Engineering Entrance Examination\n@@@AIEEE - All India Engineering Entrance Examination\n@@@Karunya University Entrance\n@@@KEAM - Kerala Engineering Architecture Medical Entrance Exam\n@@@MP PET - Madhya Pradesh Pre Engineering Test\n@@@PMUET - Periyar Maniammai University Entrance Test\n@@@RPET - Rajasthan Pre Engineering Test\n@@@SRM EEE - SRM Engineering Entrance Exam - B.Tech\n@@@U.P.T.U - Uttar Pradesh Technical University\n@@@Vinayaka Missions University - Engineering Entrance Exam\n@@@VITEEE-Vellore Institute of Technology Engineering Entrance Exam','GATE - Graduate Aptitude Test in Engineering\n@@@KIITEE - Kalinga Institute of Industrial Technology Entrance Exam - M.Tech\n@@@SRM EEE - SRM Engineering Entrance Exam - M.Tech\n@@@TANCET: Tamil Nadu Common Entrance Test\n@@@Vellore Institute of Technology Master’s Entrance Exam (VITMEE)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'NID (National Institute of Design)\n@@@AIEED (All India Entrance Examination for Design)\n@@@CEED (Common Entrance Examination for Design)\n@@@NIFT (National Institute of Fashion Technology)\n@@@MIT Institute of Design Examination\n@@@NEET (National Entrance Examination for Design)\n@@@National Level Entrance Aptitude Test (NET) conducted by the Institute\n@@@NID Entrance Test\n@@@NIFT Bangalore Entrance Exam\n@@@NIFT Entrance Exam\n@@@PEARL\n@@@School of Fashion Technology (SOFT) Entrance Exam\n@@@SRMJEEE (SRM Joint Engineering Entrance Examination).','“Recognizing the need is the primary condition for design.” -Charles Eames','image/png',NULL,'image/png',NULL,NULL),(189,'Floral Designers','4_Floral-Designer.png','/subCategoryImages/189','2020-01-02 23:09:05',0,3,0,'Are you the kind of person who likes to stop and smell the flowers and arrange them in a bouquet?\nCan you able to decorate a place with flowers with a beautiful and attracting look?\nDo you have the ability to maintain and manage plants and flowers?\n\nYes, you can be! You are looking into a career as a floral designer. Get ready for this field by upgrading your creativity with new floral designs, and kind of decorations are made for different occasions. It is a field that does not require a major educational background so that one will get hired and start their career promptly.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Floral designers arrange different flowers and plant materials for various occasions to give a pleasant view.\n\nFloral designers are the persons who make floral and greenery arrangements for decorative presentations with the use of selected flower materials, flowers, containers, ribbons, and other accessories. They will work with plants and flowers to prepare bouquets and decorations based on customer requirements. Their designs will be used in various occasions like weddings, baby showers, funerals, anniversaries, or any official meetings. They should know about the smell, size, and shape of flowers before using them in their design. Some of them will also grow their own flowers and plants. They should select plants and flowers based on their beauty and long-lasting possibility and also aware of plant care and varieties of flowers, herbs, and different decorating grass types.\n','4-Floral-Designer.png','/landingImages/189','There are no special educational requirements needed for entry-level jobs in this field. For the advanced level of this field requires at least a bachelor\'s degree. To get into this, one should get professional training, basic knowledge of different types of flowers and their arrangements using various combinations, and the type of floral decorations used for different occasions like weddings, parties, and many more.\n',NULL,NULL,'Advanced Diploma in Floriculture\n@@@Diploma in Floriculture\n@@@Diploma in Floriculture and Landscape Gardening','B.Sc. (Floriculture and Landscaping)','M.Sc. (Floriculture and Landscaping)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Floriculture and Landscaping)\n','All India Entrance Examination.\n@@@Indian Council for Agricultural Research (ICAR) Entrance Examination.\n@@@Jawaharlal Nehru University Entrance Examination.\n@@@Sam Higginbottom Institute of Agriculture, Technology and Sciences Entrance Examination.\n@@@Punjab Agricultural University Entrance Examination.\n@@@Tamil Nadu Agriculture University (TNAU) Entrance Examination.\n@@@College of Horticulture & Forestry Entrance Examination.\n@@@Jawaharlal Nehru Kristi Vishwa Vidyalaya, Entrance Examination.\n@@@Dr.Yashwant Singh Parmar University of Horticulture and Forestry Entrance Examination.\n@@@Yashwantrao Chavan Maharashtra Open University Entrance Examination.\n@@@University of Agricultural Sciences, Gandhi Krishi Vigyan Kendra Entrance Examination.','“Everything is designed. Few things are designed well.”-Brian Reed','image/png',NULL,'image/png',NULL,NULL),(190,'Financial Analyst','5_Financial-Analyst.png','/subCategoryImages/190','2020-01-02 23:11:19',0,5,0,'Have you ever interested in banking and finance services?\n\nDo you wish to help your companions in making better financial decisions?\n\nAre good at saving your pocket money?\n\n               If yes, here financial Analyst is the best career which suits you more. Now upgrade yourself by gaining your skills in Analyzing the data, knowledge about stocks and national and domestic financial market. Updating the knowledge according to the trends. With the expansion in the financial market in India, there has been tremendous growth in financial jobs. Attractive growth in financial sector attracting youngsters to become a financial analyst. There is no limit for professional growth in financial analysis.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Financial analysts provide clear guidance to the businesses and individuals in making better investment decisions. Financial analysts estimate the performance of stocks, bonds, and different types of investments. They are also called as investment analysts and securities analysts. They carry out the detailed study on various trends, analyse the financial status of the company and subsequently come up with a plan to help them. They work in securities firms, banks, mutual funds, insurance companies, pension funds, and other businesses.','5-Financial-Analyst.png','/landingImages/190','Generally, to enter into this field you required a bachelor degree in finance or any related field as an entry-level. One can also go for postgraduation on MBA in Financial Management or related field from a recognized institute or organization. Which will help you gain knowledge on managing finances. To reach the professional level in this field you should have knowledge in managing the budget of a company or individual, research and Design cost analysis process by establishing and implementing policies and procedures.','Attain 10+2 or equivalent qualification from a recognized educational Board. ','Certificate Course in MicroFinance','Advance Post Graduate Diploma in Finance (APGDF)\n@@@Diploma in Banking & Finance\n@@@Diploma in Finance, Budget, and Accounting (DFBA)\n@@@Diploma in Financial Accounting & Taxation (DFAT)\n@@@Post Graduate Diploma in Finance','B.B.A. (Accounting and Finance)\n@@@B.B.A. (Banking and Finance)\n@@@B.B.A. (Marketing and Finance)\n@@@B.Com. (Accounting and Finance)\n@@@B.Com. (Banking & Finance)\n@@@B.Com. (Hons.) (Accounting and Finance)\n@@@B.Sc. (Banking and Finance)\n@@@Bachelor in Financial Management (BFM)','M.B.A. (Banking and Finance)\n@@@M.Com. (Accounting and Finance)\n@@@M.Com. (Banking & Finance)\n@@@M.Com. (Corporate Finance)\n@@@M.Com. (Finance & Computer Applications)\n@@@M.Com. (Finance and Systems)\n@@@M.Com. (Finance and Taxation)\n@@@M.Com. (Finance)\n@@@M.Com. (Finance, Banking & Risk Management)\n@@@M.Com. (Financial Studies)\n@@@M.Com. (Management Accounting & Financial Strategies)\n@@@M.Sc. (Banking & Finance)\n@@@M.Sc. (Finance and Computer Applications)\n@@@M.Sc. (Financial Mathematics)\n@@@MBA in Islamic Finance',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Banking & Finance)','XAT \n@@@IBSAT \n@@@SNAP \n@@@CMAT\n@@@XAT\n@@@Actuarial Common Entrance Test (ACET)\n@@@Aligarh Muslim University Entrance Exam (AMU Entrance Test)\n@@@Banaras Hindu University Undergraduate Entrance Test (BHU UET)\n@@@Uttar Pradesh State Entrance Examination (UPSEE)\n@@@Banaras Hindu University Post Graduate Entrance Test (BHU PET)\n@@@Christ University Entrance Test\n@@@Jamia Millia Islamia Entrance Examination (JMI Entrance Exam)\n@@@Under Graduate Aptitude Test (UGAT)\n@@@National Test For Programs After Twelfth (NPAT)\n@@@University of Hyderabad Entrance Examination (UoH Entrance Exam)\n@@@Tezpur University Entrance Examination (TUEE)\n@@@Pune University Entrance Exam\n@@@Calcutta University Entrance Exam','“The purpose of financial reporting is to obtain cheap capital.”-Martin S. Fridson','image/png',NULL,'image/png',NULL,NULL),(191,'Cost Accountant','4_Cost-Accountant.png','/subCategoryImages/191','2020-01-02 23:12:13',0,5,NULL,'Do you have the ability to determine the selling price for a product?\nAre you good at accounting and financial management?\nCan you able to use Excel to organize the company’s fixed costs and make sure they are accurate and accessible?\n \nIf yes, then you can build your career as a cost accountant, step forward by gaining knowledge and grip in making different financial reports, study and collect data to define the costs of various business projects. Also, gain skills in computer technology related to accounting. There are plenty of employment openings are accessible to start up your career as a Cost Accountant and it is a stable and growing job field with potential earning as well as professional growth.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A cost accountant defines the actual costs associated with providing a service or manufacturing a product and manages all the costs acquired in order for a corporation to be profitable.\nA cost account is responsible for preparing the actual costs associated with providing a service or manufacturing a product and examining all of the associated expenses within the supply chain. They should prepare profitability analysis, budget preparation, and manage costs in order to benefit the organisation. They are also responsible for collecting, adjusting, auditing, and studying financial information from all areas of an organisation. By managing and analysing cost investments and purchases in the organization, cost accountants review services and goods, record data and give recommendations about cost-efficient and financially feasible cost options for budgeting, cost administration, production evaluation and asset management within a company or organization.\n','4-Cost-Accountant.png','/landingImages/191','To become a certified cost accountant one should complete ICWAI. There are three different stages namely the ICWAI Foundation, ICWAI Intermediate, and ICWAI Final. \nStep 1: ICWAI Foundation course\nFirst of complete 10+2 with commerce background or a related subject. Then, students can be enrolled with the Institute of Cost & Works Accountants of India (ICWAI) and should clear the examination to go for the next level.\nStep 2: ICWAI Intermediate course\nStudents who cleared the foundation course can be applied for this course and students with graduation can directly apply for it.\nStep 3: ICWAI Final course\nStudents who cleared the intermediate course can be applied for this course.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.\n',NULL,NULL,'B.Com.\n@@@BBA\n','M.Com.\n@@@MBA\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“Our greatest weakness lies in giving up. The most certain way to succeed is always to try just one more time.” -Thomas A. Edison','image/png',NULL,'image/png',NULL,NULL),(192,'Chartered Accountant','2_Chartered-Accountant.png','/subCategoryImages/192','2020-01-02 23:14:04',0,5,NULL,'Are you really good at accounting and financial management?\nDo you have deep knowledge in auditing, taxation, financial and management concepts?\nDo you have the ability to advise on tax and treasury issues for a firm?\n \nIf yes, then you can build your career in this field, step forward by gaining knowledge and grip in making different financial reports, securing loans, preparing financial projections, showing how the loans will be repaid, and determining the viability of the firm. You should be thorough with performing audits, handle taxes, help create effective financial plans and solve any finance-related issues. A chartered accountant performs an important role in maintaining the finances and the working of finance and accounting related tasks, so, being a Chartered Accountant is a good opportunity for the growth in the career.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Financial services of companies like auditing, taxation, accounting, financial analysis, risk management and informing on financial structures are done by chartered accountants. \nA Chartered accountant specializes in financial advising, corporate taxes, corporate auditing, or financial management. They are responsible to perform accounting activities for corporations, individual clients, and other financial institutions. They have to make sure that the best return on customers taxes, managing analyses and informing companies on long-term financial planning strategies such as business acquisitions, or performing in-depth audits to ensure accuracy and identify improprieties. A chartered accountant also helps their client\'s or organisation to comply with tax laws and represent before government agencies and also advise people on how to manage their money well. In an organisation, they are responsible for performing audits, handle taxes, help create effective financial plans and solve any finance-related issues and might take the entire financial management role of the company. Chartered Accountants have obtained an essential position in public as well as private sectors.\n','1-Accountants.png','/landingImages/192','First of complete 10+2 with commerce background. The main levels of CA course are CPT (Common Proficiency Test), IPCC (Integrated Professional Competence Course), Articleship, and CA Final Course. \nStep 1: CPT\nStudents with 10+2 can register for entry-level test CPT.  CPT is an all-India level entrance exam which tests students in areas of accounting, laws, general economics and quantitative aptitude. \nGraduates or Post Graduates in Commerce or it’s equivalent from any recognized University are exempted from qualifying CPT and they can directly register to the Intermediate (IPCC) Course, which is the first stage of theoretical education.\nStep 2: IPCC\nAfter finishing first level requirements, one can register for IPCC which has two groups namely group1 and group2. Students can clear both groups at a time or one after other. IPCC is the first stage of theoretical education in CA course. \nStep 3: Articleship\nAfter completing IPCC exams, a student has to complete a three-year articleship. It\'s like an internship before your final exams.\nStep 4: CA Final course\nAfter completing articleship, one can appear for CA final exam which has two groups and can clear both groups at a time or one after other. \nYou are officially called CA after clearing this exam.\nStep 5: Registration\nYou have to register with the ICAI to become a member. To practice CA on your own, you must have a certificate of practice from the ICAI.\n','Attain 10+2 or equivalent qualification from a recognized educational Board@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.\n',NULL,NULL,'B.Com.\n@@@BBA\n','M.Com.\n@@@MBA\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'CPT (Common Proficiency Test)','“Our greatest weakness lies in giving up. The most certain way to succeed is always to try just one more time.” -Thomas A. Edison','image/png',NULL,'image/png',NULL,NULL),(193,'Geophysicist','4_Geophysicist.png','/subCategoryImages/193','2020-01-02 23:19:25',0,6,NULL,'Have you thought about the behaviour and internal structure of the earth?\n\nDo you love to study the internal structure of the earth?\n\nAre you interested in knowing facts about the behaviour of the earth?\n\n               If yes, then you very near to be called as a geophysicist. Now improve your self by adapting knowledge about the physical properties of the earth like gravity, magnetic force and gain skills like measurement equipment, examining natural phenomena such as tidal waves and electromagnetic fields. There is an average job growth for a geophysicist. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A geophysicist is a person who studies the physical properties of Earth-like gravity, magnetic, electrical, and sensual ways. The geophysicist is responsible for collecting the data on seismic waves. They mainly focus on the behaviour and internal structure and evolution of the earth, earthquakes, the ocean and other physical features. Some geophysicists spend most of their time at outdoors finding out numerous options for the earth. Some geophysicists use various ways to examine out oil, iron, copper, and lots of different minerals. Others assist with environmental preservation and protection. Many geophysicists, specialize in seismic activities, develop methods and techniques for earthquake monitoring and prediction.','6-Geophysicist.png','/landingImages/193','To enter into this field after completion of 12 class, one can go for any bachelor degree like physics or other science-related fields from a recognised or university. After completion of the bachelor\'s one should go for masters in Geophysics or related subjects. To become an expert in this field one should complete their PhD in Geophysics or a related field to gain more knowledge about the subject.','Attain 10+2 or equivalent qualification from a recognized educational Board. ',NULL,NULL,NULL,'M.Sc. Applied Geophysics\n@@@M.Sc. Applied Geophysics (Integrated)\n@@@M.Sc. Applied Geophysics (Tech)\n@@@M.Sc. Geophysics\n@@@M.Sc. Geophysics (Tech)\n@@@M.Tech. Applied Geophysics\n@@@M.Tech. Geophysical Technology',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. in Applied Science and Engineering\n@@@Ph.D. Geophysics','BHU PET – Banaras Hindu University Post Graduation Entrance Test\n@@@JEE Advanced – Joint Entrance Exam Advanced\n@@@AUCET – Andhra University Common Entrance Test',NULL,'image/png',NULL,'image/png',NULL,NULL),(194,'Cinematographer','3_Cinematographer.png','/subCategoryImages/194','2020-01-03 01:00:25',0,14,NULL,'Can you view everything as a picture which is trying to convey you a story?\nDo you have photography skills and can able to handle any kind of camera equipment? \n\nDid you find an excellent creator or an artist in Then here is the career which suites to your passion. Make yourself fit for this role by adopting great photography which gives you a strong foundation on cinematography and increases your approach, perception and knowledge towards it. Know about new locations, new scripts, new themes and new imaginations. To develop oneself in this profession, one should keep himself modernised with the current trend. By connecting with people, knowing their opinion, and implementing in your next project, gives you infinite satisfaction and recognition.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A person who manages and directs photography and camerawork in film-making by operating the camera.\nA cinematographer is also known as the director of photography and abbreviated to DP or DOP. A cinematographer is a member of the production team who is responsible for all the visual elements of a film. A cinematographer is a chief who takes care of selecting a camera, camera equipment, film stock, lenses, filters, and light crews working on a film, television production or other live-action pieces. The director coordinates with the cinematographer to get the effects of the scenes visually. They are not only required to shoot motion pictures, but some of them also work for television shows, documentaries, and advertisements as well. They have to cooperate with other motion picture experts throughout the filming of a movie, like a film director, lighting technicians and set designers.\n','2-Cinematographer.png','/landingImages/194','Same as every profession, the cinematography also has its own educational qualifications. The minimum educational requirement is completing either a bachelor\'s degree or a diploma course in cinematography. Some institutions in India offer a graduate and Postgraduate degree in Filmmaking and Cinematography. Many of the people from other backgrounds, like photojournalism and photography, are also becoming as popular cinematographers. ','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'B.A. (Cinematography)@@@BVA in Cinematography@@@B.Voc. in Cinematography@@@B.A. (Hons.) in Photography and Cinematography','MA Cinematography@@@Masters in Cinematography',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“The cinematographer\'s basically translating the director\'s vision into imagery.”-Rachel Morrison','image/png',NULL,'image/png',NULL,NULL),(195,'Actor','1_Actor.png','/subCategoryImages/195','2020-01-03 01:02:46',0,14,1,'Did you express your feelings and thoughts in your face?\nCan you mesmerise and involve the audience with your acting?\nCan you adjust to a broad category of people, conditions and events?\n\nThen you can be! you are the one to become an actor. Gain a proper command on different activities such as martial arts like judo, karate, kendo, etc., weapon use, horse riding, and dance which will provide the opportunity to play the character associated with these activities. Acting is a great way to earn a living and be popular at the same time. Followers will scream your name and you will come on the front page of magazines.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A professional whose profession is to act on the stage, in films, or on television is called an actor.\nActing Professionals are also known as Actors, Artist or performers. An activity or a scene in which a story is told by an actor or actress. They need to adopt a character which will be released in theatre, television, film, radio and many other media after completion of the production process. Their job is to represent the character they are playing and to make involve the audience that character is real by engaging and bringing them into the story. Most of the on-screen characters perform in littler creations, frequently beginning in ads or as additional roles in TV programs or movies. Those who get the lead role are called as Heroes or Heroines. And those who excel in acting got popularity are referred to as Superstars. One also gets to travel to various regions and countries. An actor has to work in different places which depend upon the type of production they are working. Some movies and television shows, ad advertisements will be filmed inside studios, on sets or outdoor shoots. Other film and television shows are filmed on location and might involve a lot of travel sometimes to distant and exotic places.\n','1-actor.png','/landingImages/195','There is no particular qualification is required for this field. Anyways, if a person wants to pursue this subject, the basic eligibility is 10+2. This area of study includes certificate, diploma, bachelors and post-graduate-level courses. Along with your academics, try for some characters by approaching different production houses which will give you the experience to get better opportunities.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Course in Acting@@@Certificate Course in Acting and TV Presentation@@@Certificate Course in Acting Foundation','Advance Diploma in Acting@@@Diploma in Acting@@@Diploma in Acting and Drama@@@Diploma in Direction & Screenwriting@@@Diploma in Dramatic Arts@@@Post Graduate Diploma in Acting@@@Post Graduate Diploma in Dramatics@@@Post Graduate Diploma in Theatre Arts','B.A. (Acting)@@@B.A. (Hons) (Drama)@@@Bachelor of Theatre Arts (B.T.A.)','M.A. (Indian Theatre)@@@M.A. (Theatre)@@@M.F.Tech. (Cinematography)@@@M.F.Tech. (Direction & Screenplay Writing)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Dramatics)@@@Ph.D. (Indian Theatre)','FTII Entrance Exam - Film and Television Institute of India@@@NSD Screening Test','“The best acting is instinctive. It\'s not intellectual, it\'s not mechanical, it\'s instinctive.”-Craig MacDonald','image/png',NULL,'image/png',NULL,NULL),(196,'Dancer','5_dancer.png','/subCategoryImages/196','2020-01-03 01:04:17',0,14,1,'Can you show your thoughts and emotions with your facial expressions?\nDo you think that dance is your best strength? \nAre you flexible enough to make moves and steps?\n\nThen you can be! You are almost suited to become a dancer. Make your self ready by choosing your passion early as much as possible since a dancer requires a lot of training and practice. Find some employment and train yourself to become a professional. Try to make your own steps to go for the next level as a choreographer. Various dance troupes get the opportunity to fly to different places like the U.S. and also internationally if they are part of an organisation or by having a separate group with good fame to give performances. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Dancers represent various steps using the movement of their bodies to express a story or an idea based on the type of dance they are performing. \nDancers perform with the use of movement, motion and body language to represent the character, story, situation or conceptual theory to viewers, generally to the support of music or songs and commit to years of learning, practising and perfecting their dance. Dancers specialize in one particular type of dance such as ballet or jazz. They are expert at performing all kinds of western dances, ranging from tango to tap dances. Some of them are professional in classical dance like Kuchipudi, bharathanatyam, kathak and many more. They wait for future stage productions, artistic productions, television programs, advertisements and movies where dancers are needed. Some people with a dance background can become dance teachers or choreographers.\nThe various dance forms that a dancer can choose are:\nCLASSICAL DANCE FORMS: \nBHARATNATYAM \nKATHAK\nKATHAKALI\nMANIPURI\nKUCHIPUDI\nODISSI\nREGIONAL DANCE FORMS:\nBHANGRA/ GIDDA\nGARBA\nROUF\nGHOOMAR\nCHHAU\nBIHU\nLAVANI\nMOHINIYATTAM\nTHEYYAM\nATTA KARAGAM\nCHOLIYA\nKALBELIA\nDANDIYA\nSAANG\nDUMHAL\nSIRMOUR NATI\n\nWESTERN DANCE FORMS:\nHIP-HOP DANCE\nBREAK DANCING\nBALLET\nSALSA\nTAP DANCING\n','4-dance.png','/landingImages/196','Becoming a dancer doesn\'t certainly need formal education or an academic degree. Some colleges and universities offering undergraduate, graduate and doctoral-level programs in dance which helps you for becoming a professional dancer. To get into these programs requires years of previous dance experience or training for the admission. Along with your graduation make yourself familiar with dance concepts such as rhythm, balance, coordination, and musicality with the help of a choreographer or mentors. Make your self physically fit because flexibility is mandatory for a dancer.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate course in classical dance@@@Certificate in performing arts - Bharatnatyam(CPABN)@@@Certificate in performing arts-kathakali(CPAKK)@@@Certificate in performing arts-Kuchipudi(CPAKP)@@@Certificate in performing arts-Manipuri(CPAMP)@@@Certificate in performing arts-Odissi(CPAOS)',NULL,'B.A.(Dance)@@@B.A.(Hons)(Dance)@@@B.F.A.(Bharatanatyam)','M.A.(Dance)@@@M.A.(Kathak)@@@M.A.(Konkani)@@@M.F.A.(Bharatanatyam)@@@M.P.A.(Hons)@@@M.Phil.(Tabla & Dance)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'D.Litt(Dance) @@@Ph.D.(Dance)','UGC-NET Exam for Dance and Drama/Theatre@@@Lasya College of Music and Dance Entrance Exam@@@Academy Of Music, Dance, Drama and Fine Arts Entrance Exam@@@Banaras Hindu University Entrance Exam@@@Bangalore University Entrance Exam@@@Gujarat University Entrance Exam@@@Nalanda Dance Research Centre Entrance Exam@@@Shivaji University- Faculty of Arts & Faculty of Social Sciences Entrance Exam@@@The Maharaja Sayajirao University Entrance Exam@@@Osmania University Dance Entrance Exam','“Dance is the hidden language of the soul.\"-Martha Graham','image/png',NULL,'image/png',NULL,NULL),(197,'Musician','6_Musician.png','/subCategoryImages/197','2020-01-03 01:05:46',0,14,1,'Did you prepare rhythm for your thoughts and words?\nDo you think that music is your passion?\nCan you mesmerise the audience with your music?\n\nThen you can be! You have the ability to become a Musician. Then grab your passion by getting knowledge of different instruments and different kinds of music. Visit and learn about music studios and labs to get a command on composing music. Research what kind of music is getting popular and received by the audience. As a musician, one can have the opportunity to coordinate with other artists, travel and different experiences while attending an admiring fan base. Professional musicians can earn a good salary, either as solo artists, session players or as part of a group or band.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Musicians express emotions and feelings through harmonic frequencies with a collection of sounds together in a way that people like to find interesting. \nThe musician is a professional who is extremely trained and talented in playing and handling one or more musical instruments. They have to compose, conduct, sing, perform and arrange music in a variety of styles like alternative, blues, rock, classical, jazz, R&B, indie, hip-hop, country, and many more and also prepared for the auditions, attend rehearsals, and learn new pieces of music to extend their collection. The job of a musician varies depending on the genre, circumstances, and goals of the individual and will need to spend more time learning and practising to become known within this music world, or to play in a band with other talented musicians. It also includes persons singing with their voices or playing musical instruments, such as the piano, guitar, drums or violin. They may work as freelance artists or as salaried musicians for orchestras, choirs, theatres or musical bands. Many musicians also teach music to students, either in schools, colleges or universities. ','5-Musician.png','/landingImages/197','There is no particular qualification is required for this field. Anyway, if a candidate wants to pursue this subject, the basic eligibility is 10+2. This area of study includes certificate, diploma, bachelors and post-graduate-level courses. To get into this career one should concentrate on reading sheet music, understanding of common terminology of music, get to know about different musical forms, harmonies and melodies tools, various ways of playing music and how it is conveyed in written form along with the academic learning process.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Courses in Guitar@@@Certificate Courses in Sitar@@@Certificate Courses in Tabla@@@Certificate in Music Therapy','Advanced Diploma in Carnatic Music (Vocal)@@@Diploma in Gandharva Veda-Indian Classical Music@@@Diploma in Hindustani Classical Vocal Musi@@@Diploma in Music@@@Post Graduate Diploma in Instrumentation@@@Post Graduate Diploma in Diploma Music (Vocal)@@@Post Graduate Diploma in Music (Tabla)','B.A. (Hons) (Classical (Vocal) Music)@@@B.A. (Hons) (Gurmat Sangeet)@@@B.A. (Hons) (Instrumental Music)@@@B.A. (Hons) (Music (Hindustani/Karnatak))@@@B.A. (Hons.) Rabindra Sangeet@@@B.A. (Museology)@@@B.A. (Music)@@@B.A. (Rabindra Sangeet)@@@B.A. Hons. (Music)@@@B.P.A. Music (Vocal)@@@Bachelor of Music - Hindustani Classical Instrumental@@@Bachelor of Music in Classical Dance@@@Bachelor of Music in Classical Hindustani Vocal','M.A. (Folk Music)@@@M.A. (Folklore Studies)@@@M.A. (Gurmat Sangeet Gayan)@@@M.A. (Hons.) Music (Instrumental)@@@M.A. (Hons.) Music (Vocal)@@@M.A. (Mridangam)@@@M.A. (Music Instrumental/Vocal)@@@M.A. (Music Vocal)@@@M.A. (Music)@@@M.A. (Musicology)@@@M.A. (Vocal and Instrumental Music (Hindustani & Karnatic))@@@M.A. Music (Instrumental)@@@M.Phil. (Music - Hindustani/Karnatic)@@@M.Phil. (Music - Instrumental)@@@M.Phil. (Music - Vocal)@@@M.Phil. (Music)@@@M.Phil. Music (Vocal & Inst.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'D.Litt. (Folk Music & Art)@@@D.Litt. (Music)@@@Ph.D. (Dance and Music)@@@Ph.D. (Folk Music and Art)@@@Ph.D. (Music)@@@Post Graduate Diploma in Music Instrumental (Tonal)','Bhatkhande Music Institute University Lucknow Entrance Exam@@@Annamalai University Entrance Exam@@@Banaras Hindu University of Performing Arts Entrance Exam@@@Bangalore University Entrance Exam@@@Gandharva Mahavidyalaya Entrance Exam@@@Chennai Government College of Music Entrance Exam@@@Indian Institute of Fine Arts Entrance Exam@@@Mahatma Gandhi University Entrance Exam@@@University Of Kerala – Faculty of Arts Entrance Exam@@@Shri Sankaracharya University of Sanskrit Entrance Exam','“Musicians want to be the loud voice for so many quiet hearts.”-Billy Joel','image/png',NULL,'image/png',NULL,NULL),(198,'Copy Editor','4_Copy-Editors.png','/subCategoryImages/198','2020-01-03 01:06:36',0,14,1,'Are you interested in editing? \nCan you determine necessary and unnecessary content? \nAre you good at grammar and English?\n\nIf yes, then Copy Editing is one of the careers for people with great creating and writing abilities. Make your career as a copy editor by developing yourself with excellent writing, communication and research skills, get good command on multiple languages and also tools related to this role.\nBeing copy editor you get to read and work on writing and subjects that you enjoy. One can have an opportunity to learn a lot and become a better writer from being exposed to so many different kinds of writing. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Copy editors are responsible for reviewing and correcting written content or material to enhance the accuracy, readability, error-free, deletion, lack of consistency and repetition. \nCopy editors view and edit the articles, books and other publications to make sure that there is no error and can be readable. They are responsible for correcting grammar, punctuation, spelling, clarity, style and readability of every sentence. They need to do the changes and corrections when necessary. Copywriters also add headers, headlines, footnotes and photo captions. They need to check permission for copyright material, assuring there will be no legal conflict. They have to send the text to a proofreader for final checking once the copy-editing process has been completed. \n','3-Copy-Editors.png','/landingImages/198','There is no particular qualification is required for this field. The employers usually prefer a bachelor\'s in journalism, communications or English. Employers mostly prefer experience with other types of media like television, newspapers or social media. Excellent grammar, writing skills and mainly knowledge of tools used for this position plays a major role to reach a professional level.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,NULL,'B.A.@@@B.Sc.@@@B.Com.','M.A.@@@M.Sc.@@@M.Com.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“Copy editors are very important and too rarely praised.”-Jane Lindskold','image/png',NULL,'image/png',NULL,NULL),(199,'Statistician','3_Statistician.png','/subCategoryImages/199','2020-01-03 17:33:02',0,13,NULL,'Do you love to deal with statistical computations, terms, and formulas?\nDo you have a stronghold on calculus, statistics and probability concepts?\nCan you able to deal with huge amounts of data?\n\nIf yes, then statistician is one of the most popular careers among those who have a knack for numbers, statistics, and data.  If you are considering becoming a statistician, you have to encourage yourself to engage in extracurricular activities which will give you an opportunity to work as part of a team in a project. If you major in statistics you have proven that you can undergo working with huge data and have the necessary capabilities to undertake such data handling. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A statistician uses theoretical and applied statistical techniques to analyze and interpret data and draw conclusions.\nA statistician design, conduct experiments and surveys to deal with the initial collection of data. They use sampling to gather data from some people in a particular group and determine the type and size of the sample to be surveyed. Statisticians develop survey questionnaires and reporting forms for required data gathering. Statisticians analyze, calculate averages, reliability, and other specifics for the collected data by using computers with specialized statistical software to analyze data and prepare reports in the form of tables, charts, and graphs to explain their findings and the data’s limitations. \n','3-Statistician.png','/landingImages/199','Formal education is definitely required to attain a position as a statistician.  First of all, Complete 10th and 10+2 and then one can earn a bachelor’s degree in statistics or a closely related subject.  You can get entry-level jobs with a bachelor\'s degree but for a position as statistician requires masters and doctoral level study in statistics. After completion of academics, one can go for research and surveying position as a statistician.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate in Statistical Methods and Applications@@@Certificate Course in Financial Statistics','PG Diploma In Statistics@@@Post Graduate Diploma in Applied Statistics','B.Sc. Statistics@@@B.Sc. (Hons) Statistics@@@B.Sc. Applied Statistics@@@B.A. (Statistics)@@@B.A. (Hons.) Statistics','M.Sc. Statistics@@@M.Sc. (Hons) Statistics@@@M.Sc. Applied Statistics@@@M.A. (Statistics)@@@M.A. Statistics (Actuarial)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'M.Phil. (Statistics)@@@Ph.D. Statistics','Agra University Entrance Exam\n@@@Aligarh Muslim University: Department of Statistics and Operations Research Entrance Exam\n@@@Amrita University Entrance Exam\n@@@Andhra University  Entrance Exam\n@@@Annamalai University  Entrance Exam\n@@@Banaras Hindu University Entrance Exam\n@@@Banasthali Vidyapith Entrance Exam\n@@@Bangalore University Entrance Exam\n@@@Barkatullah University  Entrance Exam\n@@@Bharathiar University Entrance Exam\n@@@Bhartiya Vidyapeeth Entrance Exam\n@@@Devi Ahilya Vishwavidyalaya: School of Statistics Entrance Exam\n@@@Dr. BR Ambedkar Marathwada University Entrance Exam\n@@@Gandhigram Rural Institute University Entrance Exam\n@@@Gauhati University Entrance Exam\n@@@Himachal Pradesh University Entrance Exam\n@@@Indian Institute of Technology – Joint Entrance Exam (IIT EE)\n@@@Indian Statistical Institute Entrance Exam\n@@@Kalinga Institute of Industrial Technology Entrance Examination (KIITEE)\n@@@Karunya University Entrance Exam\n@@@Kurukshetra University Entrance Exam\n@@@Madurai Kamaraj University Entrance Exam\n@@@Maharaja Ganga Singh University Entrance Exam\n@@@Maharshi Dayanand University Entrance Exam\n@@@Mahatma Gandhi University Entrance Exam\n@@@Mohanlal Sukhadia University Entrance Exam\n@@@Narsee Monjee Institute of Management and Higher Studies (NMIMS) Entrance Exam\n@@@North-Eastern Hill University (NEHU) Entrance Exam\n@@@North Gujarat University Entrance Exam\n@@@Osmania University Entrance Exam\n@@@Pondicherry University Entrance Exam\n@@@Punjab University Entrance Exam\n@@@Punjabi University Entrance Exam\n@@@Sambalpur University Entrance Exam\n@@@Sardar Patel University Entrance Exam\n@@@Saurashtra University Entrance Exam\n@@@Serampore University Entrance Exam\n@@@Shivaji University Entrance Exam\n@@@South Gujarat University Entrance Exam\n@@@University of Allahabad Entrance Exam\n@@@University of Calcutta Entrance Exam\n@@@University of Calicut Entrance Exam\n@@@University of Delhi Entrance Exam\n@@@University of Hyderabad PhD Statistics Entrance Exam\n@@@University of Kerala Entrance Exam Entrance Exam\n@@@University of Madras Entrance Exam\n@@@University of Mysore Entrance Exam\n@@@University of Pune Entrance Exam\n@@@University of Rajasthan Entrance Exam\n@@@Vinayaka Missions University Entrance Exam','“There are two kinds of statistics, the kind you look up and the kind you make up.”-Rex Todhunter Stout','image/png',NULL,'image/png',NULL,NULL),(200,'Mathematician','2_Mathematician.png','/subCategoryImages/200','2020-01-03 17:46:34',0,13,NULL,'Do you love to deal with mathematical computations, terms, and formulas?\nDo you have the anxiety to develop new mathematical theories and formulae?\nAre you crazy about \n\nThen, what are you waiting for? Here is the profession which suits you more. If you are considering becoming a mathematician, you have to encourage yourself to learn new mathematical scientific thoughts, ideas, and standards in areas like geometry, polynomial math and many more concepts. If you have a major in mathematics you have proven that you can undergo complex problem solving and have the requisite capabilities to undertake such problem-solving in multiple settings. A mathematician’s versatility is a huge asset and may lead to potential work in business, academia, engineering and technology.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A Mathematician is an expert in mathematics who conduct research to understand and develop mathematical principles.\nA mathematician is a professional who uses extensive knowledge of mathematics to solve mathematical problems. Responsibilities of a mathematician vary depending on their field of work. They usually develop new mathematical theories, concepts, and rules in areas like geometry and algebra and use these theories to solve problems in the sciences, business, and engineering fields. They use numerical models and formulas to prove or disprove theories, examine data by improving mathematical models, and interpret data to report conclusions drawn from their summary. They use data analysis to maintain and enhance business decisions, work for business, the sciences, government, and engineering and conduct research to develop mathematical principles and also help to solve real-world problems by interpreting data and applying mathematical techniques. Some times they need to work along with chemists, industrial designers, or chemical engineers.\n','1-Mathematicians.png','/landingImages/200','Formal education is definitely required to attain a position as a mathematician.  First of all, Complete 10th and 10+2 and then one can earn a bachelor’s degree in mathematics or a closely related subject.  You can get entry-level jobs with a bachelor\'s degree but for a position as mathematician requires masters and doctoral level study in mathematics. After completion of academics, one can go for a teaching position as a professor and with the years of experience, you can go for a research position as a mathematician.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Course in Vedic Mathematics','Post Graduate Diploma in Mathematics (Correspondence/ Distance Education)@@@Post Graduate Diploma in Mathematics','B.Sc. Mathematics@@@B.Sc. Mathematics (Hons)@@@B.Sc. Applied mathematics@@@B.Sc. Mathematical Science@@@B.Com (Mathematics)@@@B.A. Mathematics@@@B.A. (Hons) Mathematics@@@B.Sc. Mathematics (Computer Applications)@@@B.Tech. Mathematics and Computing@@@B.Ed. Mathematics','M.Sc. Mathematics@@@M.Sc. Mathematics (Hons)@@@M.Sc. (Financial Mathematics)@@@M.Sc. Applied Mathematics@@@M.Sc. Applied Mathematics And Computing@@@M.Sc. Industrial Mathematics@@@M.Tech. Applied and Computational Mathematics@@@M.Tech. Mathematics and Computing@@@M.A. Mathematics (Hons)@@@M.A. Mathematics@@@M.Ed. Mathematics',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'M.Phil. Mathematics@@@Ph.D. in Mathematics@@@M.Phil. Applied Mathematics@@@Ph.D. in Applied Mathematics@@@M.Phil. Mathematical Science@@@M.Ed. mathematics','IITJEE: Indian Institute of Technology Joint Entrance Exams\n@@@JAM: Joint Admission Test to M.Sc\n@@@GATE: Graduate Aptitude Test in Engineering\n@@@CUSAT: Cochin University of Science and Technology Entrance Exam\n@@@The University of Hyderabad, M.Sc in Mathematics Entrance Exam\n@@@Tamil Nadu Common Entrance Test (TANCET)\n@@@Calicut University Entrance Exam\n@@@Acharya Nagarjuna University M.Sc Mathemati