test-growing industries across the world.\nAir hostess is considered as glamour as any profession of the fashion world. This profession is the dream career for many youngsters to fly in the sky throughout the world.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Air hostess is a member of aircrew they mainly ensure the safety and comfort of passengers. Air hostess is also called as a flight attendant. Air hostess are experts who are mainly responsible for making sure safety regulations are followed by the passengers. They instruct passengers in the use of equipment like seatbelts and oxygen masks. They train to help passengers evacuate in the event of an emergency landing. Air hostess coordinate with the pilot and Convey the message from pilot to the passengers at the time of turbulence.','1-Air-Hostess.png','/landingImages/201','To become an Air hostess, the entry-level is 10+2 qualification from any stream. One can also go for a bachelor degree in Aviation or related field from a recognized institute. The basic eligibility to perceive this career is at least 17+ age, physical fitness, perfect health, eyesight, Ability to speak Hindi, English and other foreign languages. You can also go for certificate and diploma courses to enter into this field.',NULL,'Certificate Course Private Pilot Training\n@@@Certificate Courses in Personality Development\n@@@Certificate Course in Air Hostess/Flight Purser\n@@@Certificate Course in Aviation and Hospitality Services\n@@@Certificate Course in Aviation Hospitality & Travel Management\n@@@Certificate Course in Aviation Management\n@@@Certificate Course in Hospitality Travel and Customer Service\n@@@Certificate Course in International Airlines and Travel Management','Diploma in Professional Cabin Crew Services\n@@@Diploma in Professional Ground Staff Services\n@@@Diploma in Airlines Management Services\n@@@Diploma in Airlines and Travel Management\n@@@Diploma in Hospitality, Travel and Customer Service\n@@@Diploma in Airport Ground 