 process behind the practical methods for improving food quality and quantity. Production of food is in demand all over the world especially in countries like China, India, Brazil, the US, and the EU. The professional of this field will have a chance to become a part of something that is global and get to work every day with something you\'re passionate about.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Agricultural scientists are responsible for the formulation and implementation of scientific methods to get a good result in agricultural productivity.\nThe persons who study the broad several fields of biology which includes parts of exact, natural, economic and social sciences for practice and understanding of agricultural are called Agricultural Scientists. They use their study for the evaluation of agricultural productivity which plays a very important role in developing and maintaining safety standards for food production and production of better crops in terms of quantity and quality. Their job also involves gathering and analysis of fertilizers and soil samples and responsible for finding new methods to produce agricultural products in low-cost ways by researching and experimenting with different plant and plant yields, plant nutrition, and farm management. \n','1-Agricultural-Scientist.png','/landingImages/202','This field generally requires at least a bachelor\'s degree for the private sector and a graduate degree for most jobs at universities and research firms. A student can proceed further in this field by completing his bachelor from Agricultural Science, Agronomy, Horticulture, Plant Breeding, and Animal Science. In graduate programs, they usually focus on an area of specialization. During their study, the student will gain knowledge about cultivation, resource management, land profiling, climatology, atmosphere, and soil management. Agricultural Scientists require a study set of research and must be careful before putting the research into practice. Hence, it’s important to spend equal time in the classroom and laboratory. Then the student can acquire the essence of field experience. Unlike any other courses offered, Agricultural students are encouraged to participate in projects. ',NULL,'Certificate course in Bio-fertilizer Production.\n@@@Certificate course in commercial flower production.\n@@@Certificate course in GIS & Remote sensing Application(CGRS)\n@@@Certificate course in home Gardening(CCHG)\n@@@Certificate course in Home-Scale Preservation of Fruits and Vegetables\n@@@Certificate course in medicinal and Aromatic Plants(CMAP)\n@@@Certificate course in Mushroom Production\n@@@Certificate course in Mushroom spam Production and cultivation\n@@@Certificate course in Organic Farming(COF)\n@@@Certificate course in Raising of House Plant\n@@@Certificate course in sericulture(CIS)\n@@@Certificate course in vegetable production\n@@@Certificate course in the agricultural insurance\n@@@Certificate course in agricultural science\n@@@Certificate course in Beekeeping(CBK)\n@@@Certificate course in Farm Management\n@@@Certificate course in Food Safety(CFS)\n@@@Certificate course in Fruits and vegetable processing technology\n@@@Post Graduate certificate in agriculture policy','Diploma in Agriculture@@@Post Graduate Diploma in GIS and Remote Sensing\n@@@Post Graduate Diploma in Plantation Management\n@@@Post Graduate Diploma in Post Harvest Technology\n@@@Post Graduate Diploma in Regulations in Agricultural biotechnology\n@@@Post Graduate Diploma in pulp & Paper Technology\n@@@Post masters diploma Natural Resource management','B.Sc Agriculture\n@@@B.SC.(Soil Science)\n@@@B.SC.(Agricultural Biotechnology)\n@@@B.SC.(Soil Science & Water Management)\n@@@B.SC.(Vegetable Science)\n','Post Graduate Diploma in GIS and Remote Sensing\n@@@Post Graduate Diploma in Plantation Management\n@@@Post Graduate Diploma in Post Harvest Technology\n@@@Post Graduate Diploma in Regulations in Agricultural biotechnology\n@@@Post Graduate Diploma in pulp & Paper Technology\n@@@Post masters diploma Natural Resource management@@@M.Sc.(Agricultural Science)\n@@@M.SC.(Soil Science)\n@@@M.SC.(Agriculture)\n@@@M.Sc.(Agricultural Biotechnology)\n@@@M.Sc.(Agriculture chemistry & soil science)\n@@@M.Sc.(Hons) (Agriculture)\n@@@M.Sc.(Seed Science & Technology)\n@@@M.Sc.(Soil & Water conservation)\n@@@M.Sc.(Soil  conservation & Water Management)\n@@@M.SC.(Soil Science &  Agricultural chemistry)\n@@@M.SC.(Soil Science & Water Management)\n@@@M.SC.(Soil Science)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D(Agriculture)\n@@@Ph.D(Plant Biotechnology)\n@@@Ph.D(soil science & agriculture chemistry)\n@@@Ph.D(Vegetable Science)','Engineering Agriculture and Medicine Common Entrance Test (EAMCET)\n@@@Indian Council of Agricultural Research Entrance Exam (ICAR)\n@@@JNU M.Sc. (Agriculture) Biotech Entrance Exam\n@@@Kerala Engineering Agricultural and Medical (KEAM) Entrance Test\n@@@NAARM Entrance test\n@@@All India Agriculture Entrance Exams (AIAEE)\n@@@AGRICET\n@@@CG Pre agriculture test(PAT)\n@@@GB pant University Admission (GBPUAT)\n@@@Indira Gandhi Agricultural University (IGKV) CET\n@@@MCAER Common Entrance Test\n@@@MP Pre Agriculture Test (PAT)\n@@@Orissa University of Agriculture and Technology (OUAT)\n@@@Punjab Agricultural University (PAU) Entrance Exam\n@@@Rajasthan Joint Entrance Test (JET)\n@@@UAS,UHS,UAHS PG Common Admission \n@@@Uttar Pradesh Combined Agricultural and Technology Entrance Test (UPCATET)','“Agriculture was the first occupation of man, and as it embraces the whole earth, it is the foundation of all other industries.-Edward W. Stewart','image/png',NULL,'image/png',NULL,NULL),(203,'Event Manager','1_Event-Manager.png','/subCategoryImages/203','2020-01-03 19:58:42',0,12,1,'Do you have the ability to maintain a team?\nAre you good at implementing your ideas? \nDo you like becoming the party leader and manage your party events?\n \n    	Oh! Then you’re an Event Manager. Get ready to know how to organize events for a larger scale. Reach your destination by getting good command on researching venues, distributors and contractors, negotiating costs and managing a team. Stay forward of the competition by understanding the most advanced trends, latest advancements and designs which you can include in your events. It has the potential to be one of the most fulfilling and delightful of all creative enterprises. Producing the several remarkable thoughts to life and delighting delegates/attendees adds up to the kind of job satisfaction you simply cannot put a price on.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Managing and organizing any cultural or social events by responsible planning, promoting, and marketing are Event Managers.\nIn order for an event to be successful, there are a lot of things involved, like lights, music, decorations, stage, and many more. These things should be clearly organized and conveyed in the correct motion like directing a movie, before a live audience within a certain amount of time frame. Making these things come to life by proper execution and coordination with others is the role of an Event Manager.  As an Event Manager, you will be responsible for the complete end to end of the event. That includes budget allocations, scheduling, site selection, acquiring necessary permits, coordinating transportation, the arrangement of entertainers, taking care of security, collaborating with vendors, and catering. Each event is unique and so are the requirements. The key role of an event manager is to convey the message of the event to the audience without any issues and loss of information.\n','1-Event-Manager.png','/landingImages/203','To be an Event Manager one requires graduation in the Event Management. Today, one can be an Event Manager from any background of education. The basic thing to learn as an Event Manager requires a standard of creative and organizing skills. During your education journey, you must focus on developing quick responses to enhance your dealing skills. An Event Manager should know what is correct and wrong while picking the vendor. They mustn’t directly give into the current trends, instead must understand the audience and give the output based on the right research. Event Manager has a lot of things on their shoulders and must manage to make the event worthwhile. Hence, it’s important to clearly delegate people accordingly to get the work done.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Course in Event Management','Advanced Diploma in Event Management@@@Diploma in Event Management@@@Diploma in Event Management and PR@@@Post Graduate Diploma in Advertising & Event Management@@@Post Graduate Diploma in Advertising, Media and Event Management@@@Post Graduate Diploma in Event Management@@@Post Graduate Diploma in Event Management & Public Relations@@@Post Graduate Diploma in Event Management and Activation','BBA in Event Management@@@Bachelor of Business Administration@@@BBA in Hospitality and Event Management@@@BBA in Event Management and PR@@@Bachelors in Event Management (BEM)','M.A. (PR and Event Management)@@@M.B.A. (Event Management)@@@Master of Event Management',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'CAT @@@MAT@@@XAT@@@CMAT@@@SNAP@@@NMAT','\"Some people look for a beautiful place. Others make a place beautiful.” -Hazrat Inavat Khan','image/png',NULL,'image/png',NULL,NULL),(204,'Hospitality Manager','3_Hospitality-Manager.png','/subCategoryImages/204','2020-01-03 19:59:48',0,12,1,'Do you have excellent communication and listening skills?\nAre you good at managing different works simultaneously?\nDo you like to coordinate and supervise?\n\nWhat you’re looking at now is becoming a Hospitality Manager. As a Hospitality Manager, you will be responsible for coordinating the staff of a sector to provide a great experience to the clients. Your communication plays an important role, and it’s necessary to keep your emotions in check, as there will be customers who get angry and are quickly dissatisfied. Now, learn the regulations and procedures on how the organizations work, enhance your skills, and become a Hospitality Manager. Hospitality Managers have a great life and are the core of an organization that is solely responsible for the development. As you move forward in your career, a Hospitality Manager will be the next to become the Chief Executive Officer of that sector.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Managing the A-Z points of sectors such as hotels, resorts, cruise ships, and other hospitality services are called as a hospitality manager.\nA Hospitality manager, as the root word, means that attending and taking care of the guests\' needs. A Hospitality Manager is required in the service industry sector, primarily with hotels, and their roles include servicing and satisfying guests. Also, they are responsible for product purchases, upkeep of financial, administrative records, and developing the industry that they\'re involved in. Their everyday operations are overseeing personnel to ensure that the facilities are properly maintained. Taking care of lodging and checking the quality of hygiene. Making sure the food is delicious and ensuring if safety norms are followed. And coordinating with different departments of the establishment to make sure that the establishments are in line with the profits. Hospitality Manager\'s central role is that they should organize and supervise the staff members accordingly to ensure the highest quality outcome. \n','2-Hospitality-Management.png','/landingImages/204','To become a Hospitality Manager, one must complete their graduation in Hospitality Management. After graduation, you will be starting your career in one of the entry-level positions and rise to be a manager. During the educational journey, it’s necessary to make connections and develop a good network. Focus on improving your communication because you would be directly interacting with guests from a wide range of backgrounds. Also, understand how to keep your emotions under control. A Hospitality Manager, have different streams of narrowing down the level of interest, you can become a “Lodging Manager, Accommodation Manager, Hotel Manager, Catering Manager, Public House Manager, and any other manager” suitably required for the establishment.',NULL,NULL,'Advanced Diploma in Hospitality Management@@@Diploma Course in Housekeeping@@@Diploma in Cabin Crew and Hospitality Management@@@Post Graduate Diploma in Airline Ticketing and Hospitality Management@@@Post Graduate Diploma in Hospital Management (PGDHM)@@@Post Graduate Diploma in Tourism and Hospitality Management@@@Diploma in Hospitality Management','B.A. (Hons.) (Hospitality Management)@@@B.A. (Hospitality Management)@@@B.B.A. (Hons.) (Hospitality Management)@@@B.B.A. (Hospitality & Tourism)@@@B.H.H.M (Bachelor of Hotel and Hospitality Management)@@@B.Sc. (Airlines, Tourism and Hospitality Management)@@@B.Sc. (Hospitality and Catering Management)@@@B.Sc. (Hospitality Studies)@@@B.Sc. (Institutional Housekeeping )@@@Bachelor in International Hospitality Business Management@@@Bachelor of Hospitality and Tourism Management (BHTM)@@@Bachelor of Hospitality Management - B.H.M.@@@B.A. Hospitality and Tourism Management@@@B.Sc. Hospitality and Hotel Management@@@B.Sc. Hospitality and Tourism Studies@@@B.Sc Hospitality Studies@@@B.Sc. Hospitality Management@@@B.Sc. Hospitality Studies and Catering Services@@@B.Sc Airlines, Tourism and Hospitality Management@@@Bachelor of Hospitality Management@@@Bachelor of Tourism and Hospitality Management','M.B.A. (Hospitality Management)@@@M.B.A. (Cruise Ship Hospitality Management)@@@M.B.A. (Health Service Management)@@@M.B.A. (Hospitality)@@@M.B.A. (Tourism and Hospitality Management)@@@M.H.M.@@@M.Sc. (Airlines, Tourism & Hospitality Management)@@@Master of Hospitality and Tourism Management@@@M.Sc. Hospitality Administration@@@M.Sc. Tourism and Hospitality Management@@@Master of Hospitality Management (MHM)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. Hospitality Course','UPES MET@@@CAT@@@CMAT@@@XAT@@@NMAT@@@GMAT@@@MAT@@@All India Hotel Management Entrance Test (HIHT)@@@Bharati Vidyapeeth University HM Test@@@Directorate of Technical Education Hotel Management and Catering Technology Entrance Exam DTE HMCT@@@Indian Institute of Hotel Management IIHM ENTRANCE EXAM@@@Indian Institute of Tourism and Travel Management IITTM Admission Test@@@MAH-HM-CET Maharashtra Hotel Management Common Entrance Test@@@National Council for Hotel Management all India Joint Entrance Examination NCHMCT JEE@@@NCHMCT JEE 2011 Joint Entrance Exam for Hotel Management Admissions@@@Under Graduate Aptitude Test (UGAT)','“Courteous treatment will make a customer a walking advertisement.”-James Cash Penny','image/png',NULL,'image/png',NULL,NULL),(205,'Cyber Lawyer','4_Cyber-Law.png','/subCategoryImages/205','2020-01-03 20:01:07',0,11,1,'Are you able to communicate your thoughts clearly through communication with someone or a group of people?\nDo you have knowledge of different cyber offences?\nCan you able to analyse and handle cyber issues arisen on the internet?\n\nIf yes then move your step towards a path of becoming a cyber lawyer. Make you fit into this field by adopting different logics, techniques and rules which are related to this position. Be smart in logical reasoning and thinking. Get suggestions from the professors and superior lawyers to get practical knowledge. The law profession is the large source of motivation, opportunity and individual success. Today, digital law is one of the freshest and best vocations in law. There are many vocation openings in the field of Law. This has risen as one of the requesting profession fields in the ongoing occasions. Digital law understudies are extraordinarily popular and attractive pay.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A cyber lawyer specialized in the practice of the Information technology law which deals with the Internet, cyberspace, and their respective legal issues.\nA cyber lawyer is also called an Information Technology Lawyer who deals with legal problems associated with internet offences, communication technology, technological & electronic elements such as hardware, software, computer & information systems. They have to handle cases of cyber crimes against persons, property and government. These lawyers will be hired by different private firms as well as government firms to handle and take suggestions related to digital usage and services. Some of them can be self-employed or work with some law agencies. \n','7-Cyber-Law.png','/landingImages/205','This is an occupation where skills and knowledge plays a major role. In order to become a cyber lawyer, one should go for LLB at the undergraduate level and then specializes in cyber law by completing graduation. To become successful in this profession, it\'s essential to have practical knowledge of applying the law in real life. They should be ready to handle any kind of situations and issues that can happen at any stage. Proper experience and training will make you successful in this profession.','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Course in Cyber Law@@@Post Graduate Certificate in Cyber Law (PGCCL)','Diploma in Cyber Law@@@Diploma in Cyber Laws and Information Technology@@@Post Graduate Diploma in Cyber Law@@@Post Graduate Diploma in Cyber Law & Ethics (PGDCE)@@@Post Graduate Diploma in Cyber Law and Information Security (PGDCIS)@@@Post Gra