tivation, opportunity and individual success.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A criminal lawyer specialized in the practice of criminal law.\nA criminal lawyer is also known as a criminal defence lawyer. They are specialized in the defence of people and firms charged with criminal activities. Some of these lawyers are employed privately or in private firms, while others are employed by the various authorities with criminal courts like local, state or federal courts. They are responsible for support and defend their client who is assumed of committing a crime. Once they meet the client, they need to get maximum details about the case by using tricky questioning. Criminal lawyers are to perform tasks such as researching, analysing, estimating, investigating, collecting proper and valuable evidence, submitting their findings and arguing in court to save the client without any personal bias. \n','2-Criminal-Law.png','/landingImages/207','This is an occupation where skills and knowledge plays a major role. In order to become a criminal lawyer, one should go for LLB (Bachelor of Legislative Law) at the undergraduate level and then specializes in Criminal law by completing graduation. To become successful in this profession, it\'s essential to have practical knowledge of applying the law in real life. They should be ready to handle any kind of situations and issues that can happen at any stage. Proper experience and training will make you successful in this profession. ','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.',NULL,'Diploma in Criminal Law (D.Crin)@@@Diploma in Criminology and Penology','Bachelor of Laws [L.L.B.] ','L.L.M. (Criminal Law)@@@L.L.M. (Crimes and Torts)@@@L.L.M. (Criminal Law and Commercial Law)@@@L.L.M. (Criminal Law and Criminology)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Interdisciplinary)@@@Ph.D. (International Legal Studies)','AIBE - All India Bar Exam\n@@@AILET - All India Law Entrance Test\n@@@APLAWCET - Andhra Pradesh Common Law Entrance Test\n@@@AIL LET - Army Institute of Law-Law Entrance Test\n@@@BHU BLAT - Banaras Hindu University B.A.LL.B.(Hons) Admission Test\n@@@BHU UET for LLB - BHU LLB Entrance Exam\n@@@CU BA LLB Entrance Exam - Calcutta University BA LLB Entrance Exam\n@@@CU LLM Entrance Exam - Calcutta University Master of Legislative Law Entrance Exam\n@@@Kerala 3 Years LLB Entran - Commissionerate of Entrance Examinations Kerala 3 Years LLB Entrance Exam\n@@@CLAT - Common Law Admission Test\n@@@DU LLB Entrance Exam - Delhi University LLB Entrance Exam\n@@@GU LSAT - Galgotias University Law School Aptitude Test for LLB\n@@@KLEE - Government of Kerala Law Entrance Exam\n@@@HPNET - Himachal Pradesh National Entrance Test\n@@@ITLA - ICFAI Test for Law Admissions\n@@@IIT Kharagpur RAT - Indian Institute of Technology Kharagpur Research Aptitude Test\n@@@ILI CAT - Indian Law Institute Common Admission Test\n@@@IPU CET Law Entrance Exam - Indraprastha University Common Entrance Exam for Law\n@@@IPU CET LLM - Indraprastha University Common Entrance Test for LLM\n@@@KIITEE Law - Kalinga Institute of Industrial Technology Entrance Exam for Law\n@@@KSLU LLM Entrance Exam - Karnataka State Law University LLM Entrance Exam\n@@@Kerala LLM Exam - Kerala LLM Entrance Exam\n@@@LSAT - Law School Admission Test\n@@@MAH Law CET - Maharashtra Law Common Entrance Test (5 yrs)\n@@@MAH LLB 3 Yrs CET - Maharashtra LLB 3 Years Common Entrance Test\n@@@MUCLET Exam - Mumbai University Common Law Entrance Test\n@@@MU LLM Entrance Exam - Mumbai University Master of Law Entrance Exam\n@@@NLUO Admission Test - National Law University Orissa Admission Test\n@@@PU B.A/BCom LL.B Entrance - Panjab University B.A/B.Com LL.B (Hons) Entrance Exam\n@@@PU LLB Entrance Exam - Panjab University LLB Entrance Exam\n@@@Patna University BLET - Patna University Bachelor of Law Entrance Exam\n@@@RULET - Rajasthan University Law Entrance Test\n@@@SLAT - Symbiosis Law Admission Test\n@@@SLS AIAT - Symbiosis Law School All India Admission Test\n@@@TSLAWCET - Telangana Common Law Entrance Test\n@@@TSPGLCET - Telangana State Post Graduate Law Common Entrance Test\n@@@ULIS (PU) LLB Entrance - University Institute of Legal Studies (Panjab University) LLB Entrance Exam\n@@@MU B.A/B.Com LL.B Exam - University of Mysore B.A/B.Com. LL.B Entrance Exam\n@@@ULSAT/UPES LSAT - UPES Legal Studies Aptitude Test\n@@@UTU CLAT Exam - Uttarakhand Technical University Common Law Entrance Test','\"People are more afraid of the laws of Man than of God because their punishment seems to be nearest.\"-WILLIAM PENN','image/png',NULL,'image/png',NULL,NULL),(208,'Web Developer','16_Web-Developer.png','/subCategoryImages/208','2020-01-03 20:03:48',0,8,1,'Are you crazy about knowing how apps are accessible to our computer? \nAre you interested in computer coding and programming languages? \nDo you have a strong command of new technologies and programming \n\nIf yes, then Web Developer is one of the most popular careers among those who have a strong command on coding languages and excellent technical knowledge.  If you are considering becoming a Web Developer, you have to encourage yourself to engage in the practical approach of various computer languages along with your academics. This will make you hire by employers as quickly as possible. The demand for web applications is expanding and technology is becoming more advanced which is creating abundant job opportunities in small, medium and large-sized firms and also providing jobs on a freelance basis.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A Web Developer is a programmer who specializes in designing, programming, and testing world wide web applications.\nA web developer is responsible for programming the code that determines a website how to run. They have to design it in such a way that end-users have no difficulty in navigating the site. Web developers are the professionals who take care of the functionality of the website. Web developers develop websites by using relevant programming languages, such as Javascript, HTML, and CSS. They have to work along with web designers, since web designers are more concerned with a website’s presence, while web developers are more concerned with the technical side of the website. A web developer can be front end developer who is responsible for website looks, front end development is how that design actually gets implemented on the web, back end developer who builds and maintains the technology needed to power the components which enable the user-facing side of a website to exist, and full-stack developer who is responsible for every element of the web development process.\n','15-web-developer.png','/landingImages/208','There is no particular qualification is required for this field. To become a specialist in this field one should have a bachelor’s in Web Technology or any related field and a postgraduate degree in Web Technology or related field from any recognized institute or University. You can also have various certifications, Diploma courses. Maximum organisations hire professionals with at least a bachelor’s degree. The candidates can also go for web application development courses provided by several private training institutes which will add value to your resume.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.@@@Admission into these courses is based on merit or state, central level, and university level entrance exams qualification.','Certificate Course in Web Technology (CWT)@@@Certificate in Web Development','Diploma in Web Technologies@@@Post Graduate Diploma in Cyber Security@@@Post Graduate Diploma in Web Technology','B.Sc. (Multimedia & Web Technology)','M.E. (Web Technology)@@@M.Sc. (e-Commerce & Web Design)@@@M.Tech. (Web Technologies)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“Websites promote you 24/7: No employee will do that.”-Paul Cookson','image/png',NULL,'image/png',NULL,NULL),(209,'Business Analyst','1_Business-Analyst.png','/subCategoryImages/209','2020-01-03 20:05:38',0,5,1,'Can you able to estimate the market condition?\n\nDo you have good analytical skills?\n\nAre you capable of taking decisions on your own?\n\nIf yes, then you can be a business analyst. Now Upgrade yourself on the latest process and IT advancements and develop yourself in communicating and collaborating skills. Nowadays there is a huge increase in industrialization and globalization of the world market. Day by day the competition in the business organization generated exponential growth in the field of business analysis.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Business Analysts are experts who use their proficiency to analyze and develop the functionalities and activities of an organization. Business analysts support their business to grow larger, stronger and more reliable. They observe closely through a company’s operations for areas of weakness and come up with solutions to overcome those weaknesses. They are mainly responsible for understanding the business, analyzing the market condition, gathering and documenting the requirement for greater efficiency of the organization.','2-Business-Intelligence-Analysts.png','/landingImages/209','To enter into this field after passing 12 class one can go for a diploma or degree courses in Computer science or some related information technology field. This helps to gain strong knowledge in technology background. One can go for postgraduation in MBA to know the tricks and information of the trade. One can also go for a certification course sponsored by the International Institute of Business Analysis (IIBA). This certification course provides a training program for business analyst. ',NULL,NULL,'Diploma in Business Management@@@Post Graduate Diploma in Business Analytics (PGDBA)',NULL,'M.B.A. (Business Analytics)@@@M.B.A. (Business Economics)@@@M.B.A. (Entrepreneurship)@@@M.B.A. + P.G.D.B.M.@@@M.Phil. (Business Administration)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ph.D. (Business Management)','Common Admission Test\n@@@Common Management Admission Test\n@@@Delhi University FMS General Ability Test\n@@@ICFAI Business School Aptitude Test\n@@@Joint Management Entrance Test\n@@@Narsee Monjee Management Aptitude Test\n@@@S P Jain Institute of Management & Research Exam\n@@@Xavier Aptitude Test\n@@@Xavier Institute of Management Bhubaneswar Entrance Exam','-','image/png',NULL,'image/png',NULL,NULL),(210,'Insurance Underwriter','6_Insurance-Underwriter.png','/subCategoryImages/210','2020-01-03 20:06:30',0,5,1,'Have you ever thought of how insurance policies are claimed?\n\nDo you have good communication skills?\n\nAre you good at analysing the data?\n\nIf yes, you are having similar qualities like an insurance underwriter. Educate yourself by developing the risk analyzing skills associated with the applications and analytical and decision making skills is needed as underwriter has to make quick and sound decisions. Mathematical skills are required as underwriting involves some calculation of risk and premium. . Job prospects in Insurance are increasing day by day. The overall industry growth is assumed to reach an all-time high in the following years. Insurance is seen as the best career in the future for the students.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Insurance underwriters are the professionals who assess and analyze the risks involved in insuring people and assets. Underwriters evaluate insurance applications and decide whether the company should approve an application, or decline to offer an insurance policy. \nThey use software to help in analyzing the risk profile of clients and to calculate costs. They closely work with insurance agents who are in direct contact with customers and with actuaries who perform complex calculations to determine the likelihood. For more complex types of insurance, underwriters depend on their own research and analytical insight.','7-Insurance-Underwriter.png','/landingImages/210','Generally, if a candidate wants to pursue this subject one should go for a bachelor degree in insurance courses or a related field as an entry-level. One can also go for masters in MBA in banking and finance or related field from a recognized institute or organization. Apart from the degree improve computer skills along with a strong background in finance will help to be in a good position in this field.','Attain 10+2 or equivalent qualification from a recognized educational Board.',NULL,'Advanced Diploma Course in Insurance Management@@@Advanced Diploma in Banking and Insurance@@@Advanced Diploma in Insurance and Risk Management@@@Diploma in Insurance and Risk Management@@@Diploma in Insurance Management@@@International Post Graduate Diploma in General Insurance (IPGDGI)@@@PGDM (Banking, Insurance & Financial Services)@@@Post Graduate Diploma in Insurance Administration@@@Post Graduate Diploma in Management in Insurance Business Management@@@Post Graduate Diploma in Management of Insurance Sector@@@Post Graduate Program in Banking & Insurance (PGPIBI)@@@Post Graduate Programme in Insurance and Risk management','B.A. (Management & Marketing of Insurance)@@@B.B.A. (Banking and Insurance)@@@B.B.A. + D.B.A. (Banking & Insurance)@@@B.B.A. Insurance Management','M.B.A. (Banking and Insurance)@@@M.B.A. + P.G.D.B.M. (Insurance and Risk Management)@@@M.B.A. Insurance Management',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Amity School of Insurance and Actuarial Science PG diploma Entrance Examination.\n@@@Birla Institute of Management Technology PGDRIM Admission Test.\n@@@Common Aptitude Test.\n@@@DS Actuarial Education Services (DS ActEd) Aptitude Test.\n@@@International Institute for insurance and Finance (IIIF) PG diploma Entrance Examination.\n@@@Narsee Monjee Institute of Management Studies PGDAS All India Admission Test.\n@@@Symbiosis National Aptitude (SNAP) Test.\n@@@Uttar Pradesh Management Common Aptitude Test UPMCAT.','-','image/png',NULL,'image/png',NULL,NULL),(211,'Game Designer','5_Game-Designer.png','/subCategoryImages/211','2020-01-03 20:17:05',0,3,0,'Have you forgotten the world while playing video games?\n\nAre you good at drawing skills?\n\nDo you passionate about game?\n\nIf yes, then you can  become a game designer by developing your skills in understanding coding languages and aware of game technology. In recent times , the gaming industry is at full swag people of all age groups were enjoyed while playing video games. \n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'     Game designers are the professionals who Design characters, art puzzles and animations for games. Game designers generate their ideas and concepts for designing the games. They are mainly responsible for defining the structure for the game, its layout and overall functionality of the game. The design and concept of the game should satisfy the people of all ages.                  \n','5-game-dsigner.png','/landingImages/211','To become an expert in this field one should have as a bachelor degree in gaming or other related field as entirely level. You can also go for post graduation in gaming or related field from any recognized institute/university to become perfect in Gaming.','Attain 10+2 or equivalent qualification from a recognized educational Board. ','Certificate in Gaming\n@@@Certificate course in Game Art & Design','Diploma in Production Gaming@@@Diploma in Game Design and Integration@@@Diploma in Animation, Gaming and Special Effect@@@Diploma in Game Design (DGD)@@@Diploma in Game Development@@@Diploma in Game Programming@@@Advanced Diploma in Game Art & 3D Game Content Creation@@@Advance