the character after understanding the concept clearly. These professionals will make animated movies, video games and cartoons.\n','1-Animator.png','/landingImages/212','To become a successful person in this field, one should a bachelor degree in animation or related field. You can also go for post-graduation in animation or related field from any recognized institute/university to become perfect in animation.','Attain 10+2 or equivalent qualification from a recognized educational Board. ','Certificate Course in Animation Designing and Multimedia (CADM)@@@Certificate Course in 2D & 3D Animation@@@Certificate Course in 2D Animation@@@Certificate Course in 3D Animation@@@Certificate Course in Advanced Maya@@@Certificate Course in Animation Technology@@@Certificate Course in Graphic Design@@@Certificate Course in Maya@@@Certificate Course in VFX (Houdini)@@@Certificate in 3D Character Design & Sculpting@@@Certificate in 3D Motion Graphics@@@Certificate in Animation@@@Certificate in Architectural Visualization@@@Certificate in Graphics@@@Certificate in VFX (Visual Effects)','Advance Diploma in Multimedia Animation and VFX@@@Advance Diploma in Multimedia, Graphics and 2D Animation@@@Advanced Diploma in Multimedia & Animation@@@Advance Diploma in Animation and Visual Effects@@@Advance diploma in Game Design & Development Application@@@Advanced Diploma in 3D Animation@@@Advanced Diploma in 3D Animation and VFX@@@Advanced Diploma in 3D Animation and VFX@@@Advanced Diploma in Animation@@@Advanced Diploma in Multimedia@@@Advanced Diploma in Visual Effects@@@Diploma in 2D & 3D Animation@@@Diploma in 2D Animation@@@Diploma in 3D Animation@@@Diploma in 3D Animation - Maya@@@Diploma in 3D Animation and VFX@@@Diploma in 3D Graphics@@@Diploma in Advanced Animation@@@Diploma in Animation and Design@@@Diploma in Animation and Visual Effects@@@Diploma in Animation Engineering (DAE)@@@Diploma in Animation Software@@@Diploma in animation, gaming and special effects@@@Diploma in Broadcast Animation@@@Diploma in Cartoon Animation (DCA)@@@Diploma in Classical Animation@@@Diploma in Digital Animation (DDA)@@@Diploma in Digital Arts@@@Diploma in Digital Film Making@@@Diploma in Game Design (DGD)@@@Diploma in Graphics and Animation@@@Diploma in Maya@@@Diploma in Multimedia (DMM)@@@Diploma in Multimedia and Animation (DMA)@@@Diploma in Multimedia, Animation and Graphic Course@@@Post Graduate Diploma in 3D Animation@@@Post Graduate Diploma in Animation Technology (PGDAT)@@@Post Graduate Diploma in Graphics & Animation','B.A. (Multimedia)@@@B.Sc. (Animation and Multimedia)@@@B.Sc. (Multimedia & Web Technology)@@@B.Sc. (Multimedia)@@@B.Sc. Multimedia (Animation & Graphics)@@@Bachelor in Multimedia (B.M.)@@@Bachelor of Multimedia Communication@@@B.A. (Animation & Computer Graphics)@@@B.A. (Animation and Graphic Design)@@@B.A. (Digital Filmmaking & Animation)@@@B.A. (Digital Media)@@@B.A. (VFX and Animation)@@@B.Design (Animation@@@B.F.A. (Animation)@@@B.Sc. (Animation & VFX)@@@B.Sc. (Animation and Film Making)@@@B.Sc. (Animation and Visual Effects)@@@B.Sc. (Animation)@@@B.Sc. (Digital Filmmaking)@@@B.Sc. (Game Designing and Development)@@@B.Sc. (Graphics, Animation and Gaming)@@@B.Sc. (Gaming)@@@B.Sc. + M.Sc. (Graphics, Animation and Gaming)@@@B.Sc. and M.Sc. (Multimedia)@@@Bachelor in Animation and Multimedia Technology@@@Bachelor in Animation and Multimedia Technology','M.A. (Multimedia)@@@M.Sc. (Multimedia and Animation)@@@M.A. (Animation)@@@M.A. (Graphic Design)@@@M.Sc. (Animation and VFX)@@@M.Sc. (Multimedia Technology)@@@M.Sc. (Multimedia)@@@Master in Animation and Special Effects',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Arena Animation Academy Entrance Exam.\n@@@DSK International Institute for Industrial Design, Animation and Gaming Entrance Exam.\n@@@Picasso Animation College Entrance Exam.\n@@@Thakur-Toonskool Advanced Animation Academy Entrance Exam.\n@@@Mudra Institute of Communications Entrance Exam.\n@@@Accel Animation Academy Entrance Exam.\n@@@FX School Of Animation Entrance Exam.\n@@@National School of Design Animation Entrance Exam.','“Animation is not the art of drawings that move but the art of movements that are drawn.” -Norman McLaren','image/png',NULL,'image/png',NULL,NULL),(213,'Tattoo Artist','11_Tattoo-Designer.png','/subCategoryImages/213','2020-01-03 20:18:33',0,3,NULL,'Have you ever drawn a design on hands with pen?\n\nDo you fell in love with tattoos?\n\nDo you love to create new designs?\n         \nIf yes, then you are keenly passionate about it. Now develop yourself by gaining knowledge on different tools and equipments of design. Gain knowledge of safety measures of skin, so that you can safely apply the tattoo while following health regulations and meeting the customer’s expectations. Nowadays people are showing more interest towards wearing tattoos which provides rapid employment growth of this field.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Tattoo artists are professionals who will create and apply tattoos based on the client\'s request. Tattoo artists is a person who creates a permanent image or words on the skin. They take many precautions to avoid infection and to ensure proper healing after the tattoo has been applied. The tattoo artist will educate their clients on proper aftercare. They take extra care about the safety of the client and in making sure that all equipment is sterilized before each appointment and that tattooing needles must be discarded after each use because there are many diseases that can easily be transferred through the blood.','11-Tattoo-Designer.png','/landingImages/213','To enter into this field there is no particular qualification is required. Anyway, if you want to pursue this subject, the basic eligibility is 10+2. The best way to learn tattoo art is to work as a trainee in a known tattoo studio. You were supposed to learn by observing senior artists in the studio, and are then made to work on dummies before starting work on clients.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“Tattoos ... are the stories in your heart, written on your skin.”-CHARLES DE LINT','image/png',NULL,'image/png',NULL,NULL),(214,'Graphic Design','6_graphic-designer.png','/subCategoryImages/214','2020-01-03 20:19:22',0,3,1,'Are you crazy towards Arts?\nCan you design a picture which can speak thousands of words?\nDo you love to create visual magic?\n\nIf Yes, then you are the born graphic designer. You are a left with a few more steps to become a graphic designer. Make yourself ready for adapting some skills by regularly practising creating new designs, gaining knowledge at different designing software. Today graphic design is spread across a broad spectrum of media both in print and digital such as Advertising, Web design, Interface design, Magazine layout, TV, Motion Graphics, Infographics, Art and Installations, and Digital art. Graphic design has shaped the culture through commercial art, political art, and pop art.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Graphic Designers are responsible for creating visual concepts by combining arts and technology. Graphic designers communicate their ideas to inspire or entertain their consumers through virtual art forms which include images, words, or graphics. They use different design elements to achieve artistic or decorative effects. They were mainly responsible for developing the overall layouts for magazines, brochures and advertisements. Graphic designers edit the visual pieces by using photo editing software applications to convey their ideas in an attractive way.','6-graphic-design.png','/landingImages/214','To become an expert in this field, one should have entry-level in a bachelor’s in graphic design or a related field and you can also go for postgraduate in Graphic design or a related field from any recognized institute/ University to gain more knowledge in graphic designing. You can also go for various certifications, Diploma courses. To reach the professional level in this field you should have good knowledge in designing, photoshop and great command towards graphical tools. ',NULL,NULL,NULL,NULL,NULL,'NID  entrance exam@@@CEED Entrance exam@@@MIT Entrance exam@@@Symbiosis Institute of Design [SID] entrance exam@@@All India Examination(Design Institute of India)','AIEEE: All India Engineering Entrance Examination@@@GATE: Graduate Aptitude Test in engineering@@@NERIST: North Eastern Region Institute of Science and Technology@@@BITSAT: Birla Institute of Science and Technology Entrance Exam@@@BEEE: Bharath University Engineering Entrance Exam@@@PGECET: Post- Graduation Engineering Common Entrance Test.@@@Kerala university M tech entrance test@@@IIT JEE: IIT Joint Entrance Examination@@@TANCET: Tamil Nadu Common Entrance Test@@@MP PET: Madhya Pradesh Pre Engineering Test',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“Graphic design is the paradise of individuality, eccentricity, heresy, abnormality, hobbies and humour.”-George Santayana','image/png',NULL,'image/png',NULL,NULL),(215,'Jewellery Designers','9_Jewelry-Designer.png','/subCategoryImages/215','2020-01-03 20:20:20',0,3,1,'Have you ever designed jewels and different accessories based on your requirements and got compliments for that?\nAre you a person with a fair sense of design and creative imagination?\nCan you able to design jewellery beyond the trend that can grab the attention of others?\nYes, you can be! This is the right career option for you. Make a career as a jewellery designer that falls under your passion. To get into this profession improve your creativity, imagination and latest technical tools related to designing. The increasing demand for gems and jewellery, creating a number of job opportunities for fully skilled jewellery designers. After reaching a professional level they can have an option to start their own business.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Jewellery designers create different types of jewel designs by using various techniques such as 3D-modelling and computer-aided design or by using a hand.\n\nJewellery designers create concepts and designs for a variety of valuables such as metals, diamonds, beads, crystals, and gemstones to make them in the form of wearable jewels for the ears, neck, hands, fingers, feet, and toes. They will create these designs by hand or latest technologies like computer-aided design (CAD) software. Many designers will make or design Jewellery as a family occupation like goldsmiths and silversmiths. Others will take this profession based on their interest in jewellery and designing. Some of them will work with fashion designers and draw or sketch the designs according to their requirements. Based on the position of jewellery designers, they also involve in specialist tasks including arranging precious and semi-precious stones, electroplating, enamelling, and engraving.\n','9-Jewelry-Designer.png','/landingImages/215','The entry-level of this field generally required to hold an undergraduate degree in jewellery design or related design courses. For the advancement in career, one should go for postgraduate courses. The candidates who wish to start their own design firm can opt combined degree in jewellery design and marketing or another business-related subject. Along with your academic study, you should also focus on computer drafting, sketching, and design processes, such as cutting, shaping, polishing, stone setting, mounting, welding and engraving which will add value to your resume.',NULL,'Advance Certificate in Jewellery Designing@@@Certificate Course in Jewellery Designing@@@Certificate Programme in Basic Jewellery Designing','Advanced Diploma in Jewellery Design@@@Diploma in Jewellery Design@@@Diploma in Jewellery Design and Manufacturing@@@Diploma in Jewellery Design and Technology@@@Graduate Diploma in Jewellery Designing - GDJD@@@Graduate Diploma in Jewellery Designing Manufacturing - GDJDM@@@Post Graduate Diploma in Gems and Jewellery Designing','B.Des. Jewellery Design@@@B.Sc. (Jewellery Design)@@@B.Sc. (Jewellery Design and Technology)@@@B.A. (Jewellery Design and Technology)','M.Des in Jewellery Design@@@Master of Design (M.Des.), Master of Design',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'National Institute of Design (NID) Exam\n@@@AIEED (All India Entrance Examination for Design)\n@@@CEED (Common Entrance Examination for Design)\n@@@National Institute of Fashion Technology (NIFT) Exam\n@@@National Institute of Design (NID) Exam\n@@@AIEED (All India Entrance Examination for Design)\n@@@CEED (Common Entrance Examination for Design)\n@@@National Institute of Fashion Technology (NIFT) Exam\n@@@MIT Institute of Design Examination\n@@@National Entrance Examination for Design (NEED)\n@@@National Level Entrance Aptitude Test (NET) conducted by the Institute\n@@@NID Entrance Test\n@@@NIFT Bangalore Entrance Exam\n@@@NIFT Entrance Exam\n@@@PEARL\n@@@School of Fashion Technology (SOFT) Entrance Exam\n@@@SRM Engineering Entrance Examination.','“Accessories are like vitamins to fashion- as such you should use them liberally.” -Charles Eames','image/png',NULL,'image/png',NULL,NULL),(216,'Information Security Analyst','Back.jpeg','/subCategoryImages/216','2020-04-02 05:41:43',0,4,0,'Are you a technology enthusiast?\nDo you really love to spend your time in front of the computer?\nDo you like occupation which involves working with data and details?\n\nIf yes, then information technology analyst is one of the careers for the people who have a passion for data and technology. Enhance your qualities by paying close attention to detail, advanced knowledge of popular and new technologies, as well as computer networking methods and applications. This is an occupation for individuals who like activities that involve a set of procedures and routines. The career in technology is offering a number of vacancies for skilled people with good perks, working conditions, and job security.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The process of designing, implementing, monitoring, and evaluating the security systems in order to protect the computer systems and data of the company will be taken care of by Information Security Analyst.\n\nAn information security analyst is responsible for protecting the information of their company by using software like routers, firewalls, data encryption programs, and other hardware devices. Provide security solutions to their companies by researching, collecting data, and designing safe strategies. Design, develop, and provide the best security for their organisation. They use various new security technologies to protect the data of their organisation effectively. They usually monitor the monitor logs and computer traffic and also take charge of implementing security principles while following strict privacy policies.\n','Back.jpeg','/landingImages/216','The basic entry-level requirement for an information security analyst is a bachelor\'s degree in information technology, computer science, computer programming, or any related subject. For career growth, one can opt for a masters degree. In addition to the academic background earning certifications in information security analysis, IT certifications and knowing new technologies can benefit you to get a job easily. If you are a person who has a diverse skillset and the experience of working then you will be the successful information security analyst.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Obtain any bachelor\'s degree in an equivalent field of study.\n',NULL,NULL,'B.Tech.\n@@@B.Sc.\n','M.Tech.\n@@@M.Sc.\n@@@M.B.A.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“Technology trust is a good thing, but control is a better one.”-Stephane Nappo\n','image/jpeg',NULL,'image/jpeg',NULL,NULL),(217,'Information Security Analyst','4_Marine.png','/subCategoryImages/217','2020-04-03 05:42:43',0,2,0,'Are you a technology enthusiast?\nDo you really love to spend your time in front of the computer?\nDo you like occupation which involves working with data and details?\n\nIf yes, then information technology analyst is one of the careers for the people who have a passion for data and technology. Enhance your qualities by paying close attention to detail, advanced knowledge of popular and new technologies, as well as computer networking methods and applications. This is an occupation for individuals who like activities that involve a set of procedures and routines. The career in technology is offering a number of vacancies for skilled people with good perks, working conditions, and job security.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The process of designing, implementing, monitoring, and evaluating the security systems in order to protect the computer systems and data of the company will be taken care of by Information Security Analyst.\n\nAn information security analyst is responsible for protecting the information of their company by using software like routers, firewalls, data encryption programs, and other hardware devices. Provide security solutions to their companies by researching, collecting data, and designing safe strategies. Design, develop, and provide the best security for their organisation. They use various new security technologies to protect the data of their organisation effectively. They usually monitor the monitor logs and computer traffic and also take charge of implementing security principles while following strict privacy policies.\n','4_Marine.png','/landingImages/217','The basic entry-level requirement for an information security analyst is a bachelor\'s degree in information technology, computer science, computer programming, or any related subject. For career growth, one can opt for a masters degree. In addition to the academic background earning certifications in information security analysis, IT certifications and knowing new technologies can benefit you to get a job easily. If you are a person who has a diverse skillset and the experience of working then you will be the successful information security analyst.\n','Attain 10+2 or equivalent qualification from a recognized educational Board.\n@@@Obtain any bachelor\'s degree in an equivalent field of study.\n',NULL,NULL,'B.Tech.\n@@@B.Sc.\n','M.Tech.\n@@@M.Sc.\n@@@M.B.A.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'“Technology trust is a good thing, but control is a better one.”-Stephane Nappo\n','image/png',NULL,'image/png',NULL,NULL);
