INSERT INTO `seven_sigma` VALUES (1,'Culture Based Education','2019-11-25 07:12:18',0,'Culture Based Education.png','/sigmaImages/1','As culture shapes minds and the future of the younger generations, we design culturally grounded content to make learning meaningful with a purpose.','#FFFFF','image/png'),(2,'Positive Parenting','2019-11-25 07:12:47',0,'Positive Parenting.png','/sigmaImages/2','Parenting is Fun and Tough. Positive parenting is intense and demanding. We dwell into numerous principles like Attachment, Respect, Empathy and Discipline.','#FFFFF','image/png'),(3,'Creativity & Co-Creation','2019-11-25 07:13:17',0,'Creativity & Co-Creation.png','/sigmaImages/3','Connecting Dots and Ideas-both common and unknown. Imagine, Ideate, Team Dynamics, Problem Bank & Solution Bank-Think Together. We Create New.','#FFFF','image/png'),(4,'Thought Leadership','2019-11-25 07:13:42',0,'Thought Leadership.png','/sigmaImages/4','We Inspire people to have Endless Passion to learn, travel to the depths of their chosen field and Spread Knowledge. Empower to Achieve.','#FFFFF','image/png'),(5,'Innovation','2019-11-25 07:14:10',0,'innovation.png','/sigmaImages/5','Idea, Experiment and Constructive Conflict. We ignite students finding Innovative Solutions. Time to Build Windmills instead of Walls. We Create Dreamers, Doers and Explorers.','#FFFF','image/png'),(6,'Dream Careers','2019-11-25 07:20:15',0,'DreamCareers.png','/sigmaImages/6','12900 Occupations and 300 Careers across the Globe and counting. We help people finding their passion, lay the perfect path, and go with intellectual Curiosity and Perfect Incentivized structure to learn and earn.','#FFFFF','image/png'),(7,'Professional Entrepreneurship','2019-11-25 07:16:58',0,'entreprenuer.png','/sigmaImages/7','Super Professions envelop the whole world. We let students understand the world of Professions and guide everyone to become the best Professional and Beyond.','#FFFFF','image/png');
/*!40000 ALTER TABLE `seven_sigma` ENABLE KEYS */;
UNLOCK TABLES;

