INSERT INTO `success_persons` VALUES (5,'Har Gobind Khorana','Was a Bio Chemist, who has been awarded Noble Prize for his research on Nucleotides in Nucleic Acids.',0,'2019-11-21 07:01:02',129),(6,'Kailasavadivoo Sivan','Is the current chairperson for ISRO. His recent accomplishment is Chandrayaan 2. He pursued his education in Aerospace Engineering.',0,'2019-11-21 07:01:02',130),(7,'Elon Musk','Elon Musk is an entrepreneur, investor and an Aerospace engineer. He founded SpaceX, an aerospace manufacturer and space Transport Company, and also co-founder Tesla. His goal is to make a better place with his designs and innovations.',0,'2019-11-21 07:01:02',130),(8,'Sonali Banerjee','The first woman captain in the Indian Merchant Navy. She has received an IMO award and started her career through Marine Engineering. She was the only girl among 1500 cadets.',0,'2019-11-21 07:01:02',131),(9,'Mason Vaugh','Is the first American who has pursued is education outside the country from India in Agricultural Engineering. He redesigned the plow and helped the farmers by cutting down their expenses and improving their agriculture.',0,'2019-11-21 07:01:02',132),(10,'Brahma Singh','Is an Indian Horticultural Scientist and is an expert in agricultural technologies for high altitude areas. He was awarded Padma Shri by Indian Government in 2014, for his research findings.',0,'2019-11-21 07:01:02',133),(11,'Tony Avent','Is a horticulturist, he developed interest in garden at the age 8 when his parents build him is first greenhouse home. Currently, he is the co-founder Plant Delights Nursery and Juniper Level Botanic Garden. The organizations are designed to protect and cultivate various flowers and plants. Currently there are more than 25,000 different plant species.',0,'2019-11-21 07:01:02',133),(12,'Tony Avent','Is a horticulturist, he developed interest in garden at the age 8 when his parents build him is first greenhouse home. Currently, he is the co-founder Plant Delights Nursery and Juniper Level Botanic Garden. The organizations are designed to protect and cultivate various flowers and plants. Currently there are more than 25,000 different plant species.',0,'2019-11-21 07:01:02',132),(13,'Soli Sorabjee','He is an Indian jurist and former Attorney-General of India. He won the Padma Vibhushan for the freedom of expression and the protection of human rights defence.Sorabjee has written a number of books, essays, and articles.',0,'2019-12-03 06:20:36',138),(14,'Ram Jethmalani','Jethmalani was an Indian lawyer and politician. He served as a chairman of the Indian Bar Council, and president of the Supreme Court Bar Association.',0,'2019-12-03 06:21:25',138),(15,'Anil Aggrawal','Anil Aggrawal is a professor of forensic medicine at the Maulana Azad Medical College, New Delhi, India. He is well known mainly for his online journal, Anil Aggrawal\'s Internet Journal of Forensic Medicine and Toxicology. He joined in Maulana Azad Medical College as a faculty member in the year 1985',0,'2019-12-03 10:54:03',139),(16,'Idupuganti Bhooshana Rao','Idupuganti Bhooshana Rao was a leading person in forensic medicine in India. He was the Founder and President of the Indian Academy of Forensic Medicine which was established in the year 1972.',0,'2019-12-03 10:55:04',139),(17,'Subhrangsu Kanta Acharyya','Subhrangsu Kanta Acharyya is an Indian geologist and also a  former director-general of the Geological Survey of India. He is recognised for his geological studies of the Himalayas and the Indo-Burmese belt which helped the later-day hydrocarbon and mineral explorations in the region. He is the author of a book called “Coal and Lignite Resources of India.',0,'2019-12-03 11:30:11',140),(18,'Shiva Balak Misra','Shiva Balak Misra is an Indian geologist, writer and social worker. He is kenned for his contribution to the knowledge of earliest life forms on earth. In the year 1968, Misra made his discovery of Ediacaran fossils attributed as the oldest multicellular life on Earth.',0,'2019-12-03 11:30:31',140),(19,'Randall Brummett','He is a Senior Aquaculture Specialist. He has 30 years of experience running fish farms and supporting fish and crustacean farming development.',0,'2019-12-05 04:21:40',141),(20,'Manish Malhotra','He is an Indian fashion designer.Manish Malhotra has started his career in 1990 by designing costumes for Bollywood Actors.He launched his label in 2005. His label got over one billion INR  turnover in 2014.',0,'2019-12-05 06:23:02',143),(21,'Sunita Kohli ','Sunita Kohli is an Indian interior designer. She is the first awardee of Padma Shri for interior designers in 1992. She played a major role in the manufacturer of fine contemporary and classical furniture.',0,'2019-12-05 06:32:38',145),(22,'Shabnam Gupta','Shabnam Gupta is an Indian interior designer. She can express stories by making use of spaces. She won a prestigious award in the arena of interior designing for the 50 most influential and significant architects and interior designers.',0,'2019-12-05 06:32:54',145),(23,'Ravish Kumar\n','Ravish Kumar was an Indian Journalist.\nHe is a TV anchor, writer,  and media personality.\nHe is also a Managing Editor of NDTV India.\n',0,'2020-01-04 16:29:29',144),(24,'Nidhi Razdan','Nidhi Razdan is an Indian Journalist.\n‘NDTV 24x7 news show Left, Right & Centre’ primary anchor.\nShe has reported broadly on a wide range of key political, economic, and social stories from the Indian subcontinent.\n',0,'2020-01-04 16:29:29',144),(25,'Anoop Singh','Anoop Singh was an Indian Wrestling coach.\nHe is a three-time national champion and international wrestler\n',0,'2020-01-04 16:29:29',153),(26,'Harbans Singh','Harbans Singh is India’s athletics coach.He also has selected for the lifetime achievement category.',0,'2020-01-04 16:29:29',153),(27,'M.S. Swaminathan','He is the founder of the MS Swaminathan Research Foundation.He has worked worldwide in collaboration with colleagues and students on a wide range of problems in basic and applied plant breeding, agricultural research, and development and the conservation of natural resources.',0,'2020-01-04 16:29:29',202),(28,'Leason Heberling Adams','Leason Heberling Adams is an American geophysicist and researcher. His principal achievement was his research on the characteristics of materials exposed to very high pressures, which he used to derive information on the nature of the Earth\'s interior. He earned the William Bowie Medal of the American Geophysical Union on the yer 1950 for his performance.',0,'2020-01-04 16:29:29',193),(29,'George Edward Backus','George Edward Backups is an American geophysicist, well known for his work with J. Freeman Gilbert on inverse methods for geophysical data. He is also highly credited with advancing the dynamo theory on the origin of the Earth\'s magnetic field.',0,'2020-01-04 16:29:29',193),(30,'Shankar Doraiswamy','Shankar Doraiswamy is an Indian oceanographer. He is the Senior Principal Scientist position at the National Institute of Oceanography in Goa. He was awarded on the year 2011 the Shanti Swarup Bhatnagar Prize for Science and Technology, the highest science award in India, in the Earth sciences category.',0,'2020-01-04 16:29:29',186),(31,'Tad S. Murty',' Tad S. Murty is an Indian-Canadian oceanographer and expert about tsunamis. He is the former president of Tsunami Society. He is an adjunct professor in the departments of Civil Engineering and Earth Sciences at the University of Ottawa. Murty is a co-editor of the journal Natural Hazards with Tom Beer of CSIRO and Vladimir Schenk of the Czech Republic.',0,'2020-01-04 16:29:29',186),(32,'Raghu Rai','Raghu Rai is an Indian photographer. He is also a  photojournalist.',0,'2020-01-04 16:29:29',184),(33,'Sooni Taraporevala','Sooni Taraporevala is an Indian photographer.She is also a  screenwriter and filmmaker.',0,'2020-01-04 16:29:29',184),(34,'Ellen Church','Ellen church was the first female air hostess. She started her career in the 1930s. In fact, she was a pilot too. Unfortunately, she is back then, airlines were not interested in hiring women. Or any job aboard a plane.',0,'2020-01-04 16:29:29',201),(35,'Naina Lal Kidwai','Naina Lal Kidwai is an Indian Chartered Accountant.She is an  Indian banker and business executive.She is also a Group General Manager and the Country Head of HSBC Indian and also a former President of the Federation of Indian Chambers of Commerce and Industry (FICCI).',0,'2020-01-04 16:29:29',192),(36,'T. N. Manoharan','T. N. Manoharan is an Indian Chartered Accountant. T. N. Manoharan is a Canara Bank Chairman and also a former president of Institute of Chartered Accountants of India (ICAI)',0,'2020-01-04 16:29:29',192),(37,'Meredith Ann Whitney','Meredith Ann Whitney is an American businesswoman recognised as “The Oracle of Wall Street” by Bloomberg. She is best known for successfully forecasting the difficulties of Citigroup and other major banks during the financial crisis of 2007–2008. She joined Oppenheimer Holdings in 1993 as a Director, and in 1995 she joined the company\'s Specialty Finance Group.',0,'2020-01-04 16:29:29',190),(38,'Abby Joseph Cohen',' Abby Joseph Cohen is an American economist and financial analyst on Wall Street. Since February 2017, she continues to serve as an advisory director at Goldman Sachs, after retiring from the leadership of its Global Markets Institute. She started her career as an economist in the year 1973 at the Federal Reserve Board in Washington, D.C., up to 1977. She worked as an economist and quantitative research director for T. Rowe Price Associates. From 1983 to 1988, she was the vice president in charge of investment strategy at Drexel Burnham Lambert.',0,'2020-01-04 16:29:29',190),(39,'Dieter Rams','He is a German industrial designer. In the year 1955, he was appointed as an architect and an interior designer at Braun and in the year 1961, he became the chief design officer at Braun. Dieter Rams have served as head of consumer products for German consumer products company Braun.',0,'2020-01-04 16:29:29',188),(40,'Naoto Fukasawa','Naoto Fukasawa is a Japanese industrial designer. He is a product design graduate from Tama Art University on the year 1980.',0,'2020-01-04 16:29:29',188),(41,'Amil Kumar Das','Amil Kumar Das was an Indian astronomer. He was the director of the Kodaikanal observatory.',0,'2020-01-04 16:29:29',155),(42,'Aryabhata','Aryabhata was an Indian astronomer. He is also an Indian mathematician.',0,'2020-01-04 16:29:29',155),(43,'Brooke Ackerly','Brooke A. Ackerly is an American political scientist. She is also a Professor of Political Science at Vanderbilt University.',0,'2020-01-04 16:29:29',185),(44,'Alan Abramowitz','Alan Ira Abramowitz is an American political scientist. He is also an author and known for his research and writings on American politics, elections, and political parties.',0,'2020-01-04 16:29:29',185),(45,'Narendra Modi','Narendra Damodardas Modi is an Indian politician. He is serving as the Prime Minister of India.',0,'2020-01-04 16:29:29',156),(46,'Tirumalai Krishnamacharya','Tirumalai Krishnamacharya was an Indian yoga teacher. He is also an ayurvedic healer and scholar. He is known as “The father of modern yoga”.',0,'2020-01-04 16:29:29',177),(47,'Baba Ramdev','Baba Ramdev was an Indian yoga Guru. He is also known for his work in Ayurveda, business, politics and agriculture. He is the co-founder of the Patanjali Ayurved Ltd.',0,'2020-01-04 16:29:29',177),(48,'Vikas Khanna','Vikas Khanna is an Indian Michelin star Chef. He is a restaurateur, cookbook writer, filmmaker and humanitarian. Vikas Khanna is also one of the judges of Star Plus series MasterChef India.',0,'2020-01-04 16:29:29',150),(49,'Sanjay Thumma','Sanjay Thumma is an Indian chef.  He is the founder of the cooking website, vahrehvah.com. Sanjay Thumma is also opened his first restaurant Sizzle India in Chicago.',0,'2020-01-04 16:29:29',150),(50,'Jonathan Gold','He was an American food critic and music critic. Jonathan Gold was the first food critic to win the Pulitzer Prize for Criticism.',0,'2020-01-04 16:29:29',149),(51,'Gael Greene','Gael Greene American restaurant critic. Gael Greene is also an author and novelist.',0,'2020-01-04 16:29:29',149),(52,'Praveen Chandra','He is an Indian Cardiologist. He is a Chairman of Interventional Cardiology at Medanta, director of Cardiac Cath Lab and acute MI Services at Max Healthcare and Consultant Cardiologist at Escorts Heart Institute and Research Center.',0,'2020-01-04 16:29:29',182),(53,'Kewal Kishan Talwar','K. K. Talwar is an Indian Cardiologist. He is also a former chairman of the Medical Council of India and former director of the PGIMER.',0,'2020-01-04 16:29:29',182),(54,'Ornella Barra','Ornella Barra is an Italian pharmacist. She is an Italian-born Monegasque businesswoman and co-chief operating officer of Walgreens Boots Alliance.',0,'2020-01-04 16:29:29',158),(55,'Caleb Bradham','Caleb Bradham is an American pharmacist. He is known as the inventor of the soft drink Pepsi.',0,'2020-01-04 16:29:29',158),(56,'Armstrong Pame','Armstrong Pame is an Indian Administrative Service (IAS) from Manipur. He won India’s Most Eminent IAS Officer Award ’ in the year 2015.',0,'2020-01-04 16:29:29',161),(57,'Anna Rajam Malhotra','Anna Rajam Malhotra is an Indian Administrative Service (IAS). She was the first woman in India to hold IAS position and she won the most prestigious award ‘Padma Bhushan’.',0,'2020-01-04 16:29:29',161),(58,'Santosh Sivan','Santosh Sivan is an Indian cinematographer. He is also a film director, producer and actor. Santosh Sivan is a founding member of the Indian Society of Cinematographers (ISC).',0,'2020-01-04 16:29:29',194),(59,'Ravi K. Chandran','Ravi K. Chandran is an Indian cinematographer. He is also a film director and he works in Tamil cinema, Malayalam cinema and Bollywood. Ravi K. Chandran is the founding member of the Indian Society of Cinematographers (ISC).',0,'2020-01-04 16:29:29',194),(60,'Shah Rukh Khan','Shah Rukh Khan is an Indian actor. Shah Rukh Khan is also a film producer and television personality. He has acted in more than eighty Bollywood films.',0,'2020-01-04 16:29:29',195),(61,'Deepika Padukone','Deepika Padukone is an Indian film actress. She is also a film producer. Time (American weekly news magazine) named her one of the 100 most influential people in the world in 2018.',0,'2020-01-04 16:29:29',195),(62,'Sonal Mansingh','Sonal Mansingh is an Indian classical dancer.Sonal Mansingh has been chosen by the President of India to become a Member of Parliament, Rajya Sabha.',0,'2020-01-04 16:29:29',196),(63,'Uday Shankar','Uday Shankar was an Indian dancer.He is also a choreographer.',0,'2020-01-04 16:29:29',196),(64,'Ravi Shankar','Ravi Shankar was an Indian musician. He is also a film director, producer and actor.a composer of Hindustani classical music. Ravi Shankar has received an India\'s highest civilian honour, the Bharat Ratna.',0,'2020-01-04 16:29:29',197),(65,'M. S. Subbulakshmi','M. S. Subbulakshmi is an  Indian musician and Indian Carnatic singer. M. S. Subbulakshmi as the first musician to be awarded the Bharat Ratna Award. She is also the first Indian musician to take the Ramon Magsaysay award.',0,'2020-01-04 16:29:29',197),(66,'Debabrata Basu','Debabrata Basu was an Indian statistician. Debabrata Basu made fundamental contributions to the foundations of statistics and also associated with the Indian Statistical Institute in India, and the Florida State University in the US.',0,'2020-01-04 16:29:29',199),(67,'Jayanta Kumar Ghosh','Jayanta Kumar Ghosh was an Indian statistician.He is an emeritus professor at Indian Statistical Institute and a professor of statistics at Purdue University.',0,'2020-01-04 16:29:29',199),(68,'Aryabhata','The first major mathematician from the classical age of Indian mathematics is Aryabhata.He is also an astronomer from the classical age of Indian astronomy.',0,'2020-01-04 16:29:29',200),(69,'Srinivasa Ramanujan','Srinivasa Ramanujan is an Indian mathematician. Srinivasa Ramanujan gave extraordinary contributions to mathematical analysis, number theory, infinite series, and continued fractions, including solutions to mathematical problems than considered unsolvable.',0,'2020-01-04 16:29:29',200),(70,'Pavan Duggal','He is an India advocate specialized in the field of Cyberlaw, E-Commerce law.He is also a Conference Director of the International Conference on Cyberlaw, Cybercrime & Cybersecurity organized by Cyberlaws.Net.He served the International Commission on Cyber Security Law as a Chairman.',0,'2020-01-04 16:29:29',205),(71,'Parry Aftab','She is an American Internet privacy and security lawyer. She is also one of the founders of cyberlaw and founder of the world\'s largest and oldest cyber safety charity. In the year 2016, She founded Cybersafety India and the StopCyberbullying and sextortion and morphing prevention initiatives for India.',0,'2020-01-04 16:29:29',205),(72,'Zia Mody','She is an Indian corporate lawyer and businesswoman.She has been known for her contribution to the legal world in India and internationally.',0,'2020-01-04 16:29:29',206),(73,'Shardul S. Shroff','He is an Indian corporate lawyer.He is also an executive chairman of the law firm Shardul Amarchand Mangaldas & Co.',0,'2020-01-04 16:29:29',206),(74,'Ram Jethmalani','Jethmalani was an Indian lawyer and politician. He served as a chairman of the Indian Bar Council, and president of the Supreme Court Bar Association.',0,'2020-01-04 16:29:29',207),(75,'Gopal Subramanium','Gopal Subramaniumis an Indian lawyer and Senior Advocate.He also served as the Solicitor General of India.',0,'2020-01-04 16:29:29',207),(76,'Michel Ancel','Michel Ancel is a Monegasque-born French video game designer for Ubisoft. He is best known for his creation the Rayman franchise, for which he was the lead designer for the first two games, and the recent Rayman Origins and its sequel Rayman Legends.',0,'2020-01-04 16:29:29',211),(77,'Walter Elias Disney','Walt Elias Disney was an American entrepreneur, animator, voice actor and film producer. A pioneer of the American animation industry, he introduced several developments in the production of cartoons.',0,'2020-01-04 16:29:29',212),(78,'Guy Aitchison','Guy Aitchison is one of the most famous tattoo artist and painter born in Michigan. He started tattooing in the year 1988. In 2012, he took part in the first International conference of the Tattoo community.',0,'2020-01-04 16:29:29',213),(79,'Bob Tyrrell','Bob Tyrrell is a famous American tattoo artist. In 2012 he participated as a jury member in the first Chaudesaigues Award, an award that recognizes the career and artwork of tattoo artists.',0,'2020-01-04 16:29:29',213),(80,'David Carson','David Carson is an American graphic designer, art director and surfer. He is well recognized for his innovative magazine design, and use of experimental typography. David Carson has won more than  230 Awards for his work in graphic design, photography, advertising and branding.',0,'2020-01-04 16:29:29',214),(81,'Ambaji Venkatesh Shinde','He is a jewellery designer New York. He’s born in 1917 in Mapusa, Goa, a Portuguese colony in India. The book \"Harry Winston The Ultimate Jeweler\" published in 1984 recognises Ambaji as \"one of the most talented designers in the world today.\"',0,'2020-01-04 16:29:29',215),(82,'Neelam Kothari','She is an Indian jewellery designer as well as an actress in Bollywood. Neelam Kothari was born in Hong Kong and she is a Gujarati-Iranian. In the year 2001, she started out commercially on her own under the name Neelam Jewels and opened a showroom in Mumbai in 2004. Then, she launched her jewellery store in Mumbai in 2011 with the name Neelam Kothari Fine Jewels.',0,'2020-01-04 16:29:29',215);
